INSERT INTO `bf_pages_meta` (`id`, `judul`, `isi`, `author`, `deleted`, `created_on`, `modified_on`, `baca`, `status_tampil`, `judul_english`, `isi_english`, `parent_id`, `meta_description`, `meta_keyword`, `meta_robots`) VALUES
(51, 'Cara Pembayaran ', '<div class="purchaseGuidelinesPaddingTop" style="padding-top: 40px; color: rgb(0, 0, 0); font-family: Ubuntu, Arial, Verdana; font-size: 12px; line-height: normal; text-align: justify;"><span style="color: rgb(20, 150, 246); font-family: ''Yanone Kaffeesatz'', Arial; font-size: 25px; line-height: 1.2em; text-transform: uppercase;">ONLINE PAYMENT</span></div>\n\n<div class="purchaseGuidelinesPaddingTop" style="padding-top: 40px; color: rgb(0, 0, 0); font-family: Ubuntu, Arial, Verdana; font-size: 12px; line-height: normal; text-align: justify;">\n<div class="purchaseGuidelinesPaddingTopSmall purchaseGuidelinesCaraPembayaranList" style="padding-top: 20px;">\n<div style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">Transfer Bank (Virtual Account)</div>\n\n<div class="purchaseGuidelinesCaraPembayaranNormal" style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Seperti layaknya transfer pada umumnya, Anda dapat membayar Registrasi melalui ATM terdekat,&nbsp;<em>internet banking</em>&nbsp;dan&nbsp;<em>m-banking. &nbsp;berikut nomer rekeningnya&nbsp;:</em></div>\n\n<div class="purchaseGuidelinesCaraPembayaranNormal" style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;"><em>MANDIRI : 0016160&nbsp;</em><span style="font-family: Ubuntu, Arial, Verdana; line-height: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;AN: REGI SEPTIAN</span></div>\n</div>\n</div>\n\n<div class="purchaseGuidelinesPaddingTop" style="padding-top: 40px; color: rgb(0, 0, 0); font-family: Ubuntu, Arial, Verdana; font-size: 12px; line-height: normal; text-align: justify;">\n<div class="purchaseGuidelinesUppercase" style="text-transform: uppercase;">\n<h2 style="font-family: ''Yanone Kaffeesatz'', Arial; font-size: 25px; margin: 0px; color: rgb(20, 150, 246);">OFFLINE PAYMENT</h2>\n</div>\n\n<div class="purchaseGuidelinesPaddingTopSmall purchaseGuidelinesCaraPembayaranList" style="padding-top: 20px;">\n<div style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">Bayar di Tempat / COD (Cash on Delivery)</div>\n\n<div class="purchaseGuidelinesCaraPembayaranNormal" style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Layanan pembayaran COD (<em>Cash on Delivery</em>) adalah pembayaran yang dilakukan pada saat registrasi. Pembayaran ini berlaku dengan syarat dan kondisi tertentu, serta hanya untuk Anda yang berada di wilayah jangkauan (kota bandung). Pembayaran COD dapat berupa tunai / cash keras, menggunakan kartu debit Mandiri, BCA, BRI, BNI.&nbsp;</div>\n\n<div class="purchaseGuidelinesCaraPembayaranNormal" style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;"><em style="color: rgb(0, 0, 0); font-family: Arial, Verdana; font-size: 12px; line-height: 20px; text-align: justify;">berikut nomer rekeningnya :</em></div>\n\n<div class="purchaseGuidelinesCaraPembayaranNormal" style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;"><em style="color: rgb(0, 0, 0); font-family: Arial, Verdana; font-size: 12px; line-height: 20px; text-align: justify;">MANDIRI : 0016160&nbsp;</em><span style="color: rgb(0, 0, 0); font-size: 12px; text-align: justify; font-family: Ubuntu, Arial, Verdana; line-height: normal;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;AN: REGI SEPTIAN</span></div>\n</div>\n</div>\n', 'Harry Ridwan Ramadan', 0, '2015-01-22 06:18:23', '2015-03-08 06:59:24', 238, 0, 'Cara Pembayaran ', '<div class="purchaseGuidelinesPaddingTop" style="padding-top: 40px; color: rgb(0, 0, 0); font-family: Ubuntu, Arial, Verdana; font-size: 12px; line-height: normal; text-align: justify;">Bhinneka.Com memudahkan pelanggan melakukan transaksi dengan menyediakan berbagai macam metode pembayaran yang nyaman dan mudah bagi Anda, baik pembayaran via internet (<i>online payment</i>) maupun pembayaran secara offline (<i>offline payment</i>). Silakan pilih yang lebih nyaman dan tepat untuk Anda.</div>\n\n<div class="purchaseGuidelinesPaddingTop" style="padding-top: 40px; color: rgb(0, 0, 0); font-family: Ubuntu, Arial, Verdana; font-size: 12px; line-height: normal; text-align: justify;">\n<div class="purchaseGuidelinesUppercase" style="text-transform: uppercase;">\n<h2 style="font-family: ''Yanone Kaffeesatz'', Arial; font-size: 25px; margin: 0px; color: rgb(20, 150, 246);">ONLINE PAYMENT</h2>\n</div>\n\n<div class="purchaseGuidelinesPaddingTopSmall purchaseGuidelinesCaraPembayaranList" style="padding-top: 20px;">\n<ol style="margin: 0px; padding-right: 0px; padding-left: 25px;">\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Transfer Bank (Virtual Account)</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Seperti layaknya transfer pada umumnya, Anda dapat membayar pesanan Anda melalui ATM terdekat,&nbsp;<i>internet banking</i>,&nbsp;<i>m-banking</i>&nbsp;atau&nbsp;<i>SMS banking</i>. Keunggulan metode ini dibandingkan dengan transfer biasa adalah Anda tidak perlu melakukan konfirmasi pembayaran karena sistem kami sudah terintegrasi. Informasi lengkap mengenai tata cara pembayaran dengan metode ini bisa dilihat&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_TransferVirtualAccount.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">di sini</a>.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>ATM Otomatis (ATM BCA)</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Metode pembayaran ini dikhususkan untuk transaksi&nbsp;<i>online</i>&nbsp;via&nbsp;<i>shopping cart</i>. Setelah selesai berbelanja, Anda dapat langsung pergi ke ATM BCA terdekat untuk melakukan pembayaran sesuai dengan Kode Perusahaan Bhinneka.Com (710319) dan ID Pesanan Anda (data ini akan diberikan setelah Anda selesai melakukan belanja). Setelah Anda melakukan pembayaran, akan terdeteksi pada sistem kami secara otomatis. Struk ATM harus disimpan sebagai bukti pembayaran / pelunasan. Informasi lengkap mengenai tata cara pembayaran dengan metode ini bisa dilihat&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_ATMBCA.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">di sini</a>.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Internet Banking</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Layanan lengkap&nbsp;<i>internet banking</i>&nbsp;dari berbagai bank memudahkan pelanggan melakukan&nbsp;<i>online payment</i>. Pastikan Anda sudah memiliki akun layanan internet banking tersebut. Pembayaran debit dengan&nbsp;<i>internet banking</i>&nbsp;dapat dilakukan melalui&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_KlikBCA.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">KlikBCA</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_BCAKlikPay.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">BCA KlikPay</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_mandiriclickpay.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">mandiri clickpay</a>, CIMB Clicks, e-Pay BRI,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_DanamonOnlineBanking.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">Danamon Online Banking</a>, dan&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_IBMuamalat.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">IB Muamalat</a>.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Kartu Kredit</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Kami juga menerima pembayaran dengan kartu kredit secara&nbsp;<i>online</i>. Kartu kredit yang digunakan haruslah kartu kredit MasterCard / Visa / JCB yang diterbitkan di negara Indonesia. Data pembeli (nama, alamat, nomor telepon, dll) harus sama dengan data pemilik kartu kredit. Pembayaran dengan BCA Card juga dapat Anda lakukan melalui&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_BCAKlikPay.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">BCA KlikPay</a>.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Kartu Debit</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Selain kartu kredit, kami juga menerima pembayaran dengan kartu debit secara&nbsp;<i>online</i>, yakni dengan&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_mandiridebit.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">mandiri debit</a>&nbsp;(khusus untuk kartu debit Mandiri yang berlogo Visa),&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_BNIDebitOnline.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">BNI Debit Online</a>&nbsp;(khusus untuk kartu debit BNI yang berlogo MasterCard), dan&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_CIMBNiagaDebit.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">CIMB Niaga Debit</a>&nbsp;(khusus untuk kartu debit CIMB Niaga yang berlogo Mastercard).</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Cicilan 0% (Tanpa Bunga)</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Anda dapat menikmati fasilitas cicilan bunga nol persen dengan menggunakan BCA Card (kartu kredit terbitan BCA) ataupun kartu kredit MasterCard / Visa (BCA, Mandiri, CIMB Niaga, BII, ANZ, UOB, Danamon, Bukopin, Mega, Permata, HSBC, dan BNI). Untuk BCA Card, caranya adalah dengan membeli produk-produk yang memiliki logo BCA KlikPay 0%, lalu memilih Cicilan BCA KlikPay 0% pada halaman&nbsp;<i>shopping cart</i>kami, kemudian berikutnya, Anda bisa menggunakan akun&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_BCAKlikPay.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">BCA KlikPay</a>&nbsp;Anda untuk membayar. Sedangkan untuk kartu kredit MasterCard / Visa, silakan pilih produk-produk yang memiliki logo bank terkait, lalu pilih metode pembayaran Kartu Kredit dan Cicilan bank yang bersangkutan pada halaman pilihan metode pembayaran.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Cicilan 0.99% (Ringan)</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Selain cicilan 0%, Anda juga dapat menikmati fasilitas cicilan ringan (untuk 3, 6, dan 12 bulan) dengan menggunakan kartu kredit Mandiri (MasterCard / Visa). Silakan pilih produk-produk yang memiliki logo Mandiri 0.99%, lalu memilih Kartu Kredit dan Cicilan Mandiri 0.99% pada halaman pilihan metode pembayaran.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Uang Elektronik</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Metode pembayaran ini memungkinkan Anda menggunakan uang elekronik (hanya dengan bermodalkan&nbsp;<i>handphone</i>&nbsp;Anda saja) untuk membayar barang belanjaan Anda secara online. Pilihan yang tersedia yakni&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_TelkomselTCash.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">Telkomsel TCash</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_XLTunai.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">XL Tunai</a>, dan&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_mandiriecash.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">mandiri e-cash</a>.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>QR Code Scan</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Metode pembayaran ini memungkinkan Anda menggunakan aplikasi perbankan atau telco pada&nbsp;<i>smartphone</i>&nbsp;Anda yang terintegrasi dengan&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_BayarPakaiQRCode.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">Bayar Pakai QR Code</a>&nbsp;untuk membayar barang belanjaan Anda secara online dengan cara memindai QR Code yang ditampilkan pada halaman pembayaran.</div>\n	</li>\n</ol>\n</div>\n</div>\n\n<div class="purchaseGuidelinesPaddingTop" style="padding-top: 40px; color: rgb(0, 0, 0); font-family: Ubuntu, Arial, Verdana; font-size: 12px; line-height: normal; text-align: justify;">\n<div class="purchaseGuidelinesUppercase" style="text-transform: uppercase;">\n<h2 style="font-family: ''Yanone Kaffeesatz'', Arial; font-size: 25px; margin: 0px; color: rgb(20, 150, 246);">OFFLINE PAYMENT</h2>\n</div>\n\n<div class="purchaseGuidelinesPaddingTopSmall purchaseGuidelinesCaraPembayaranList" style="padding-top: 20px;">\n<ol style="margin: 0px; padding-right: 0px; padding-left: 25px;">\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Bayar di Tempat / COD (Cash on Delivery)</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Layanan pembayaran COD (<i>Cash on Delivery</i>) adalah pembayaran yang dilakukan pada saat barang diterima oleh Anda. Metode ini berlaku untuk pemesanan via telp 021-2929-2828 dan&nbsp;<i>online chat</i>. Pembayaran ini berlaku dengan syarat dan kondisi tertentu, serta hanya untuk Anda yang berada di wilayah jangkauan pelayanan pengantaran oleh armada kirim kami sendiri. Informasi lengkap area layanan COD dan tarif pengiriman bisa dilihat&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_tarif_pengiriman.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">di sini</a>. Pembayaran COD dapat berupa tunai / cash keras, menggunakan kartu debit Mandiri, BCA, BII, dan CIMB Niaga, maupun kartu kredit berlambang MasterCard / Visa.&nbsp;<i>Convenience fee</i>&nbsp;dikenakan pada kartu kredit tertentu. Silakan informasikan kepada&nbsp;<i>sales officer</i>&nbsp;kami yang melayani Anda bentuk pembayaran apa yang Anda inginkan.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Kartu Kredit &amp; Cicilan 0% (Tanpa Bunga)</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Pembayaran dengan kartu kredit berlambang MasterCard / Visa dengan&nbsp;<i>swipe card</i>&nbsp;dapat dilakukan di tempat Anda (lihat metode COD) maupun di toko-toko kami. Anda dapat menikmati pula pembelian produk dengan cicilan bunga nol persen. Temukan produk yang berlogo 0% dengan kartu kredit&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_bca.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">BCA</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_mandiri.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">Mandiri</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_cimb_niaga.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">CIMB Niaga</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_bii.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">BII</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_anz.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">ANZ</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_uob.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">UOB</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_bukopin.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">Bukopin</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_mega.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">Mega</a>,&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_permata.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">Permata</a>, atau&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_carapembayaran_cicilan_hsbc.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">HSBC</a>, dimana Anda bisa mengkonversi transaksi tersebut menjadi cicilan 0%. Silakan hubungi&nbsp;<i>sales officer</i>&nbsp;kami untuk bantuan atau ketika Anda bertransaksi, silakan sebutkan cara bayar yang Anda inginkan. Jika Anda kurang nyaman melakukan transaksi COD, Anda juga dapat bertransaksi langsung ke toko-toko kami. Silakan kunjungi toko kami:&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_ourstores.aspx" style="color: rgb(0, 0, 0); font-weight: bold;"><i>Our Store Locations</i></a>.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Transfer Bank</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Metode ini merupakan pembayaran melalui transfer bank seperti pada umumnya. Jika Anda belanja melalui&nbsp;<i>shopping cart</i>, maka no. rekening untuk transfer akan muncul pada halaman pembayaran&nbsp;<i>shopping cart</i>&nbsp;Anda. Jika Anda ingin belanja secara&nbsp;<i>offline</i>,&nbsp;<i>sales officer</i>&nbsp;kami akan menginformasikan no. rekening resmi Bhinneka.Com. Perlu diperhatikan, jika Anda melakukan setoran tunai ataupun transfer via ATM, silakan melakukan transfer persis sesuai dengan nilai transaksi supaya staf kami lebih mudah untuk memverifikasi dana Anda. Anda juga harus melakukan konfirmasi pembayaran via&nbsp;<i>website</i>&nbsp;kami untuk transaksi&nbsp;<i>online</i>, sedangkan untuk transaksi&nbsp;<i>offline</i>, silakan Anda informasikan setelah melakukan transfer pembayaran kepada&nbsp;<i>sales officer</i>&nbsp;kami yang melayani Anda.</div>\n	</li>\n	<li style="margin: 0px; padding-bottom: 10px; font-family: ''Yanone Kaffeesatz'', Arial; font-size: 22px;">\n	<div>Proses Perusahaan</div>\n\n	<div class="purchaseGuidelinesCaraPembayaranNormal" style="font-family: Arial, Verdana; font-size: 12px; line-height: 20px; padding: 10px 0px;">Berbelanja untuk kebutuhan perusahaan Anda kini semakin mudah dengan menggunakan pembayaran dengan cara tempo. Untuk melayani pelanggan korporat dan pemerintahan, kami mempunyai tim penjualan yang terlatih dan kompeten, serta siap memberikan konsultasi produk dan solusi IT yang paling tepat dan hemat untuk investasi Anda. Silakan klik&nbsp;<a href="http://www.bhinneka.com/aspx/others/oth_solusi_Corporate_Account.aspx" style="color: rgb(0, 0, 0); font-weight: bold;">di sini</a>&nbsp;untuk mengetahui informasi lengkap mengenai cara berbelanja untuk korporasi.</div>\n	</li>\n</ol>\n</div>\n</div>\n', 0, NULL, NULL, NULL);
