INSERT INTO `bf_soal` (`id`, `question_name`, `answer1`, `answer2`, `answer3`, `answer4`, `answer5`, `answer`, `ujian_id`, `urutan`) VALUES
(26, 'Terdapat gambaran EKG seperti di bawah ini :\n<p>\n<img src="https://lh3.googleusercontent.com/-4QFEusaf5vg/VPssEDrtkEI/AAAAAAAAB-s/NATTo_IWUWM/w328-h132-no/1.png" style="width:300px;">\n</p>\nDiagnosis adalah :', 'Atrial flutter', 'Sinus takikardia', 'Supraventricular takikardia', 'Ventikel takikardia', 'Atrial fibrilasi', '3', 8, 2),
(27, 'Seorang laki-laki 42 tahun datang ke puskesmas dengan keluhan buang air besar cair >10x/hari disertai lendir dan darah. Keluhan disertai nyeri perut, nafsu makan berkurang dan badan terasa lemas. Pada pemeriksaan fisis didapatkan TD: 120/80 mmHg, suhu 37°C. Terdapat nyeri tekan suprasimfisis. Pada pemeriksaan tinja didapatkan ektoplasma pseudopodium dan berisi eritrosit. Apakah diagnosis yang paling tepat?', 'Skistosomiasis', 'Balantidiosis', 'Trichuriasis', 'Amebiasis', 'Giardiasis', '4', 9, 1),
(28, 'Seorang anak laki-laki berusia 24 bulan dibawa orang tua ke puskesmas dengan berat bdan yang tidak naik selama 3 bulan terakhir. Anak tidak mengalami demam lama, tidak diketahui adanya penderita TB dewasa pada anggota keluarga. MEnurut pedoman TBC anak di Indonesia, apakah anamnesis tambahan lain yang paling perlu ditanyakan kepada orang tua?', 'Keringat bnyak terutama malam hari', 'Pembesaaran KGB', 'Kejang', 'Riwayat vaksinasi BCG', 'Batuk ≥ 3 minggu ', '5', 27, 3),
(29, 'Seorang anak laki-laki berusia 3 bulan dibawa oran tuanya ke UGD dengan keluhan sesak napas yang diahului panas badan dan batuk pilek. Pada pemeriksaan fisik didapatkan anak komposmentis, tampak sakit berat, RR 56 x/menit, suhu 38,1oC, pernapasan cuping hidun, retraksi suprasternal, epigastrium, dan intercostal. Pada pemeriksaan paru didapatkan suara pernapasan vesikular, crackles, wheezing, dan ekspirasi memanjang. Pemeriksaan lab : Hb 11,4 g/dl, leukosit 5000/ul, trombosit 220.000/ul, dan hitung jenis leukosit 0/1/0/68/28/4. Apakah diagnosis yang paling mungkin ?', 'Bronkopneumonia', 'Pneumonia lobaris', 'Asma bronkiale', 'Bronkiolitis', 'Bronchitis', '4', 8, 3),
(30, 'Perempuan,  26 thn, datang ke poli dengan diare terus menerus selama > 1 bulan disertai demam dan batuk berdahak berkepanjangan. Pasien juga mengeluhkan gatal dikemaluannya. Suaminya meninggal dengan keluhan yang sama, pada pemeriksaan fisik didapatkan TD: 100/60 mmHg, T: 38,50C, konjungtiva pucat, bercak putih pada palatum, ronkhi (+), wheezing (-), apa pemeriksaan lab yang diperlukan untuk menegakkan diagnosis?', 'Anti HCV', 'HbSAg', 'Anti HIV', 'CD4', 'Sputum BTA', '4', 9, 2),
(31, 'Wanita 30 tahun datang dengan keluhan cepat lelah. Pada pemeriksaan didapatkan anemia, spoon nail, Hb 7 g/dl. Dokter menyarankan pasien untuk transfusi. Kemudian dokter menjelaskan indikasi dan efek samping transfusi. Setelah pasien mengerti dokter meminta persetujuan transfusi. Kaidah bioetik yang mendasari adalah ?', 'Justice', 'Autonomy', 'Altruism', 'Beneficience', 'Non malifience', '2', 8, 4),
(32, 'Seorang wanita berusia 26 tahun dengan G1P0A0 datang dengan keluhan demam sejak 4 hari yang lalu, nyeri kepala, mual, muntah, menggigil. Pada pemeriksaan fisik didapatkan :  TD :120/80 mmHg, nadi: 84 x/menit, respirasi :16x/menit, suhu : 38,9°C. pada pemerisaan apus darah tepi didapatkan : eritrosit membesar, terdapat cincin biru pada eritrosit, berbentuk Accole. Terapi pada malaria yang kontraindikasi pada ibu hamil?', 'meflokuin', 'klorokuin', 'kina', 'primakuin ', 'artesunat', '4', 9, 3),
(33, 'Seorang pria berusia 26 tahun datang ke puskesmas mengatakan dia berencana akan melakukan perjalanan ke flores. Terapi malaria pada daerah endemic yang resisten klorokuin?', 'primakuin', 'meflokuin', 'doksisiklin', 'amodiakuin', 'arthemeter', '3', 9, 4),
(34, 'Seorang laki-laki usia 55 tahun mengeluh kencing yang berwarna merah, tidak nyeri. Dari pemeriksaan laboratorium didapatkan ureum dan kreatinin normal. Diagnosis pasien adalah ?', 'Tumor ginjal', 'Tumor ureter', 'Tumor ganas prostat', 'Tumor buli', 'Tumor testis', '4', 8, 5),
(35, 'Seorang laki-laki 28 tahun datang ke RS dengan keluhan demam sejak 2 minggu lalu, demam disertai menggigil. Dua minggu yang lalu pasien pergi ke Papua. Pada pemeriksaan fisik didapatkan :  TD :120/80 mmHg, nadi: 84 x/menit, respirasi :16x/menit, suhu :38,9° C, pada Apus darah tepi ditemukan eritrosit membesar dengan ring form berbentuk Accole di dalamnya?', 'M. falcifarum', 'M. vivax', 'M. ovale', 'M. Malariae', 'M. Quartana', '1', 9, 5),
(36, 'Seorang anak laki-laki berusia 13 tahun datang ke poliklinik dengan keluhan panas badan selama 16 hari. Mula-mula panas dirasakan terutama pada malam hari, tetapi menginjak hari ke-7 panas badan dirasakan baik pagi maupun malam hari. Keluhan disertai dengan nyeri kepala dan perut, batuk, mual dan nafsu makan menurun. Pada pemeriksaan fisik  apakah yang paling mungkin ditemukan ?', 'Takiakrdia', 'Pembesaran kelenjar getah bening', 'Rose spot', 'Hepatosplenomegali', 'Ruam konvalesens', '3', 8, 6),
(37, 'Seorang laki-laki 24 tahun mengalami kecelakaan motor dengan luka terbua di kepala. Direncanakan untuk melakukan penjahitan luka. Tindakan antisepsis yang tepat dilakukan adalah ?', 'Diguyur oleh klorin', 'Diolesi dengan antibiotic', 'Diolesi dengan iodin 3%', 'Dialiri dengan air mengalir yang steril', 'Dicuci dengan air sabun', '4', 8, 7),
(38, 'Seorang pria usia 25 tahun datang dengan keluhan demam disertai dengan sakit kepala berdenyut, sesak, seluruh badan terasa sakit, nafsu makan berkurang dan lemas, BAB hitam seperti petis, BAK seperti teh. Pada pemeriksaan didapatkan TD: 100/60 mmHg, nadi: 100 kali/menit, respirasi 26 kali/menit, suhu: 39,80C, laboratorium Hb: 10 mg/dL, leukosit : 18.000, LED : 18 Hmt : 55% ureum : 90 mg/dL kreatinin: 8,5 mg/dL. Pasien tersebut didiagnosa  weil disease, apa urutan penangannya?', 'Hemodialisa, rehidrasi, diet rendah protein', 'O2, infus , antibiotic, diet, balance cairan', 'O2, infus, antibiotik, diet, hemodialisa', 'Hemodialisa, diet, infus', 'O2, rehidrasi, hemodialisa, antibiotik', '3', 9, 6),
(39, 'Seorang bayi laki-laki usia 4 bulan datang ke UGD bagian anak dengan diare yang encer, tidak berdarah sejak 3 hari yang lalu. Dia juga mengalami muntah dan demam yang tidak begitu tinggi dalam 2 hari terakhir ini. Pada pemeriksaan fisik tampak lemah, irritable, dan sangat haus. Mata dan fontanelnya cekung serta kulitnya lambat kembali pada cubitan. Berat badan 5 kg. Tanda vital : tekanan darah 90/50 mmHg, detak jantung 170x/menit, suhu 37,8oC. Apakah diagnosis yang paling mungkin ?', 'Diare akut tanpa dehidrasi', 'Diare akut dehidrasi ringan sedang', 'Diare akut dehidrasi berat', 'Diare akut syok hipovolemik', 'Diare akut syok septik', '2', 8, 8),
(40, 'Seorang pria usia 45 tahun datang keluhan bengkak dan gatal dikaki kanan, dari anamnesis didapatkan pekerjaannya adalah bertani, tidak suka pakai alas kaki, dari pemeriksaan fisik ditemukan garis linear berkelok-kelok kemerahan disertai papul dan vesikel disekitarnya, apa penyebabnya?', 'Strongyloides stercoralis', 'W. brancofti', 'B. Malayi', 'Ancylostoma duodenale', 'Ascaris lumbricoides', '4', 9, 7),
(41, 'Seorang wanita 21 tahun primigravida mengeluh per vaginam sejak 5 hari yang lalu. Kehamilannya 12 minggu. Tidak ada riwayat kram perut atau nyeri perut sebelumnya. Pada pemeriksaan fisik tidak ada abnormalitas. Pemeriksaan obstetrik tampak tinggi fundus uteri setinggi umbilicus, tanpa bunyi jantung anak. Pemeriksaan USG menunjukkan gambaran seperti badai salju tanpa bayi. Apakah diagnosis yang paling mungkin ?', 'Missed abortion', 'Abosrtus imminens', 'Abortus inkomplit', 'Mola hidatosa parsial', 'Mola hidatosa komplit', '5', 8, 9),
(42, 'Seorang anak 12 tahun masuk RS dengan penurunan kesadaran yang dialami sejak 1 jam yang lalu. Sebelumnya pasien demam, menggigil, berkeringat, nyeri otot, dan mual muntah. Dari pemeriksaan fisik didapatkan S 390C, sklera ikterik, konjungtiva anemis. Dari hasil pemeriksaan darah didapatkan ring worm dalam eritrosit dan titik scuffner dan sitoplasma biru. Tipe malaria yang mungkin:', 'M. falciparum', 'M. Vivax', 'M. Ovale', 'M. Malariae', 'M. tropica', '2', 9, 8),
(43, 'Seorang perempuan berusia 25 tahun, menikah, datang ke dokter dengan keluhan mual dan muntah setiap pagi hari. Pada pemeriksaan fisik ditemukan putting membesar. Apakah parameter yang harus ditemukan pada pemeriksaan laboratorium ?', 'Estrogen', 'Progesterone', 'B-HCG', 'Prolactin', 'Tiroksin', '3', 8, 10),
(44, 'Seorang petani, mengeluhkan nyeri pada otot disetai demam, sakit kepala, mual dan muntah. Pada pemeriksaan fisik didapatkan TD : 110/60 mmHg, nadi 66 kali/menit, respirasi 18 kali/menit, suhu 36,80C dan terdapat bengkak pada kaki kanan dan disertai benjolan pada ingunal kanan. Penyebab penyakit tersebut adalah?', 'Wucheria bancrofti', 'Brugia malayi', 'Strongyloides stercoralis', 'Ancylostoma braziliense', 'Schistosoma', '1', 9, 9),
(47, 'Seorang anak laki-laki umur 7 tahun, dibawa oleh ibunya ke PKM dengan KU keluar cacing berwarna putih kekuningan dengan panjang kurang lebih 20 cm pd saat BAB. Anak merasa lemah, nafsu makan berkurang, Pada Pemeriksaan fisik tidak ditemukan kelainan. Pada pemeriksaan feses ditemukan telur berbentuk oval beridinding sel tebal dan bergelombang berwarna kuning kecoklatan. Penyebabnya adalah:', 'Ascaris lumbricoides', 'Taenia solium', 'Trichuris trichiura', 'Taenia saginata', 'Vermiculais sp', '1', 9, 10),
(48, 'Seorang wanita 30 tahun datang ke puskesmas dengan keluhan lemah pada anggota gerak atas dan bawah. Keluhan disertai nyeri pinggang hebat dan mulut yang tidak bias mencucu sehingga sulit makan dan minum. Riwayat infeksi disangkal. Pemeriksaan fisik tanda vital dalam batas normal. Pemeriksaan neurologis tetaparase dan parase nervus III dupleks. Pemeriksaan lab dalam batas normal. Apa diagnosis pasien tersebut ?', 'Guillan bare syndrome', 'Paralisis periodik', 'Poliomyositis', 'Myasthenia gravis', 'Poliomyelitis', '5', 8, 11),
