(87, 'Wanita 24 tahun datang dengan benjolan dileher sebesar telur ayam. Dia juga mengeluh jantung berdebar debar, berkeringat, demam, menggigil, Pada pemeriksaan fisik didapatkan TD: 150/90 mmHg, nadi: 100 kali/menit, respirasi: 28 kali/menit, suhu: 37,90C, benjolan sebesar 4 cm, mobile, konsistensi kenyal dan nyeri. Hasil laboratorium FT4 dan T3 normal, TSH tinggi. Diagnosa dari pasien tersebut?', 'Grave disease', 'Ca tiroid', 'Tiroiditis', 'Tirotoksikosis', 'Hipotiroid ', '3', 10, 10),
