(96, 'Pasien perempuan usia 46 tahun datang ke klinik dengan keluhan sering buang air kecil dan suka merasa lapar tetapi berat badan terasa menurun kurang lebih selama 3 minggu terakhir, dilakukan pemeriksaan dengan hasil TD: 120/80 mmHg, nadi 80 kali/menit, respirasi : 18 kali/ menit, suhu : 370C. TB: 149 cm BB: 70 Kg . laboratorium dengan hasil GDS 350 mg/dL.  Pilihan terapi OHO pada pasien ini adalah?', 'Glibenklamid', 'Glikinid', 'Insulin', 'Metformin', 'Pioglitazon ', '4', 10, 15),
(97, 'Seorang laki-laki berusia 40 tahun datang ke dokter praktek umum karena mengalami demam sejak 1 minggu yang lalu. Demam dirasakan semakin hari semakin meningkat. Keluhan disertai menggigil, mata kemerahan, nyeri-nyeri otot terutama di bagian betis. Lingkungan rumah pasien banyak terdapat tikus. Pada pemeriksaan fisik didapatkan tekanan darah 110/70 mmHg, denyut nadi 90x/menit, nafas 20x/menit, suhu 38,5oC, injeksi konjungtiva (+). Pemeriksaan laboratorium darah didapatkan leukosit 15.000/mm3. Pemeriksaan visualisasi lapang gelap mikroskop darah didapatkan adanya bakteri berbentuk spiral. Apakah terapi antibiotik yang tepat ?', 'Doksisiklin 100 mg 2x1', 'Kloramfenikol 500 mg 4x1', 'Ciprofloksasin 250 mg 3x1', 'Kloroquin 500 mg 3x1', 'Trimetroprim 160 mg 2x1', '1', 19, 15),
(98, 'Pasien pria usia 46 tahun datang ke puskesmas dengan keluhan sering buang air kecil dan suka merasa lapar tetapi berat badan terasa menurun kurang lebih selama 2 minggu terakhir, dilakukan pemeriksaan dengan hasil TD: 120/80 mmHg, nadi 80 kali/menit, respirasi : 18 kali/ menit, suhu : 370C. TB: 170cm, BB:63kg, apa nilai BMI pada pasien ini?', 'Overweight', 'Normal', 'Obese 1', 'Obese 2', 'Underweight', '4', 10, 16),
