(128, 'Pasien pria usia 26 tahun datang dengan keluhan setiap gosok gigi gusi berdarah, juga disertai dengan sakit kepala dan terasa demam sejak 1 minggu terakhir. Pada pemeriksaan fisik didapatkan pasien tampak pucat terlihat lemah, TD: 100/60 mmHg, nadi : 65 kali/menit, respirasi 22 kali/menit, suhu : 37,70C. konjungtiva anemis, gusi tampak titik perdarahan. laboratorium Hb:8,0 gr/dL,  LED: 12 Hmt: 30% leukosit 150.000/mm3, trombosit : 100.000/mm3. morfologi darah tepi limfoblas (+). Diagnose dari pasien ini adalah?', 'ITP', 'Thalasemia', 'Leukemia', 'Anemia Hemolitik', 'Hemophilia ', '3', 11, 3),
