(132, 'Seorang dokter terlibat pada penelitian sederhana antara riwayat merokok pada ibu dengan BBLR. Variable merokok adalah perokok dan bukan perokok. Variabel BBLR adalah berat badan bayi selama 0-24 jam setelah lahir dalam Kg. Uji statistic yang digunakan adalah ?', 'T independen', 'T berpasangan', 'Anova', 'Chi Square', 'Regresi linier  ', '1', 20, 11),
