(134, 'Pria umur 25 tahun, datang ke IGD RS dengan keluhan nyeri dan bengkak pada pergelangan tangan kanan, 1 jam post KLL sepeda motor. Foto wrist join AP : tampak garis inkomplit pada 1/3 distal os radius dan 1/3 distal os ulna. Tidak tampak dislokasi. Diagnosis yang tepat untuk kasus di atas adalah ?', 'Fraktur Smith', 'Fraktur Colles ', 'Fraktur Montegia', 'Fraktur Galleazi', 'Fraktur Carpalia', '4', 20, 13);
INSERT INTO `bf_soal` (`id`, `question_name`, `answer1`, `answer2`, `answer3`, `answer4`, `answer5`, `answer`, `ujian_id`, `urutan`) VALUES
(135, 'Pasien perempuan usia 2 tahun datang dengan keluhan nyeri telingan sejak kemarin. Nyeri didahuli adanya batuk pilek. Pasien juga baru saja bepergian menggunakan pesawat terbang. Sampai saat ini pasien masih minum susu menggunakan dot. Diagnosis pasien adalah ?', 'Otitis media efusi', 'Otitis media akut', 'Miringitis', 'Timpanitis', 'Labirinitis', '1', 20, 14),
(136, 'Seorang laki-laki 40 tahun datang dengan keluhan badan lesu dan mudah lelah sejak 2 minggu yang lalu. Keluhan ini sebenarnya sudah dirasakan sejak 2 tahun yang lalu, disertai demam ringan dan beberapa kali mendapatkan transfusi. Pasien bekerja di bidang radiologi sejak 20 tahun. Pemeriksaan fisik didapatkan konjungitva anemis (+), purpura (+). Pemeriksaan laboratorium : Hb 8 g/dl, al : 1500/ul, AT : 80.000/ul. Diagnosis kasus diatas adalah ?', 'Anemia hemolitik', 'Anemia aplastic', 'Leukemia limfoblastik kronik', 'Hemophilia', 'Anemia defisiensi besi', '2', 20, 15),
(137, 'Seorang wanita usia20 tahun datang dibawa oleh suaminya ke IGD dengan kondisi lemas dan keluhan mual muntah. Pasien mengeluarkan makanan yang dimakannya. Mual dirasakan terlebih ketika mencium bau gorengan. Mual muntah sidah dirasakan sejak 1 minu ini. Pasien sudha tidak haid sejak 1 bulan ini. Tes kehamilan (+). Pada pemeriksaan fisik didapatkan tekanan darah 100/70 mmHg, denyut nadi 80x/menit, RR 20x/menit. Etrapi yang tepat untuk pasien adalah ?', 'Tiamin', 'Piridoksin', 'Ondansentron', 'Domperidone', 'Metoklorpramid', '3', 20, 16),
(138, 'Seorang anak laki-laki berusia 5 tahun dibawa ibunya ke puskesmas dengan keluhan gatal di bagian dubur sejak 2 hari yang lalu. Gatal terutama pada malam hari, tidak ada demam dan diare. Pada pemeriksaan fisik didapatkan bekas garukan di sekitar dubur dan didapatkan seperti ampas kelapa pada anus. Terapi untuk kasus ini adalah?', 'Bithionol', 'Mebendazol', 'Praziquantel', 'Oxantel pamoat', 'Diethilcarbamazine ', '2', 11, 7),
(139, 'Seorang perempuan 30 tahun dibawa keluarganya ke IGD RS dengan keluhan keluar darah bergumpal dari organ kewanitaannya sejak 4 jam yang lalu, disertai dengan nyeri perut. Pasien mempunyai riwayat abortus ebrulang dan ini adalah kehamilan yang ke-4, dengan usia kehamilan 12 minggu. Pada pemeriksaan ginekologik ditemukan kanalis servikalis terbuka selebar 1 jari dan besar uterus sesuai dengan kehamilan 8 minggu. Apakah diagnosis yang paling mungkin ?', 'Abortus komplit', 'Abortus inkomplit', 'Abortus imminens', 'Abortus isnispiens', 'Missed abortus', '2', 20, 17),
(140, 'Bayi laki-laki usia 9 bulan datang bersama ibunya ke puskesmas dengan keluhan kemerahan pada kedua pipi. Tidak disertai demam, pada pemeriksaan dermatologis tampak lesi eritem pada pipi kiri dan kanan, batas tidak tegas, skuama halus. Terdapat Riwayat asma pada ibu dan nenek dari pasien. Terapi topikal apa yang tepat ?', 'Krim acyclovir', 'Krim hidrokortison', 'Krim permetrin', 'Krim antibiotik', 'Krim heparin', '2', 11, 8),
(141, 'Seorang laki-laki berusia 35 tahun datang kepada anda dengan keluhan nyeri pada ulu hati. Keluhan disertai dengan muntah pada malam hari terutama terjadi 3 jam setelah makan malam. Manakah faktor di bawah ini yang paling tepat terjadi pada kasus diatas ?', 'Kurang baiknya dari lower esophageal sphincter', 'Motilitas esophagus yang normal', 'Tidak terdpaat peningkatan empedu dan lysolecithin', 'Tidak merokok dan tidak mengonsumsi alcohol', 'Adanya mikroorganisme pada distal esophagus', '1', 20, 18),
(142, 'Perempuan 26 tahun keluhan cepat lelah sejak 6 bulan yang lalu. Pasien juga mengeluh sering berkeringat, berat badan berkurang. Pemeriksaan fisik tanda vital dalam batas normal. Teraba tiroid leher membesar. Bruit (+). Pemeriksaan penunjang yang paling tepat untuk diagnosis ?', 'TSH dan free T4', 'T3 dan T4', 'Free T3 dan free T4', 'TSH', 'FT4', '1', 20, 19),
(143, 'Laki-laki, 32 tahun, datang dengan keluhan keluar duh tubuh dari kemaluan. Riwayat berhubungan dengan PSK 1 minggu lalu. Tidak nyeri. Pada pemeriksaan didapatkan secret putih keluar dari kemaluan,tidak ada ulkus, dan pada laboratorium didapatkan bakteri diplokokus gram negatif. Apa diagnosisnya?', 'Uretritis gonore', 'Uretritis non gonore', 'Sifilis', 'Herpes simpleks', 'Kondiloma akuminata', '1', 11, 9),
(144, 'Yang harus diperiksa untuk menghentikan RJP setelah 15 menit RJP adalah ?', 'Tidak ada tanda-tanda kehidupan', 'Ada kaku mayat', 'Lebam mayat', 'Pupil midriasis dan tidak reaktif', 'Asistole', '4', 20, 20),
(145, 'Pria usia 40 tahun datang dengan keluhan Muntah dan mual 1 minggu. Sebelumnya 1 bulan yang lalu mengkonsumsi obat TBC dan nafsu makan menurun,  BAB warna kuning pucat, konsistensi lunak. Pada pemeriksaan fisik TD 120/90, nadi : 80 kali/menit, respirasi : 20 kali/menit, Sclera ikterik, hepar teraba 1 jari di bawah arcus costae, 2 jari di bawah processus xyphoideus, permukaan licin, tepi tajam, lien tidak teraba. Laboratorium : SGOT 725, SGPT 1170, bilirubin total 6, bilirubin direct 3,9 , bilirubin indirect 2,1. Apa diagnosa terhadap pasien ini?', 'Hepatitis akut', 'Hepatitis kronik', 'Hepatitis fulminan', 'Hepatitis dormant', 'Hepatitis imbas obat', '5', 11, 10),
(146, 'Seorang perempuan berusia 35 tahun datang ke praktik dokter umum dengan keluhan utama keluar cairan putih dari alat kelamin. Pasien adalah seorang promiskus dengan salah satu mantan pasangannya adalah penyandang infeksi HIV. Pasien merasa takut dia akan terkena penyakit yang sama. Dokter menyarankan melakukan pemeriksaan untuk memastikan kemungkinan tersebut. Termasuk apakah pemeriksaan yang diusulkan oleh dokter tersebut ?', 'Random screening', 'Diagnostic screening', 'Mass screening', 'Multiphase screening', 'Opportunistic screening ', '5', 21, 1),
(147, 'Laki2, 55 thn, datang ke UGD RS dgn keluhan perut buncit sejak 1 bulan yang lalu, semakin lama semakin membesar, disertai penurunan berat badan. Pada pemeriksaan fisik TD 120/90, nadi : 80 kali/menit, respirasi : 20 kali/menit, Sclera ikterik pada palpasi abdomen didapatkan hepar teraba noduler, konsistensi padat keras, tes undulasi +, shifting dullness +, HbsAg +, Anti Hbc +, pada parasintesis didapatkan cairan serosanguin, apa diagnosanya?', 'Hepatoma', 'Auto imun hepatitis', 'Wilson disease', 'Steatosis hepatis', 'Hepatic necrosis', '1', 11, 11),
(148, 'Seorang laki-laki berusia 55 tahun datang ke puskesmas dengan keluhan pusing berputar mendadak sejak 2 hari. Keluhan disertai dengan mual dan muntah hebat serta berkeringat. Keluhan berlangsung selama 30 menit dan memberat dengan perubahan posisi kepala. Pasien juga merasakan penurunan pendengaran, telinga berdenging, dan telingan terasa penuh. Pada pemeriksaan fisik tidak ditemukan adanya kelainan. Apakah patofisiologi yang mungkin ?', 'Hydrops endolimfe', 'Neuritis vestibular', 'Kanalithiasis', 'Infeksi viral', 'Labirinitis', '1', 21, 2),
(149, 'Seorang laki-laki 42 tahun masuk UGD RS karena nyeri perut kanan atas. Keluhan ini juga disertai demam sejak 1 minggu yang lalu disertai BAB cair dengan lendir dan darah. Pada pemeriksaan fisis umum, tampak sedikit ikterus, temperature 37,9°C. Pada pemeriksaan fisik abdomen, hepar teraba 2 jari bawah arcus costae. Terdapat nyeri tekan pada abdomen kanan atas. Hasil lab menunjukkan peningkatan SGOT dan SGPT. Hasil USG abdomen terdapat gambaran lesi anechoic pada hepar berbatas tegas dengan internal echo. Apakah diagnosis paling tepat untuk pasien ini?', 'Abses hepar', 'Kista hepar', 'Hepatoma', 'Hemangioma hepar', 'Hepatitis akut', '1', 11, 12),
(150, 'Seorang laki-laki berusia 55 tahun dibawa keluarganya ke UGD dengan keluhan nyeri seluruh eprut sejak 2 hari yang lalu. Nyeri dimulai dari ulu hati kemudian menyebar ke seluruh perut. Pasien tampak berkeringat dingin dan letargi. Pasien memiliki riwayat nyeri ulu hati berulang selama setahun ini. Pasien selalu meminum aspirin untuk keluhan sakit kepala yang dirasakan sejak 5 tahun yang lalu. Pada pemeriksaan ditemukan nyeri tekan, nyeri lepas dan kram otot. Perut tampak kembung dan bisisng usus menurun. Batas paru hepar menurun. Tekanan darah 100/60 mmHg, andi 120 x/menit, suhu 38oC. apakah tindakan awal yang paling tepat ?', 'Resusitasi cairan', 'Pemasangan NGT', 'Pemasangan kateter', 'Laparotomy repair perforasi', 'Terapi PPI dan H2 blocker', '1', 21, 3),
(151, 'Seorang bayi berumur 2 hari dibawa ibunya kontrol ke RS. Sewaktu hamil ibunya menderita hepatitis B. Dari hasil pemeriksaan fisik bayi dalam batas normal. Pemeriksaan laboratorium HbsAg (-), anti HBs (+).  Yang kemungkinan dialami bayi:\n', 'Terinfeksi Hep B', 'Tidak terinfeksi Hep B', 'Sudah memiliki kekebalan', 'Belum memiliki kekebalan', 'Sudah terinfeksi Hep B', '3', 11, 13),
(152, 'Seorang perempuan berusia 34 tahun datang ke praktek dokter umum dengan keluhan hidung tersumbat sejak 6 bulan yang lalu. hal ini muncul terutama saat malam dan pagi hari, sesudah bangun tidur, menghilang pada saat siang hari dan muncul saat pekerjaan banyak. Keluhan disertai dengan bersin dan tenggorokan berlendir. Pada pemeriksaan concha tampak edema, hiepremis, dan terdapat secret serous. Pada hasil pemeriksaan skin prick test hasil semua allergen sama dengan kontrol negative. Apakah diagnosis yang paling mungkin ?', 'Rhinitis vasomotor', 'Rhinitis alergi', 'Rhinitis kronis', 'Rhinosinusitis', 'Rhinistis akut', '1', 21, 4),
(153, 'Pasien laki-laki 56 tahun datang dengan keluhan batuk-batuk berdahak sudah 3 minggu lebih disertai Sesak. Pada pemeriksaan didapatkan TD: 110/60 mmHg, nadi 90 kali/menit, respirasi 26 kali/menit, suhu : 37,60C ronkhi (+), wheezing (-). Pada pemeriksaan Sputum BTA (+). sebelumnya pernah pengobatan 6 bulan tp baru 3 minggu berobat sudah berhenti karena merasa keluhan sudah berkurang. Termasuk kasus apakah ini?', 'Kasus Baru', 'Kasus default', 'Kasus relaps', 'Kasus putus obat', 'Kasus drop out', '4', 11, 14),
(154, 'Seorang anak laki-laki berusia 6 tahun dibawa ke Puskesmas dengan keluhan keluar cairan pada telinga kanan sejak 1 minggu yang lalu. Dari alloanamnesis sebelumnya, pasien mengalami panas tinggi, batuk dan pilek. Pasien sering menderita panas, batuk, pilek serta tidur selalu mendengkur. Pada pemeriksaan telinga didapatkan perforasi membrane timpani sentral, ukuran sekitar 25%, tepi perforasi rata, licin dan menebal, serta secret berwarna putih kekuningan. Pada pemeriksaan tenggorokan didapatkan tonsil T2/T2, permukaan tidak rata, kripta melebar. Pada pemeriksaan palatal fenomena tidak tampak gerakan palatum. Apakah penanganan yang paling tepat ?', 'Dilakukan aural toilet, serta diberikan antibiotik oral dan topical', 'Dilakukan aural toilet, diberikan antibiotik oral dan topical, serta di motivasi untuk adenotonsilektomi', 'Dilakukan aural toilet, diberikan antibiotik oral dan topical, serta di motivasi untuk adenotonsilektomi dan timpanoplasti', 'Dilakukan aural toilet, serta diberikan antibiotik oral dan topical, serta di motivasi pengobatan ISPA nya secara berkala', 'Dilakukan aural toilet, diberikan antibiotic oral dan topical, sampai telinganya benar-benar kering', '3', 21, 5),
(155, 'Seorang laki-laki usia 35 tahun datang dengan riwayat nyeri dada, durasi 2-3 menit ketika sedang beraktivitas. Nyeri berkurang dengan istirahat. Kemudian pasien datang ke dokter untuk memeriksakan keadaannya. Pemeriksaan penunjang apa yang dilakukan untuk menunjang diagnosis....', 'EKG dengan istirahat', 'EKG dengan latihan', 'Ekokardiografi', 'Angiography', 'Lipid profile', '2', 11, 15),
(156, 'Seorang laki-laki berusia 18 tahun datang ke IGD RS setelah mengalami kecelakaan lalu lintas. Pada awal inspeksi tampak kesulitan bernafas. Dari pemeriksaan vital sign didapatkan TD 80/50 mmHg, nadi 120 x/menit, RR 30 x/menit. Pada inspeksi didapatkan jejas pada dada. Pada perkusi didapatkan redup dari basal paru hingga tengah. Pada auskultasi didapatkan suara paru menghilang. Diagnosis kilnis yang tepat adalah ?', 'Pneumthoraks', 'Tamponade cordis', 'Hematothoraks', 'Contusion miokard', 'Contusion pulmonum', '3', 21, 6),
(157, 'Seorang laki-laki 68 tahun datang ke ugd dengan kesadaran menurun. Pasien dengan riwayat hipertensi sejak beberapa tahun. Dari alloanamnesis didapatkan sebelum tidak sadar pasien mengeluh mual, muntah, dan berkeringat dingin. Dari pemeriksaan fisik didapatkan TD : 150/90 mmHg, nadi 90 kali/menit, respirasi 28 kali/menit, BJ I & II (+), gallop (+), murmur (-). Dari pemeriksaan EKG didapatkan elevasi pada segmens ST di V1-V4, T inverted di V1-V4, dan penurunan gelombang q. Apa diagnose dari pasien ini..', 'Infark miokard akut', 'Perikarditis', 'Angina pektoris', 'Emboli paru', 'Old miokard infark', '1', 11, 16),
(158, 'Seorang wanita usai 30 tahun, G2P1A0, hamil 35-36 minggu, datang dengan keluhan partus tak maju sudah sehari. Saat dilakukan pemeriksaan fisik didapatkan TFU 37 cm, punggung janin di sebelah kanan ibu, bagian terbawah janin kepala, kepala sudah masuk panggul, bagian perlimaan 2/5, kepala turun hodge III, pembukaan 10 cm, DJJ 140x/menit, his 3-4 kali dalam 10 menit, panggul tidak sempit, dan kulit ketuban masih utuh. Tindakan yang tepat untuk pasien ini adalah ?', 'Rehidrasi', 'Oksitosin drip', 'Tunggu partus spontan', 'Pecah ketuban', 'Seksio caesaria  ', '4', 21, 7),
(159, 'Pasien usia 50 tahun datang dengan keluhan sakit kepala hingga tengkuk. Pada pemeriksaan fisik didapatkan TD:  160/100, nadi: 100 kali/menit, respirasi : 20 kali/menit. Thorax dan abdomen tidak ada kelainan Pengobatan untuk pasien tersebut yang sesuai dengan JNC 7 adalah?', 'Diuretic', 'ACE inhibitor + diuretic', 'ACE inhibitor + beta blocker', 'Beta blocker + Ca antagonis', 'Diuretic + Ca antagonis', '2', 11, 17),
(160, 'Seorang laki-laki 30 tahun datang dengan keluhan sejak 2 hari yang lalu kaku seluruh tubuh. 2 minggu yang lalu kaki pasien tertusuk cangkul, kemudian pasien menjadi sulit membuka mulut dan leher kaku. Pemeriksaan fisik tekanan darah 120/80 mmHg, nadi 88x/menit, RR 24 x/menit, suhu 37,7oC . Apa diagnosis pasien diatas ?', 'Tetanus', 'Kaku kuduk', 'Trismus', 'Meningitis bakteri', 'Meningitis virus', '1', 21, 8),
(161, 'Seorang laki-laki berusia 40 tahun datang ke praktek dokter dengan keluhan gula darah masih tetap tinggi walaupun sudah menjalani pengaturan dier diabetes dan olahraga. Pasien sudah didiagnosis menderita DM sejak 3 tahun yang lalu. Pada pemeriksaan fisik ditemukan BB 90 kg, TB 165 cm. Pemeriksaan laboratorium ditemukan kadar GDS 290 mg/dl. Apakah penatalaksanaan selanjutnya yang paling tepat pada pasien ini ?', 'Tetap dilanjutkan diet diabetes + metformin 3x500 mg', 'Diet diabetes + glibenklamid 1x2,5 mg sebelum makan pagi', 'Diet diabetes + olahraga glibenklamid 1x2,5 mg sebelum makan pagi', 'Diet diabetes + olahraga + injeksi insulin 3x6 unit subkutan setiap akan makan', 'Diet diabetes + olahraga + metformin 3x500 mg  ', '5', 21, 9),
(162, 'Seorang laki-laki 50 tahun datang ke UGD dengan keluhan dada terasa berdebar-debar dan nyeri dada. Pada pemeriksaan fisik pasien sadar, tampak lemah, nadi 120 x/menit, pernapasan 18 x/menit, tekanan darah 100/60 mmHg. Pada pemeriksaan EKG didapatkan \n              \n	               Apakah diagnosis kasus tersebut ?\n', 'Atrial fluter', 'Atrial fibrillation', 'Ventrikel fibrilation', 'Supraventrikular takikardi', 'Ventricular takikardi', '1', 11, 18),
(163, 'Perempuan 17 tahun dibawa temannya ke IGD RS dengan keluhan sesak nafas disertai bunyi mengi 1 jam yang lalu setelah selesai berolahraga. Setiap berolahraga pagi pasien mengeluh sesak nafas. Pada pemeriksaan fisik didapatkan sensorium komposmentis. TD 110/70 mmHg, nadi 100 x/menit, RR 28 x/menit, suhu 37oC. Wheezing ekspirasi di seluruh lapang paru. Tatalaksana awal ?', 'Fluticorazone nebu', 'Salbutamol nebu 1,25 mg/2 cc', 'Aminofilin 7 mg/kg dalam 20 menit diikiuti dengan infus 0,4 mg/kgBB/jam', 'Ipratropium bromide inhalasi 250 mg/cc', 'Budesonide inhalasi 100 mcg/puff  ', '2', 21, 10),
(164, 'Pasien laki-laki 55 tahun datang ke poliklinik RS dengan keluhan nyeri kepala. Keluhan tidak disertai penglihatan kabur. Riwayat Diabetes Mellitus sejak 13 tahun yang lalu. Pemeriksaan fisik didapatkan TD 170/100 mmHg, HR 100x/menit, RR 20x/menit, suhu 360C. Pemeriksaan lab didapatkan Hb 12 gr/dl, Ht 37%, Leukosit 5.700/mm3, Trombosit 250.000/mm3, Ureum 48 mg/dl, Kreatinin 2,5 mg/dl, GDS 230 mg/dl, Kolesterol 180 mg/dl. Terapi hipertensi apakah yang paling tepat untuk pasien tersebut?', 'HCT', 'Reserpin', 'Captopril', 'Furosemid', 'Propanolol', '3', 11, 19),
(165, 'Seorang laki-laki berusia 22 tahun datang ke poliklinik RS dengan keluhan batuk yang kemudian diikuti dengan sesak nafas dan mengi sejak 7 hari yang lalu. Gejala sesak timbul setiap hari dalam satu minggu ini. Pasien sudah sering berobat ke poliklinik penyakit dalam karena keluhan yang sama sejak 1 tahun terakhir. Hasil pemeriksaan spirometri peak flow meter nilai APE 70% nilai prediksi. Diagnosa ?', 'Asma intermitter', 'Asma persisten ringan ', 'Asma persisten sedang', 'Asma persisten berat', 'Asma persisten sangat berat', '3', 21, 11),
(166, 'Seorang laki-laki berumur 27 tahun datang ke UGD RS dengan keluhan demam tinggi, cepat lelah, nyeri dada saat beraktivitas sejak 5 hari yang lalu. Sebelumnya ada riwayat batuk selama 2 minggu. Pada pemeriksaan fisik didapatkan TD 90/60, suhu 38.6, nadi 100x/menit. Pada telapak tangan dan telapak kaki terdapat bintik-bintik merah keunguan. Jantung : murmur (+). Pemeriksaan lab Hb 13, leukosit 19.200, trombosit 230.000. Kultur darah : Staphylococcus Sp (+). Urinalisis : hematuria (+). ECHO : vegetasi 1.5 cm katup mitral. Diagnosa yang tepat adalah?', 'penyakit jantung rematik', 'endokarditis bakterialis', 'miokarditis bakterialis', 'perikarditis bakterialis', 'pankarditis bakterialis', '2', 11, 20),
(167, 'Seorang perempuan berusia 40 tahun datang ke praktek dokter dengan keluhan lengan kiri atasnya terasa membengkak. Dari anamnesis diketahui bahawa 2 tahun yang lalu pasien pernah menjalani mastektomi radikal atas indikasi kanker payudara. Pada pemeriksaan fisik tidak ditemukan tanda-tanda rekurensi tumor payudara tersebut. Apakah kemungkinan kelainan yang diderita pasien ini sekarang ?', 'Inflamasi kronik', 'Limfangioma', 'Limfedema', 'Tromboflebitis', 'Vena varikosa', '3', 21, 12),
(168, 'Seorang perempuan, 50 tahun, datang ke IGD dengan keluhan nyeri dada sejak 1 jam yang lalu. Nyeri dirasakan di dada kiri dan menjalar hingga rahang dan lengan kirinya. Nyeri tidak berkurang dengan istirahat. Pasien adalah penderita hipertensi sejak 7 tahun yang lalu, tetapi tidak rutin kontrol. Pemeriksaan fisik didapatkan TD 170/100 mmHg, nadi 100x/menit, respirasi 20 x/menit, suhu 37°C. Pemeriksaan penunjang apakah yang spesifik untuk menegakkan diagnosis penyakit di atas?', 'HDL', 'SGOT', 'Kreatinin kinase', 'Troponin', 'LDL kolesterol', '4', 12, 1),
(169, 'Kapan leopold IV harus dilakukan ?', 'Setiap kehamilan dnegan presentasi kepala maupun jenis presentasi lainnya', 'Setiap kehamilan dnegan presentasi kepala yang sudah maupun belum masuk pintu atas panggul', 'Setiap kehamilan dnegan presentasi kepala yang sudah masuk pintu atas panggul', 'Setiap kehamilan dnegan presentasi bokong yang sudah masuk pintu atas panggul', 'Setiap kehamilan dnegan presentasi kepala yang belum masuk pintu atas panggul  ', '3', 21, 13),
(170, 'Seorang wanita usia 18 tahun mengeluh gatal pada badan. Dari pemeriksaan dermatologis tampak lesi berbatas tegas, eritema, skuama, papul dan vesikel pada tepi lesi, bagian pinggir lebih aktif dari pada bagian tengahnya (central healing). Diagnosis yang paling sesuai untuk pasien tersebut adalah?', 'Tinea versikolor', 'Tinea corporis', 'Tinea kruris', 'Psoriasis', 'Tinea imbrikata', '2', 12, 2),
(171, 'Pasien anak laki-laki usia 5 tahun dengan keluhan nyeri pada telingan kanan. Sejak 1 hari yang lalu disertai rewel dan sulit tidur karena nyerinya. Pasien 4 hari yang lalu mengalami demam dan batuk pilek. Pada pemeriksaan fisik tampak sakit sedang, denyut nadi 100x/menit, suhu 37,8oC. Dokter telah memberikan antibiotik. Apa terapi tambahan pada pasien ini ?', 'Asam mefenamat', 'Pseudoefedrin', 'Chlorfeniramin', 'Bromhexin', 'Salbutamol ', '2', 21, 14),
(172, 'Pasien laki-laki 50 tahun datang ke puskesmas dengan keluhan bercak putih kemerahan pada dada sejak 2 minggu yang lalu. bercak terasa gatal ketika berkeringat dan menyebar ke punggung, lengan, dan lipat paha. UKK papula eritema dengan erosi. Pemeriksaan KOH ddidapatkan ragi, media saboraud didapatkan koloni cokelat dengan permukaan basah. Jamur pada kasus diatas adalah ?', 'Malassezia furfur', 'Thrychospora beigilli', 'Candida albicans', 'Mycosporum sp', 'Trychophyton sp', '3', 21, 15),
