(214, 'Seorang anak usia 3 tahun mengeluh sesak napas sejak 1 hari SMRS yang didahuli dengan nyeri menelan dan demam. Batuk pilek tidak menonjol. Pada pemeriksaan fisik didapatkan keadaan umum gelisah tampak sesak, faring hiperemis, tonsil T2/T2 ditutupi selaput putih keabuan, mudah berdarah bila dilepas. Penanganan pertama pada pasien ini adalah ?', 'Bebaskan jalan napas', 'Berikan O2', 'Konsul THT untuk tonsilektomi', 'Antibiotik intravena', 'Antibiotik kombinasi dosis tinggi', '1', 22, 18),
(215, 'Seorang laki-laki 35 tahun datang ke tempat praktek dokter dengan keluhan nyeri saat kencing, keluar cairan berwarna putih dari saluran kencingnya. Riwayat 5 hari yang lalu berhubungan seks dengan PSK tanpa menggunakan kondom. Status venerologis terdapat eritema di OUE. Pada pemeriksaan mikroskopik tampak bakteri diplococcus gram negative. Penyebab pada keadaan ini adalah?', 'Trichomoniasis', 'Neisseria go', 'Treponema pallidum', 'Klamidia', 'HSV ', '2', 13, 2),
(216, 'Seorang wanita postpartum dirujuk oleh bidan setelah 15 menit plasenta tidak lahir, pada pemeriksaan fisik didapatkan tekanan darah 90/60 mmHg, nadi 80 x/menit, RR 20x/menit, suhu 37oC. Penanganan pertama kali dilakukan pada pasien ini adalah ?', 'Manual plasenta', 'Ulang injeksi oksitosin 10 IU secara IM', 'Pasang infus untuk rehidrasi', 'Bimanual plasenta', 'Tranfusi PRC 2 U sampai Hb meningkat', '2', 22, 19),
(217, 'Pria mengeluh luka yang nyeri pada kemaluan. Pada awalnya terdapat bintil kemudian pecah dan membentuk luka dengan dasar kotor. Pada pemeriksaan fisik tampak ulkus berbentuk cawan, tepi tidak rata, dasar kotor, daerah sekitarnya eritema, dan nyeri tekan. kemungkinan Penyebab dari keadaan ini adalah?', 'HSV', 'Treponema pallidum', 'Candida', 'Haemophilus ducreyi', 'Neisseria gonorrhoeae', '4', 13, 3),
(218, 'Wanita 30 tahun dibawa ke IGD RS setelah menngalami KLL. Pasien tidak segera ditangani karena dokter jaga tidak berada ditempat. Manakah berikut ini yang termasuk sikap dokter dipandang dari bioetik ?', 'Altruism', 'Beneficience', 'Justice', 'Autonomy', 'Nonmaleficience ', '5', 22, 20),
(219, 'laki-laki usia 20 tahun bekerja sebagai tukang bangunan datang ke rumah sakit dengan bercak-bercak putih di tungkai bawah. Dari pemeriksaan dermatologis didapatkan lesi hipopigmentasi berbatas tegas dengan ukuran tidak teratur pada tungkai bawah. Pemeriksan kerokan KOH terlihat campuran hifa pendek dan spora bulat berkelompok, pemeriksaan BTA (-). Diagnosis yang tepat adalah : ', 'P.Versicolor', 'tinea kruris', 'pitiriasis rosea', 'morbus Hansen', 'vitiligo', '1', 13, 4),
(220, 'Seorang anak berusia 2 bulan datang ke puskesmas dengan keluhan luka pada kedua pipi. Ibu memiliki riwayat asma. Dari pemeriksaan fisik tampak kemerahan pada kedua pipi serta terdapat papul dan skuama dibeberapa tempat. Diagnosisnya adalah : ', 'Hemangioma', 'Dermatitis kontak ', 'Dermatitis atopic', 'Dermatitis sika', 'Neurodermatitis', '3', 13, 5),
(221, 'Pria usia 20 tahun datang dengan keluhan ketombe di kepala sejak 3 bulan. Riwayat stress dan urtikaria (+). Pada pemeriksaan fisik lebih lanjut terdapat rash eritem di dahi, kulit sekitar alis, dan plica nasolabial. Apa diagnosis kasus ini?', 'Dermatitis atopi', 'Dermatitis seboroik', 'Dermatitis kontak alergi', 'Neurodermatitis', 'Dermatitis numularis', '2', 13, 6),
(222, 'Beberapa orang karyawan pada sebuah pabril lem perekat sering pingsan tiba-tiba. Pabrik itu memproduksi methanol, ethernat, gangguan pada karyawan-karyawan tersebut disebabkan?', 'Anemia', 'Udara yang buruk di pabrik', 'Terpapar bahan kimia', 'Kurangnya istirahat', 'Jam kerja yang padat', '2', 13, 7),
(223, 'Laki2, 65 thn, masuk UGD dgn keluhan nyeri diseluruh perut sejak 3 tahun yg lalu, awalnya pada uluhati kemudian menyebar keseluruh perut. Keluhan ini sdh dialami sejak 1 thn yg lalu, pasien juga sering menkomsumsi aspirin u/ mengobati sakit kepala, pasien tampak letargi, berkeringat. Pada pemeriksaan abdomen didapatkan distensi, dan kram, nyeri tekan +, nyeri lepas +, pada pemeriksaan radiologi didapatkan gambaran radiolusen pada subdiafragma,apa diagnosisnya? ', 'Primary Peritonitis', 'Secondary Peritonitis', 'Tersier Peritonitis', 'Faecal Peritonitis', 'Foreign Body Peritonitis', '2', 13, 8),
(224, 'Pasien laki-laki usia 25 tahun datang diantar temannya dengan keluhan lengan kanan sakit jika digerakan, riwayat jatuh sewaktu bermain bola. Dari cerita temannya pasien jatuh dengan arah abduksi, extensi, dan eksternal rotasi. Pada pemeriksaan fisik didapatkan tonjolan pada bagian depan bahu, posisi lengan abduksi – eksorotasi, tepi bahu tampak menyudut, nyeri, adanya gangguan gerak sendi. Bagian yang terkena adalah pada keadaan ini adalah?', 'Bahu anterior', 'Bahu posterior', 'Supracondylar humerus', 'Bahu inferior', 'Fraktur humerus', '1', 13, 9),
(225, 'Pria, 39 tahun, datang dengan keluahan skrotum membesar dan tidak nyeri sejak 2 hari yang lalu. Pada pemeriksaan teraba lunak, dan tidak ada massa. Tes transluminasi (+). Diagnosis yang mungkin?', 'Hidrokel', 'Varikokel', 'Hernia skrotalis', 'Orkitis', 'Torsio testis', '1', 13, 10),
(226, 'Pria usia 25 tahun datang dengan Nyeri pada skrotum dan bengkak tiba-tiba saat bangun tidur, pada pemeriksaan didapatkan skrotum hiperemis dan nyeri pada palpasi. Dan penebalan pada funikulus spermatikus. Vital sign dalam batas normal. Phren sign (+). Diagnosis?', 'Torsio testis ', 'Orchitis ', 'Epididimitis ', 'Varikokel', 'Hernia inguinalis skrotalis', '1', 13, 11),
(227, 'Wanita usia 25 tahun datang ke UGD dalam keadaan lemah diantar keluarganya, dari keterangan keluarganya pasien habis minum racun serangga sekitar 30 menit yang lalu kemudian mual tetapi tidak muntah. Pada pemeriksaan fisik didapatkan TD 100/50 mmHg, nadi, 100 kali/menit, respirasi, 14 kali/menit, mata miosis, hipersalivasi. Antidotum yang dapat diberikan pada pasien ini adalah?', 'Ca glukonas', 'Sulfas atropine', 'Epinefrin', 'Deferoksamin', 'Nalokson ', '1', 13, 12),
(228, 'pria usia 35 tahun datang ke puskesmas dengan keluhan batuk berdahak 4 minggu disaertai penurunan berat badan dan didiagnosa TBC. Pasien diketahui memiliki 3 anak umur 7 tahun, 5 tahun, 2 tahun. Pemeriksaan apa yang harus dilakukan terhadap anak-anak pasien ini?', 'Foto thoraks', 'Sputum BTA', 'Tuberculin ', 'Kultur ', 'Tidak perlu dilakukan pemeriksaan', '3', 13, 13),
(229, 'Pria usia 35 tahun masuk ke IGD dengan penurunan kesadaran. Riwayat kecelakaan sebelumnya. Pada pemeriksaan fisik didapatkan TD 100/50 mmHg, nadi, 100 kali/menit, respirasi, 14 kali/menit, Hematom di belakang telinga. Mata membuka bila dipanggil. Extensi bila dirangsang nyeri. Bicara kacau. GCS?', '11', '10', '9', '8', '7', '4', 13, 14),
(230, 'Seorang laki-laki sedang di restoran dan tiba-tiba tersedak makanan. Anda adalah stau-satunya dokter yang ada disana. Anda sudah menyuruh orang tersebut untuk batuk sekeras-kerasnya tetapi sumbatan belum keluar.  Apa yang harus anda lakukan sebagai dokter sebelum dibawa ke rumah sakit?', 'Jika kelihatan pada mulut, makanan diambil dengan jari.', 'Heimlich maneuver', 'Triple airway maneuver', 'Pasang nasofaringeal tube', 'Abdominal trust', '2', 13, 15),
(231, 'Seorang pria 25 tahun datang ke puskesmas akibat luka bacok 2 cm pada dada sebelah kanan. Pada pemfis pasien sadar tanda vital 120/70, yg lain dalam batas normal. 30 menit kemudian pasien tiba-tiba merasa sesak.Tanda vital 90/50mmHg, nadi 130x/i, pernapasan 35x/i.Pada pemfis, gerakan dada sebelah kanan terlambat, perkusi didapatkan paru kanan hipersonor, suara auskultasi pernapasan menghilang. Apa tindakan awal yang harus dilakukan segera sebelum merujuk?', 'Pasang kasa 3 sisi', 'WSD', 'Nebulizer', 'Needle thoracosintesis', 'Resusitasi cairan', '1', 13, 16),
(232, 'Seorang pria usia 25 tahun masuk IGD dengan keluhan nyeri perut setelah kecelakaan 30 menit yang lalu. Pada pemeriksaan didapatkan T 80/60, N: 125, respirasi 35. Didapatkan distensi perut dan direncanakan laparotomy eksplorasi. Termasuk ASA berapa:', 'I a', 'I E', 'II e', 'III E', 'IV E', '5', 13, 17),
(233, 'Seorang pria usia 35 tahun masuk IGD dengan keluhan nyeri pada paha kanan. Riwayat tertabrak mobil sebelumnya. Pada pemeriksaan fisik didapatkan TD: 90/60, N: 120, RR: 30. hematom luas pada paha kanan, CRT melambat, turgor menurun. apa penanganan awal pada pasien ini:', 'Resusitasi cairan', 'Pasang splint', 'Pemberian oksigen', 'Observasi', 'Bidai', '1', 13, 18),
(234, 'Seorang anak usia 12 tahun datang ke puskesmas dengan nyeri pada tangan kiri, riwayat jatuh dari ketinggian 5 m dengan tangan menumpu tanah terlebih dahulu. Pada pemeriksaan  fisik ditemukan  bengkak pada lengan atas dengan sumbu nyeri,  pada lengan bawah terdapat luka terbuka 5 cm. Penanganan pertama pada pasien ini adalah:', 'Bersihkan luka', 'Pemasangan bidai', 'Pemberian analgetik', 'Pemberian antibiotic', 'Pemberian sedasi', '1', 13, 19),
(235, 'Pasien laki-laki usia 25 tahun datang diantar temannya dengan keluhan lengan kanan sakit jika digerakan, riwayat jatuh sewaktu bermain bola. Dari cerita temannya pasien jatuh dengan arah abduksi, extensi, dan eksternal rotasi. Pada pemeriksaan fisik didapatkan tonjolan pada bagian depan bahu, posisi lengan abduksi – eksorotasi, tepi bahu tampak menyudut, nyeri, adanya gangguan gerak sendi. Apa komplikasi yang mungkin terjadi :', 'Claw hand', 'Drop hand', 'Lesi nervus axilaris', 'Non union', 'Union ', '3', 13, 20),
(236, 'Seorang pria usia 25 tahun masuk IGD dengan keluhan nyeri perut setelah kecelakaan 30 menit yang lalu. Pada pemeriksaan didapatkan T 80/60, N: 125, respirasi 35. Didapatkan distensi perut. Apa penyebab shock pada keadaan ini;', 'Rupture lien', 'Rupture hati', 'Rupture ginjal', 'Perdarahan retro peritoneal', 'Rupture colon', '2', 14, 1),
(237, '3 orang pasien dibawa oleh relawan ke UGD post bencana alam. Hanya ada 1 dokter jaga dan perawat. Relawan mengatakan akan datang 5 korban lagi dalam waktu 30 min. Dokter jaga telah menghubungi dokter lainnya untuk datang ke UGD. Apa tindakan tepat yang dilakukan:', 'Rujuk semua pasien untuk mengurangi mortalitas', 'segera melakukan triase ke gawat daruratan', 'penanganan konservatif', 'stabilisasi ', 'menghubungi rumah sakit terdekat', '2', 14, 2);
INSERT INTO `bf_soal` (`id`, `question_name`, `answer1`, `answer2`, `answer3`, `answer4`, `answer5`, `answer`, `ujian_id`, `urutan`) VALUES
(238, 'Seorang laki-laki umur 60 tahun, datang ke praktek  dengan benjolan sebesar telur ayam di perut bawah kiri sejak pagi tadi,  benjolan hilang timbul,  timbul ketika mengedan dan loncat-loncatan dan menghilang jika berbaring. Pada pemfis teraba benjolan diatas lipatan inguinal,  valsava test (+) apa diagnosis yang mungkin?', 'hernia inguinalis', 'hernia umbilicalis', 'hernia hiatal', 'hernia femoralis', 'hernia scrotalis', '1', 14, 3),
(239, 'Peneliti ingin mengetahui hubungan kejadian Difteri dengan rendahnya cakupan imunisasi, tetapi tidak ada data. Metode penelitian:', 'Potong lintang	', 'Cohort	', 'Kualitatif', 'deskriptif', 'analitik ', '4', 14, 4),
(240, 'Seorang perempuan 26 tahun datang dengan keluhan batuk sejak 3 minggu yang lalu. Pada anamnesis, pemeriksaan fisik, pemeriksaan laboratorium, pemeriksaan foto rontgen thorak dokter mendiagnosis TB paru dengan BTA + dan akan diberikan terapi. Pasien sedang menyusui bayi usia 2 tahun. Apa edukasi yang diberikan pada pasien ini?', 'Tidak menyusui karena dapat menularkan TB', 'Tidak menyusui karena obat TB paru dapat mempengaruhi ASI', 'Menyusui bayi dan diberi profilaksis Rifampisin', 'Menyusui bayi dan diberikan profilaksi INH', 'Menyusui bayi dan tidak diberikan profilaksis karena TB tidak berbahaya', '4', 14, 5),
(241, 'laki-laki usia 23 tahun masuk ke IGD dengan nyeri pada kedua tungkai setelah kecelakaan. Pada pemeriksaan fisik didapatkan TD 110/70 mmHg, nadi, 90 kali/menit, respirasi, 16 kali/menit, krepitasi, nyeri tekan, pemeriksaan radiologis yang dibutuhkan adalah?', 'foto 2 posisi', 'foto 1 posisi', 'foto anterior', 'foto lateral', 'foto posterior', '1', 14, 6),
(242, 'Anak laki-laki, umur 15 tahun masuk dengan keluhan benjolan pada lengan atas. Benjolan tersebut tidak merah, tapi bila diraba nyeri. Pada pemeriksaan radiologi didapatkan hasil adanya reaksi periosteal dan lesi sklerotik pada humerus. Apa diagnosisnya?', 'Osteomielitis akut', 'Osteomielitis kronik', 'Osteosarcoma', 'Osteochondroma', 'Ewing sarcoma', '3', 14, 7),
(243, 'Wanita 65 tahun datang ke IGD dengan tangan kanan sakit, riwayat jatuh dengan tangan menopang. Pada pemeriksaan fisis didapatkan TD 110/70 mmHg, nadi, 90 kali/menit, respirasi, 16 kali/menit, tampak tangan bagian distal angulasi ke dorsal, deformitas (+), nyeri tekan (+), nyeri sumbu (+), apa diagnosisnya ?', 'Fr. Colles', 'Fr. Montegia', 'Fr. Galeazzi', 'Fr. Radius-ulna', 'Fr. Humerus', '3', 14, 8),
(244, 'Seorang laki-laki berumur 32 tahun, mengeluh sering pusing. Pada pemeriksaan fisik ditemukan anemia, tekanan darah 120/80, nadi : 60x/menit. Pemeriksaan laboratorium didapatkan Hb:9,4 g/dl, hapusan darah tepi ditemukan target sel +, dan gambaran anemia hemolitik. Istri penderita ternyata juga didapatkan gambaran klinis dan laboratorium yang sama. Penyakit tersebut termasuk pewarisan gen autosomal resesif. Kemungkinan berapa % anak dari pasangan suami istri tersebut tidak menderita penyakit yang sama (normal) ?', '0%', '25%', '50%', '75%', '100%', '2', 23, 1),
(245, 'Bayi umur 6 minggu dibawa ibunya ke puskesmas untuk mendapatkan imunisasi pertama kali. Pada saat pemeriksaan didapatkan bayi demam 380C. Bayi juga terus menangis dan rewel. Tindakan anda ?', 'Menunda imunisasi, tunguu 2-3 hari', 'Tetap imunisasi dengan dosis setengahnya	', 'Tetap imunisasi sesuai usia bayi  ', 'Telpon dokter spesialis anak untuk menanyakan langkah selanjutnya', 'Imunisasi dosis terbagi tiap 1 minggu ', '1', 23, 2),
(246, 'Di bawah ini yang bukan termasuk tujuan penyelenggaraan posyandu adalah…', 'Menurunkan angka kematian bayi (AKB), angka kematian ibu (ibu hamil, melahirkan dan nifas)', 'Membudayakan NKKBS ', 'Meningkatkan peran serta dan kemampuan masyarakat untuk mengembangkan kegiatan kesehatan dan KB serta kegiatan lainnya yang menunjang untuk tercapainya masyarakat sehat sejahtera ', 'Berfungsi sebagai wahana gerakan reproduksi keluarga sejahtera, gerakan ketahanan keluarga dan gerakan ekonomi keluarga sejahtera ', 'Pembinaan perkembangan anak (Child Development) yang ditujukan untuk membina tumbuh/kembang anak secara sempurna, baik fisik maupun mental sehingga siap menjdai tenaga kerja yang tangguh.', '4', 23, 3),
(247, 'Seorang laki-laki 40 tahun datang dengan keluhan mata kabur dan sialu setelah terapapr putik mangga 1 hari yang lalu. Pemeriksaan oftamologi didapatkan kornea jernih, pupil midriasis, reflex cahaya -/-. Lensa masih berada pada tempatnya tetapi sedikit bergeser mengarah ke inferior, Apakah diagnosis pada pasien ini ?', 'Khemosis', 'Subluksasi', 'Rupture choroid', 'Iridodialisis', 'Ulkus kornea', '2', 23, 4),
(248, 'Seorang wanita usia 25 tahun datang ke poliklinik dengan keluhan keputihan berwarna kuning, bau d an bertambah banyak sudah 5 hari ini disertai demam. Suaminya pernah mengeluh sakit yang sama pada alat kelaminnya. Pada pemeriksaan venerologi, didapatkan labia mayor dan minor tidak ada kelainan, OUE tidak ada kelainan, terdapat pembesaran dan nyeri tekan pada kelenjar inguinal kanan dan kiri. PEmeriksaan inspekulo didapatkan pada dinding vagina terdapat cairan berwarna kuning, muara vagina terlihat edema, hiperemis, terdapat secret berwarna kuning, kental dan bau. Apakah pemeriksaan laboratorium sederhana yang sesuai?', 'Pemeriksaan gram', 'Pemeriksaan sediaan basah NaCl', 'Pemeriksaan KOH', 'Pemeriksaan kultur ', 'Pemeriksaan tes amin  ', '2', 23, 5),
(249, 'Perempuan usia 59 tahun datang dengan keluhan sesak nafas sejak 2 jam sebleumnya, Sejak 3 hari sebelumnya mengalami demam dan batuk. Pasien didiagnosis memiliki hipertensi dan diabetes sejak 7 tahun sebelumnya. Pada pemeriksaan fisik ditemukan TD 120/80 mmHg, nadi 112 kali/menit, suhu 390C, RR 32x/mnt dengan ronkhi basah halus. Kedua lapang paru dan fruity odor. Pemeriksaan lab menunjukkan leukosit 18.000/mm3 dan GDS 390mg/dl. Diagnosis dari kasus ini adalah :', 'TBC', 'Diabetic ketoacidosis', 'Gagal jantung kongestif ', 'Hiperglikemik non-ketotik', 'Penyakit jantung hipertensi ', '2', 23, 6),
(250, 'Seorang laki-laki usia 78 tahun dibawa keluarganya ke RS karena penurunan kesadaran 30 menit sebelum masuk rumah sakit. Sebelumnya pasien berkeringat dan gemetar. Pasien mengkonsumsi glibenklamid. TD 130/90 mmHg, N 100x/mnt, pernafasan teratur. Penyebab penurunan kesadaran adalah?', 'Asidosis metabolic', 'Hipoglikemia', 'Infrak serebri', 'Syok iskemik', 'TIA ', '2', 23, 7),
(251, 'Laki-laki umur 24 tahun datang dengan keluhan lemas dan cepat lelah. Pemuda ini mengidap epilepsy dan minum obat secara teratur. Dari pemeriksaan vital sign dan pemeriksaan fisik dalam batas normal. Dari pemeriksaan laboratorium Hb=8 gr/dl, pemeriksaan mikroskopis apus darah tepi menunjukkan eritrosit makrositer hipokrom. Obat yang dapat menyebabkan kelainan tersebut?', 'Luminal', 'Phenitoin', 'Pragalain', 'Gabapentin ', 'Karbamazepin', '2', 23, 8),
(252, 'Pasien wanita umur 24 tahun P2A0 datang ke UGS RS dengan perdarahan hebat. Pasien baru melahirkan anaknya di bidan  2 jam yang lalu dengan BB >4300 gram. Menurut bidan pasien tidak pernah mengalami komplikasi selama hamil dan saat melahirkan. Riwayat anak pertama  lahir dengan seksio sayatan transversal pada segmen bawah uterus. Apakah penyebab dari perdarahan yang tepat?', 'Tetani uterus', 'Atoni uterus', 'Inersia Uterus', 'Ruptur uterus', 'Inverse uterus   ', '4', 23, 9),
(253, 'Laki-laki usia 56 tahun dibawa ke UGD dengan kesadaran menurun, TD 160/100 mmHg, hemiparese sinistra disertai thrombosis cerebri. Berapa batas tekanan darah yang harus diturunkan?', '150/100', '150/90', '140/100', '140/90', '130/90 ', '5', 23, 10),
(254, 'Seorang laki-laki berusia 42 tahun dan tinggal di Papua datang ke puskesmas dengan keluhan demam sejak 2 minggu yang lalu. Demam naik turun disertai nyeri pada seluruh tubuh. Mual muntah dan nafsu makan menghilang. Pada pemeriksaan fisik tampak sakit, anemis sedangkan pemeriksaan lain dalam batas normal. Pada pemeriksaan laboratorium didapatkan Hb 9,1 g/dl, widal negative, pemeriksaan tetes darah tebal tipis menunjukkan gambaran ring form dengan adanya schuffner’s dots pada sel darah merahnya dan ukuran bentuk sel darah merahnya lebih besar dari ukuran normal. Apa diagnosisnya?', 'Malaria kuartana', 'Malaria tertian', 'DBD', 'Tifoid', 'Arkariasis', '2', 23, 11),
(255, 'Seorang pasien 45 tahun menderita DM tipe 2, ingin melakukan pemeriksaan rutin. Dokter tersebut ingin keluar kota dalam waktu 3 minggu dan dirujuk ke dokter lain sesuai dengan diagnosis penyakit. Tipe rujukan adalah?', 'Kolateral', 'Interval', 'Cross', 'Horizontal', 'Vertical ', '2', 23, 12),
(256, 'Seorang pria berumur 37 tahun mengeluh sering pusing-pusing dan pegal-pegal.Dari hasil anamnesis lanjut didapatkan ibu memliki penyakit hipertensi, ayah kanker paru.Riwayat merokok aktif 15-20 batang/hari sejak umur 16 tahun.Olah raga dengan treadmill 1x/minggu. Pemeriksaan fisik : BB 83,9 kg, TB 170 cm, Tensi 170/100 mmHg, nadi 80 x/menit, respirasi 24 kali/menit. Pemeriksaan profil lipid : kolesterol total 256 mg/dl, trigliserida 170 mg/dl, HDL-C 40 mg/dl, LDL-C 202 mg/dl, hematologi rutin dalam batas normal, asam urat 6 mg/dl. GDP 90 mg/dl, GD 2 jam PP 98 mg/dl.\nBerapa faktor resiko yang dimiliki oleh pasien di atas?', '2', '3', '4', '1', '0', '1', 23, 13),
(257, 'Seorang pria berumur 37 tahun mengeluh sering pusing-pusing dan pegal-pegal.Dari hasil anamnesis lanjut didapatkan ibu memliki penyakit hipertensi, ayah kanker paru.Riwayat merokok aktif 15-20 batang/hari sejak umur 16 tahun.Olah raga dengan treadmill 1x/minggu. Pemeriksaan fisik : BB 83,9 kg, TB 170 cm, Tensi 170/100 mmHg, nadi 80 x/menit, respirasi 24 kali/menit. Pemeriksaan profil lipid : kolesterol total 256 mg/dl, trigliserida 170 mg/dl, HDL-C 40 mg/dl, LDL-C 202 mg/dl, hematologi rutin dalam batas normal, asam urat 6 mg/dl. GDP 90 mg/dl, GD 2 jam PP 98 mg/dl.Berdasarkan jumalh faktor resiko pasien ini masuk dalam kategori golongan pasien dengan jenis faktor resiko?', 'Low risk', 'Moderate risk', 'High risk', 'Very high risk', 'No risk ', '2', 23, 14),
(258, 'Seorang pria berumur 37 tahun mengeluh sering pusing-pusing dan pegal-pegal.Dari hasil anamnesis lanjut didapatkan ibu memliki penyakit hipertensi, ayah kanker paru.Riwayat merokok aktif 15-20 batang/hari sejak umur 16 tahun.Olah raga dengan treadmill 1x/minggu. Pemeriksaan fisik : BB 83,9 kg, TB 170 cm, Tensi 170/100 mmHg, nadi 80 x/menit, respirasi 24 kali/menit. Pemeriksaan profil lipid : kolesterol total 256 mg/dl, trigliserida 170 mg/dl, HDL-C 40 mg/dl, LDL-C 202 mg/dl, hematologi rutin dalam batas normal, asam urat 6 mg/dl. GDP 90 mg/dl, GD 2 jam PP 98 mg/dl.\nObat-obatan apa saja yang harus diberikan pada pasien ini?', 'Nifedipin dan simvastatin, clopidogrel', 'Telmisartan dan simvastatin, clopidogrel', 'Captopril dan fenofibrat, aspirin ', 'Captopril dan gembifroxil, aspirin ', 'Bisoprolol dan simvastatin, clopidogrel ', '2', 23, 15),
(259, 'Seorang perempuan 26 tahun datang ke dokter umum dengan keluhan bercak-bercak merah pada kulit dada. Sudah berobat sebelumnya ke dokter lain diberikan obat salep (tidak tahu nama obatnya) namun tidak sembuh. Dari PF didapatkan lesi eritematous bersisik halus. Dari pemeriksaan histopatologi didapatkan degenerasi vakuoler sel basal, atrofi epidermis, infiltrate radang limfosit vaskuler superficial dan profunda serta di sekitar folikel rambut. Apakah diagnosis penyakit tersebut?', 'Pemphigus vulgaris', 'Pemphigus folaceous', 'Eritema multiforme', 'Lupus eitematous', 'Psoriasis ', '4', 23, 16),
(260, 'Seorang peneliti ingin meneliti apkah ada hubungan antara infark miokardial dengan konsumsi MSG. Peneliti ini mengumpulkan subyek dan membaginya menjadi dua kelompok yaitu subyek dengan riwayat infark miokardial dan subyek tanpa riwayat infark miokardial.Selanjutnya peneliti ini mulai menanyakan bagaiman riwyat konsumsi MSG pada kedua kelompok tersebut. Penelitian seperti ini disebut?', 'Cohort', 'Case control', 'Cross sectional', 'Quasi eksperimental', 'Eksperimental murni ', '2', 23, 17),
(261, 'Seorang laki-laki berusia 34 tahun, datang dengan keluhan keluar cacing berwarna putih, berbentuk pipih, berukuran 2 x 1 cm, dan bergerak dari anusnya. Cacing tersebut paling mungkin adalah :', 'Ancylostoma duodenale', 'Trichuris trichiura', 'Ascaris lumbricoides', 'Oxyuris vermicularis', 'Taenia soleum ', '5', 23, 18),
(262, 'Seorang perempuan 23 tahun G1P0A0 dengan usia kehamilan 7 bulan datang untuk memeriksakan kehamilannya. Pasien mengeluh nyeri kepala. Tidak ada riwayat penyakit kronis. Pada pemeriksaan TD 190/100 mmHg, nadi 88x/mnt, respirasi 24x/mnt, suhu 36,50C. Didapatkan edema tungkai dan protein urin +3. Apa kemungkinan diagnosis?', 'Hipertensi kronis', 'Hipertensi gestasional', 'Preeklamsia ringan', 'Hipertensi eseensial', 'Impending eklampsia ', '5', 23, 19),
(263, 'Seorang pasien datang ke klinik mata, pemeriksaan visusnya menunjukkan OS 5/20, setelah dikoreksi dengan S-0,25 visus menjadi 5/8, dikoreksi S-0,50 visusnya 5/7, dikoreksi S-0,75 visusnya 5/6, dikoreksi S-1,00 visusnya 5/5, dikoreksi S-1,25 visusnya 5/10. Manakah koreksi yang tepat?', 'S-0,25', 'S-0,50', 'S-0,75', 'S-1,00', 'S-1,25', '4', 23, 20),
(264, 'Seorang laki-laki umur 63 tahun datang dengan keluhan lemah pada yangan dan tungkai sebelah kanan dan tidak bisa bicara dengan jelas, keluhan dirasakan 1 jam sebelum masuk rumah sakit, keluhan penurunan kesadaran, sakit kepala, mual dan muntah disangkal. Pasien mempunyai riwayat hipertensi dan DM yang tidak terkontrol sejak 5 tahun yang lalu. Dan mempunyai riwayat merokok pada waktu muda 1 bungkus/hari. Pada pemeriksaan fisik didapatkan TD 160/100 mmHg, N : 82x/mnt, RR:20x/mnt. Pada pemeriksaan saraf cranial ditemukan kelainan pada nervus VII sentral. Apa yang menyebabkan dari keluhan bicara pada pasien ini ?', 'Kerusakan daerah gyrus sentralis', 'Kerusakan daerah hemisfer kiri', 'Kerusakan daerah gyrus presentralis', 'Kerusakan daerah wernick', 'Kerusakan daerah brodmann', '5', 24, 1),
(265, 'Pada pemeriksaan fisik seorang pasien ditemukan pupil anisokor, dengan diameter pupil kiri 5 mm dan pupil kanan 3 mm, terdapat hemiparasesis kanan. Pada pemeriksaan lain, ditemukan adanya hematom luas 4x4 di daerah temporal kanan. Di manakah lokasi perdarahan intracranial yang paling mungkin?', 'Temporal kanan', 'Fossa posterior', 'Temporal kiri', 'Oksipital', 'Parietal kanan ', '3', 24, 2),
(266, 'Seorang petinju mengenai pukulan di hidung, setelah peristiwa tersebut penderita mengeluh keluarnya cairan dari hidung secara terus menerus. Cairan tersebut kemungkinan besar berasal dari :', 'Sekresi mukosa hidung', 'Sinus maksilaris', 'Sinus frontaliso', 'Sinus sphenoidalis', 'Cavum cranii', '4', 24, 3),
(267, 'Pria mengeluh nyeri kepala sebelah. Pasien juga mengeluh mual muntah pada pagi hari. Nyeri kepala bertambah berat terutama pada saat perubahan posisi ke kanan. Pasien tidak mengeluhkan pendengaran berkurang atau berdenging. Diagnosis ?', 'Benign Paroksismal Positional Vertigo', 'Menierre disease', 'Labirinitis', 'Acustic neuroma', 'Migraine', '1', 24, 4),
(268, 'Laki-laki, usia 15 tahun datang dengan keluhan nyeri telingan kanan, disertai penurunan pendengaran dan rasa seperti tersumbat. Sehari sebelumnya batuk pilek, S=38,80C. Pada pemeriksaan telinga didaptkan membrane timpani hiperemis. Apa diagnosis yang paling mungkin?', 'Otitis media oklusif', 'Otitis media akut presupurasi', 'Otitis media akut supurasi', 'Otitis media akut perforasi', 'Otitis media akut resolusi ', '2', 24, 5),
(269, 'Wanita 39 tahun belum menikah, putting gatal (+) berair sejak 4 bulan tidak sembuh-sembuh. PF : putting mammae kiri penuh krusta hingga papilla tidak terlihat. Massa (-). Diagnosis..', 'Metastasis breast cancer ke putting', 'Lactation infection', 'Inflamasi kronis putting', 'Paget disease of breast', 'Lymphoma of nipple  ', '4', 24, 6),
(270, 'sakit pinggang yang heabt setelah menganggkat koper. Satu tahun yang lalu mengalami patah tulang pada kruris dekstra yang dipasang plate dan screw. Plate dan screw sudah dilepas. Pemeriksaan radiologis apa yang bisa dilakulan untuk mendapatkan diagnosis yang akurat?', 'Sinar x lumbo sacral anteroposterior lateral', 'MRI lumbosakral ', 'CT Scan lumbal', 'USG Abdomen', 'Scintigrafi xy ', '1', 24, 7),
(271, 'Seorang laki-laki berusia 21 tahun datang ke UGD RS jam 10.00 dengan keluhan pilek berat. Pasien juga mengeluh mata berair dan terasa gatal serta sering bersin. Dari anamnesis diketahui laki-laki tersebut belajar di kebun bunganya pagi hari. Pasien mengutrakan bahwa akan melaksanakan ujian jam 12,00. Pemeriksaan fisik menunjukkan tekanan darah 120/90 mmHg, frekuensi nafas 18 x/menit, suhu tubuh 370C. Status lokalis mata menunjukkan hiperlakrimasi dan injeksi konjungtiva. Apakah obat yang paling tepat?', 'Cetrixine', 'Cyproheptadine', 'Diphenhydramine', 'Hydroxyzine', 'Prometazine', '1', 24, 8),
(272, 'kuning. Keluhan tidak disertai demam. Tidak ada riwayat penyakit hati. Hasil pemeriksaan fisik, tanda vital dan pem.fisik abdomen dalam batas normal. Hasil pem lab : kadar bilirubin serum meningkat. Hasil pemeriksaan urin sedikit meningkat, urobilinogen dibawah batas normal. Apakah mekanisme yang menyebabkan keluhan tersebut?', 'Obstruksi duktus bilaris komunis', 'Infeksi Hepatitis', 'Obstruksi vena porta', 'Kerusakan sel hepatosit', 'Gangguan metabolism bilirubin', '1', 24, 9),
(273, 'Anak 3 tahun datang ke klinik dengan keluhan demam dan batuk 3 hari, S=390C, R 50x/mnit, cuping hidung merah, retraksi subcostal. Pemeriksaan auskultasi paru krepitasi bilateral. Hb 11,5. Leukosit 28.000 dengan 75% neutrofil, trombosit 150.000, saturasi oksigen 98 % . X-Ray ada terdapat infiltras merata di parenkim paru bilateral. Diagnosis?', 'Bronchiolitis', 'ISPA', 'Bronchopneumonia', 'Lobar pneumonia', 'Asma  ', '3', 24, 10),
(274, 'Seorang perempuan 40 tahun sudah berobat TB selama 6 bulan, Tetapi pada hasil pemeriksaan sputum terakhir didapatkan BTA (+++). Penatalaksanaan selanjutnya ', ' Menyisipkan isoniazid dan irfampisin selama 1 bulan', 'Memberikan obat kategori II dengan injeksi streptomycin selama 2 bulan ', 'Mengulang dengan obat yang sama selama 6 bulan', 'Tes kultur dan resistensi jika masih sensitive lanjutkan dengan obat yang sama', 'Rujuk karena termasuk kasus kronik ', '2', 24, 11),
(275, 'Seorang laki-laki berusia 30 tahun datang ke UGD diantar oleh temannya karena luka terbuka pada paha kanan dan kaki kanannya setelah kecelakaan 1 jam yang lalu. Keluhan juga disertai dengan tak bisa menggerakkan pada dan kaki kanan, Pem.fisik setelah secondary survey didapatkan keadaan axietas TD 90/60 mmHHg, N 118x/menit, R 28x/mnt. Apa diagnosis pada pasien tersebut?', 'Syok anafilaktik', 'Syok hipovolemik', 'Syok cardiogenic', 'Syok neurogenik', 'Syok septic ', '2', 24, 12),
(276, 'Seorang wanita 40 tahun , datang dengan keluhan nyeri ulu hati sejak 1 minggu yang lalu. Keluhan dirasakan memburuk bila perut kosong sehingga pada malam hari pasien terbangun dari tidurnya. Keluhan dirasakan berkurang bila minum antasida. Sejak 4 minggu yang lalu, pasien mengeluh nyeri pinggang dan diberi obat oleh puskesmas yang diminum secara rutin selama 2 minggu. Obat penghilang nyeri yang dimaksud adalah?', 'Asam mefenamat', 'Flubendazol', 'Natrium diklofenak', 'Aspirin ', 'Ibuprofen ', '4', 24, 13),
(277, 'Pasien wanita 24 tahun G2P1A0 datang dengan keluhan perdarahan dari jalan lahir sejak 4 jam yang lali. Riwayat SC anak pertama 2 tahun yang lalu. Riwayat sakit DM dan hipertensi, Dan operasi kista ovarium. Faktor resiko pada pasien adalah:', 'Hipertensi', 'Riwayat SC', 'Riwayat operasi kista ovarium ', 'Multipara', 'Riwayat keluarga ', '1', 24, 14),
(278, 'Seorang anak usia 7 tahun datang ke poliklinik dengan keluhan tidur, mengorok sejak 1 tahun yang Lalu, hilang timbul. Dari pemeriksaan fisik didapatkan pembesaran tonsil dengan tonsil tidak hiperemis, kripta melebar dan detritus. Apakah indikasi tonsilektomi yang paling mungkin?', 'Gangguan tidur', 'Nyeri menelan yang berulang', 'Nyeri tenggorokan yang berulang', 'Panas badan tinggi', 'Kecerdasan yang menurun ', '1', 24, 15),
(279, 'Seorang anak laki-laki berusia 1 bulan dibawa ke puskesmas untuk pemeriksaan rutin. Anak belum pernah mendapatkan imunisasi apapun sebelumnya. Apakah imunisasi yang seharusnya diberikan sekarang?', 'BCG, DTP, OPV', 'BCG, OPV, Hepatitis B', 'BCG, DTP, Hepatitis B', 'DTaP, OPV, Hepatitis B', 'DTap, IPV, Hepatitis B', '2', 24, 16),
(280, 'Seorang laki-laki berusia 43 tahun datang dengan keluhan adanya benjolan pada paha kirinya. Keluhan telah berlangsung selama 15 tahun. Benjolan dirasakan membesar sampai berukuran diameter 10 cm dan tidak nyeri. Pemeriksaan histopatologi didapatkan sel lemak yang matur, solid dan hiperplastik. Inti sel terdapat di perifer dan vakuola pada sitoplasma. Apakah diagnosis yang paling tepat?', 'Liposarkoma', 'Lipoma ', 'Fibrolipoma ', 'Fibrohistocytoma', 'Fibroma', '2', 24, 17),
(281, 'Seorang bayi perempuan kurang bulan baru lahit dari seorang ibu G2P1 usia 35 tahun dengan seksio sesarea atas indikasi fetal distress dan deselerasi lambat. Pecah ketuban 28 jam sebelum kelahiran. Cairan amnion jernih, Tidak lama setelah lahir bayi mengalami retraksi subkostal dan interkostal. Apakah penyebab paling mungkin?', 'Ketuban pecah sebleum waktunya', 'Penyakit membrane hyaline', 'Primigarvida', 'Seksio sesarea', 'Aspirasi mekonium', '2', 24, 18),
(282, 'Seorang perempuan berusia 62 tahun penyandang hipertensi datang ke puskesmas untuk pemeriksaan rutin. Pada pemeriksaan fisik didapatkan tekanan darah 180/90 mmHg. Pemeriksaan tekanan darah sebelumnya (1 bulan yang lalu) diketahui 200/120 mmHg. Pasien mendapatkan terapi vasodilator dan B-blocker. Apakah obat yang paling tepat diberikan?', 'ACE inhibitor ', 'a-blocker', 'Ca-channel blocker', 'Angiotensin reseptor blocker', 'Diuretik   ', '5', 24, 19),
(283, 'Seorang laki-laki berusia 65 tahun, dibawa ke praktek dokter umum, karena mengalami luka di tungkai bwah kiri sejak 3minggu yanglalu. Luka tersebut disertai bengkak, gatal dan nyeri. Pasien adalah seorang tuna wisma. Pada pemeriksaan fisik didapatkan luka terbuka, edema, dan terlihat struktur bergerak di bagian tengah lesi. Apakah diagnose yang paling mungkin?', 'Ankilostomiasis', 'Nekatoriasis', 'Pedikulosis', 'Selulitis', 'Miasis ', '1', 24, 20),
(284, 'Seorang laki-laki berusia 28 tahun dibawa ke UGD Rumah Sakit karena tidak sadar. Keadaan tersebut terjadi setelah pasien mengkonsumsi minuman keras oplosan. Hasil pemeriksaan fisik diperoleh tingkat kesadaran koma, tanda vital tekanan darah 80/60 mmHG, denyut nadi 50x/mnt, frekuensi nafas 12x/mnt, suhu 35,60C. Hasil pemeriksaan darah didapatkan pH darah 6,8 dan HCO3 5 meq/L. Apakah tindakan yang paling tepat?', 'Infus RL 25 tetes/menit', 'Pemasangan NGT untuk bilas lambung', 'Forced diuretic untuk mengubah pH urine', 'Hemodialisis', 'Sorbitol untuk pencahar melalui NGT   ', '4', 25, 1),
(285, 'Laki-laki, lemah tangan dan kaki, dirasakan 2 minggu yang lalu. Pasien juga mengalamai diare 3-5x/hari., volume ½ gelas, konsistensi lembek dan tidak berlendir. Asupan makan dan minum tidak terganggu. TD 110/70 mmHg, HR 70x/mnt, R 16x/mnt, kemampuan motorik 2 dan ridak ditemukan adanya deficit neurologis. Pemeriksaaan apakah yang sebaiknya dilakukan?', 'Hitung jenis leukosit', 'Hitung KGD ad random', 'Hitung elektrolit', 'Hitung pH', 'Hitung diff. count ', '3', 25, 2),
(286, 'Pria, 50 tahun, KU: nyeri pada ibu jari kanan, sudah 3 minggu,  nyeri pada ibu jari kanan jika digerakkan. Riwayat sebelumnya makan kerupuk emping, Terdapat nodul dengan diameter 2 cm pada pangkal ibu jari, melekat pada dasar dan nyeri jika digerakkan. Diagnosa?', 'Arthritis gout', 'Arthritis tuberrkulosa', 'Arthritis', 'OA', 'Sinovitis ', '1', 25, 3),
