(288, 'Seorang laki-laki berusia 31 tahun, dibawa ke IGD Rumah Sakit JIwa, karena sering mengalami ketakutan, gelisah dan marah-marah sejak ditahan di kantor polisi 5 hari yang lalu. Saat diberi makan, ia tidak mau makan, dengan alas an tidak nafsu makan. Pemuda ini ditahan karena ketahuan mengkonsumsi NAPZA bersama teman-temannya dengan riwayat pemakaian zat tersebut sudah 5 tahun serta hampir setiap hari mengkonsumsi zat tersebut. Pasien tampak malas sekali tidak bergairah, sering mengantuk, ditandai dengan seringnya pemuda tersebut menguap. Apa jenis NAPZA yang paling mungkin sebagai penyebab?', 'Kokain', 'Amphetamin', 'Ganja', 'Sedative hipnotik ', 'Alkohol', '1', 25, 5),
(289, 'Seorang laki-laki berusia 65 tahun, datang ke poliklinik umum dengan keluhan tidak mampu untuk  berkonsentrasi dan tidak bisa berpikir jernih. Hal ini telah dirasakan oleh pasien selam 1 bulan terakhir, Kurang lebih 6 bulan yang lalu, istri pasien meninggal dunia. Di samping keluhan tersebut, pasien juga mengeluh sering terbangun dini hari dan tidak mampu untuk tidur kembali. Selama ini pasien masih dapat melakukan aktivitas hariannya sendiri, Apakah pemeriksaan status mental yang paling tepat?', 'Penampilan', 'Pembicaraan', 'Mood dan afek', 'Aktivitas psikomotor', 'Tilikan diri (insight)  ', '3', 25, 6),
(290, 'Seorang wanita berusia 25 tahun G3P2A0 merasa hamil 42 minggu datang untuk kontrol ke puskesmas. Hasil anamnesis didapatkan : pasien tidak mengeluh adanya lendir dan darah yang keluar dari jalan lahir serta tidak didapatkan rasa mulas. Riwayat keluar cairan bnyak ada yaitu 8 jam seelum pasien datang ke puskesmas.\nTindakan apa yang diberikan kepada pasien tersebut?\n', 'Induksi persalinan', 'Sectio Sesarea', 'Vakum', 'Forseps', 'Manual aid ', '1', 25, 7),
(291, 'Dokter B bekerja di sebuah puskesmas dan kedatangan pasien wanita usia 26 tahun. Pasien tersebut adalah baru pertama kali datang ke psuskesmas untuk melakukan pengobatan yang dilakukan oleh dokter tersebut sebelum anamnesis adalah?', 'Perkenalkan diri dan bertanya, apakah ada yang bisa dibantu?', 'Menggali identitas pasien tersebut', 'Bertanya tentang keluhan utama pasien ', 'Langsung memeriksa pasien ', 'Menuliskan langsung restnya karena melakukan pengobatan    ', '1', 25, 8),
(292, 'Seorang dokter ingin melakukan penelitian terhadap ibu hamil yang diberikan f, Zn, Fe dan Zn. Kemudian dilakukan pemeriksaan Hb pada ibu hamil. Metode statistic yang digunakan adalah :', 'T –test', 'Anova', 'T dependent', 'T independent', 'Chi square test', '2', 25, 9),
(293, 'Seorang laki-laki 35 tahun datang ke rumah sakit dengan keluhan mata kuning. Keluhan disertai dengan air kencing seperti teh. Keluhan juga disertai dengan nyeri perut kanan atas, mual dan muntah. Pasien sudah beberapa kali muntah. Dari pemeriksaan fisik didapatkan hepatomegali dengan permukaan datar dan konsistensi kenyal, Morfologi telur cacing penyebab penyakit di atas adalah?', 'Bulat (dengan bagian tengah terdapat striae raider)', 'Oval dengan bagian dalam telur terdiri atas beberapa sel', 'Oval, seperti tempayan dengan knob di kedua sisinya', 'Oval dengan knob di salah satu sisinya', 'Oval dengan satu tonjolan di satu sisi dan knob di sisi yang lain ', '4', 25, 10),
(294, 'Seorang laki-laki berusia 18 tahun datang ke IGS RS setelah mengalami kecelakaan lalu lintas. Pada awal isnpeksi tampak kesulitan bernafas. Dari pemeriksaan vital sign didapatkan TD 80/50 mmHg, nadi 120x/mnt, nafas 30x/mnt. Pada inspeksi didapatkan jejas pada dada. Pada perkusi didapatkan redupa dari basal paru hingga tengah. Pada asukultasi didapatkakn suaru paru menghilang. Diagnosis klinis yang tepat adalah :', 'Pneumothorax', 'Tamponade cordis', 'Hematothorax', 'Contusio miokard', 'Contusio pulmonum ', '3', 25, 11),
(295, 'Wanita usia 45 tahun mengluh penurunan penglihatan secara tiba-tiba pada mata kanan setelah bertengkar dengan suaminya , mata kanan terasa nyeri hebat, pandangan seperti melihat adanya pelangi, nyeri kepala, mual dan muntah. Pada pemeriksaan didapatkan konjungtiva hiperemis, penekanan bola mata lebih keras. Diagnosa?', 'Glaukoma akt', 'Panoftalmitis', 'Endoftalmitis', 'Uveitis anterior', 'Ulkus kornea', '1', 25, 12),
(296, 'Seorang bayi 1 bulan dibwa ke puskesmas untuk iunisasi. Ibu pasien bilang sebelumnya dapat imunisasi BCG dan polio. Saat ini imunisasai yang harus diberikan adalah :', 'Hib', 'DPT', 'MMR', 'Campak', 'Hepatitis B  ', '5', 25, 13),
(297, 'Seorang perempuan dirujuk dari puskesmas setelah dirawat selama 3 hari dengan diagnosis DHF. Pasien mengalami epistaksis dan perubahan gusi yang tidak berhenti. Saat ini tidak demam. Pada pemeriksaan fisik didapatkan Hb 10,4 g/dl, leukosit 7800, trombosit 23.000. Tidak ada pembesaran hepar dan spleen. Pemeriksaan lanjutan yang paling tepat pada pasien ini ?', 'Clotting time', 'Bleeding time', 'Faktor VII', 'Faktor IX', 'Faktor von Wielbrand ', '2', 25, 14),
