(307, 'Seorang perempuan berusia 22 tahun dibawa ke puskesmas dengan keluhan nyeri pinggang sampai ke daerah pusar disertai keluar lender bercampur darah sejak 8 jam yang lalu. Pasien sedang hamil anak pertama usia kehamilan 37 minggu, janin tunggal, hidup, intrauteri. Pemeriksaan tanda vital TD 130/80 mmHg, denyut nadi 74x/mnt, respirasi 20x/mnt dan suhu 36,70C. Pemeriksaan dalam didapatkan pembukaan 4 cm, ketuban belum pecah dan janin persentasi belakang kepala. Fase apakah yang sedang dialami oleh pasien di atas?', 'Fase aktif deselerasi', 'Fase aktif obliterasi', 'Fase aktif dilatasi maksimal', 'Fase aktif akselerasi', 'Fase laten ', '3', 26, 4),
