(338, 'Seorang perempuan berusia 29 tahun datang ke klinik diantar suaminya untuk meminta obat penawar karena nyeri di bahu yang dideritanya 2 hari ini. Pasien mengatakan dirinya seorang dewi ular dan dia adalah reinkarnasi ular yang 2 hari lalu dipukul dengan kayu oleh tetangganya. Pasien pernah melihat dewi ular mendatangi dan memasuki tubuhnya. Suaminya mengatakan bahwa sang istri sering bercerita mengenai hal serupa sejak 1 tahun yang lalu.  Pasien sering menangis tanpa sebab, sulit tidur, sering lupa makan, dan sering berkeliling di sekitar desa tanpa tujuan. Dari riwayat kelurga, didapatkan ibu dari pasien tersebut mengamuk tanpa sebab yang jelas. Pasien ini berasal dari keluarga tidak mampu dan tidak lulus SD. Pada pemeriksaan fisik tidak didapatkan kelainan. Apakah diagnosis yang paling mungkin?', 'Gangguan waham', 'Skizofrenia', 'Gangguan psikotik', 'Episode depresi berat dengan gejala psikotik ', 'Retardasi mental   ', '2', 27, 18),
(339, 'Seorang laki-laki berusia 50 tahun datng ke dokter praktek umum dengan keluhan nyeri punggung bawah sebelah kanan sejak 3 minggu yang lalu. Saat itu pasien berusaha memindahkan almari pakaian di kamarnya. Nyeri terasa tajam kadang seperti tersengat listrik dan menjalar ke tungkai kanan. Nyeri dirasakan memberat bila batuk dan mengejan. Pasien belum pernah mengalami hal serupa sebelumnya. Sehari-hari pasien berkerja sebagai buruh bangunan. Pada pemeriksaan fisik didapatkan laseque (+). Apakah diagnosis yang paling mungkin?', 'Spondilitis', 'Osteoarthritis', 'HNP', 'Spondilolisthesis', 'Spondilitis   ', '3', 27, 19),
(340, 'Seorang bayi laki-laki berusia 10 bulan dibawa ibunya ke puskesmas dengan keluhan BAB cair sejak 2 minggu yang lalu sebnyak 2-4 kali per hari. BAB berwarna kuning, tidak berbau, dan setiap BAB anak menangis menjerit. Keluhan BAB cair dikeluhkan ibunya hampir setiap 3 hari sejak usia anak 7 bulan. Sejak umur 6 bulan  ASI tidak keluar sehingga ibunya memberikan susu formula. Pada pemeriksaan fisik, didapatkan anak tidak rewel, kencing baik tiap 2-3 jam seklai. Tak tampak haus. Mata tidak cekung, kulit pantat keriput. Apakah terapi rehidrasi yang paling sesuai?', 'RL 30cc/kgBB', 'RL 75 cc/kgBB', 'NaCl 0,9% 75 cc/kgBB', 'Oralit sebabnyak bayi mau', 'Oralit 50 cc setiap kali diare ', '5', 27, 20);
INSERT INTO `bf_soal` (`id`, `question_name`, `answer1`, `answer2`, `answer3`, `answer4`, `answer5`, `answer`, `ujian_id`, `urutan`) VALUES
(341, 'Seorang laki-laki umur 60 tahun, datang ke praktek  dengan benjolan sebesar telur ayam di perut bawah kiri sejak pagi tadi,  benjolan hilang timbul,  timbul ketika mengedan dan loncat-loncatan dan menghilang jika berbaring. Pada pemfis teraba benjolan diatas lipatan inguinal,  valsava test (+) apa diagnosis yang mungkin?', 'hernia inguinalis', 'hernia umbilicalis', 'hernia hiatal', 'hernia femoralis', 'hernia scrotalis', '1', 14, 9),
(342, 'Seorang perempuan 52 tahun datang ke poliklinik dengan keluhan batuk sejak 3 bulan yang lalu. Keluhan lain dahak berwarna kekuningan, pilek, dan penurunan berat badan. BMI pasien : 17. Pada pemeriksaan fisik TD 130/90mmHg, nadi 100x/menit, RR 24x/menit. Pada auskultasi terdapat suara nafas vesikuler pada kedua hemithoraks paru. Pada foto thoraks terdapat gambar bercak kesuraman kecil-kecil pada kedua hemithoraks paru yang membentuk gambaran “SNOW STORM”. Apa diagnosis pada pasien ini?', 'Bronkitis kronis', 'TB paru', 'TB milier', 'Bronkietasis ', 'Bronkhilolitis ', '3', 14, 10),
(343, 'Perempuan 35 tahun datang ke Rs dengan keluhan sakit kepala dirasakan sudah 2 minggu. Pasien juga mengeluhkan sakit ulu hati, mual, merasa takut dan berkeringat. Pada pemeriksaan fisik  Td 150/80 N 95x/m. Pemeriksaan endoskopi lambung didapatkan erosi pada lambung. Apakah diagnosis yang tepat pada pasien tsb :', 'Psikosomatik', 'Somatoform', 'Anxietas', 'Somatik', 'Depresi', '2', 14, 11),
(344, 'Seorang perempuan 16 tahun sedang mengikuti ujian UN. Pasien berteriak-teriak, mondar-mandir. Suaranya pasien berubah menjadi suara laki-laki tua yang mengaku sebagai penunggu sekolah. Pasien bercerita tentang sekolah tersebut. Pasien tidak ada kelainan jiwa sebelumnya. Pasien seorang yang pendiam dan suka melamun. Apa diagnosis pada pasien ini', 'Amnesia disorientasi', 'Fungsional disorientasi', 'Trans disorientasi', 'Konveksi holistik', 'Depersonalisasi ', '3', 14, 12),
(345, 'Seorang wanita usia 40 tahun datang ke Rs dengan keluhan berubah-ubah. Punggung nyeri, perut kembung dan panas, nyeri pada kemaluan, kedua kaki terasa lemah. Pekerjaan sehari-hari dan status sosial pasien terganggu. Tidak ada kondisi medic yang mendasari penyakit. Apa diagnosis yang paling mungkin ?', 'Gangguan nyeri', 'Gangguan somatisasi', 'Gangguan konversi', 'Gangguan hipokondriasis', 'Gangguan dimorfik tubuh', '2', 14, 13),
(346, 'Laki-laki usia 20 tahun datang dengan ke puskesmas dengan keluhan benjolan pada kelopak mata kanan atas yang dialami sejak 2 minggu yang lalu. Pada pemeriksaan oftalmologi didapatkan tumor pada palpebra superior, tidak merah, tidak nyeri,  dan pseudoptosis. Apa diagnosisnya?', 'Hordeolum', 'Kalazion', 'Blefaritis', 'Abses palpebra', 'Dakroadenitis ', '2', 14, 14),
(347, 'Wanita usia 25 tahun datang ke rumah sakit dengan keluhan mata merah dan diikuti dengan pandangan kabur dan rasa silau sejak 1 hari yang lalu. Pada pemeriksaan oftalmologi didapatkan pada  injeksio perikornea, inj. Konjungtiva, kornea didapatkan bintik pungtata dan pada pemeriksaan fluoresence (+). Apa penyebab dari kelainan  diatas?', 'Bakteri', 'Virus', 'Alergi', 'Jamur', 'Parasit ', '2', 14, 15),
(348, 'Seorang anak usia 5 tahun datang ke rumah sakit bersama ibunya dengan keluhan mata merah sejak 5 hari yang lalu. Mata juga dirasakan gatal, pandangan tidak kabur dan berair. Pada pemeriksaan ofalmologi pada konjungtiva tampak cobble stone. Penatalaksanaan?', 'Koritkosteroid', 'Antibiotic', 'Antijamur', 'Antihistamin', 'Antiviral', '4', 14, 16),
(349, 'Wanita usia 30 tahun datang ke rumah sakit dengan keluhan mata merah dan diikuti dengan pandangan kabur, silau. Pada pemeriksaan oftalmologi terdapat penurunan visus, Fluorescence (+) dan tampak lesi satelit. Diagnosa yang tepat adalah:', 'Ulkus kornea jamur', 'Ulkus kornea virus', 'Endoftalmitis ', 'Konjungtivitis bakteri', 'Konjungtivitis viral', '2', 14, 17),
(350, 'Anak usia 12 tahun datang bersama orangtuanya ke rumah sakit dengan keluhan matanya kabur sejak 3 hari yang lalu. Tidak ada rasa gatal, tidak nyeri. Pada pemeriksaan lensa Mata kiri S-8. Mata kanan S-2. Kelainan ini merupakan?', 'Ansimetrop', 'Hipermetropi', 'Heterotrop', 'Presbiop ', 'Myopia', '1', 14, 18),
(351, 'Seorang anak usia 8 tahun datang bersama ibunya dengan mata merah sejak 1 hari yang lalu. Mata juga dirasakan gatal, berair pandangan tidak kabur. pada konjungtiva palpebra ditemukan cooble stone app. Penyebab pada kasus ini adalah…', 'Virus', 'Bakteri', 'Jamur', 'Alergi', 'parasit', '4', 14, 19),
(352, 'Wanita usia 30 tahun datang ke rumah sakit dengan keluhan mata merah dan diikuti dengan pandangan kabur, silau sejak 3 hari lalu. Sebelumnya pasien matanya terkena bola bulu tangkis.  Pada pemeriksaan oftalmologi terdapat penurunan visus,  hifema. Lensa dan funduskopi sulit dinilai. Apa yang menyebabkan penurunan penglihatan? ', 'Hifema', 'Ptosis ', 'Lesi pada nervus opticus ', 'Fotofobia ', 'Iritasi pada chiasma', '1', 14, 20),
(353, 'Pasien umur 39 tahun datang dengan keluhan penglihatan kabur dan mata cepat lelah sejak 1 minggu yang lalu. Pada pemeriksaan didapatkan OD+5 OS+6 kelainan ini merupakan?', 'Hipermetrop', 'Presbiop', 'Astigmatisme', 'Myopia ', 'Anisometrop ', '1', 15, 1),
(354, 'Seorang laki-laki datang dengan keluhan penurunan penglihatan. Riwayat terkena tumbuhan ketika bekerja. Mata merah, nyeri, silau, terdapat kotoran mata. Dari pemeriksaan didapatkan tampak lesi satelit pada kornea, injeksi kornea, konjungtiva hiperemis, visus 6/72. Apa diagnosanya..', 'Keratitis bakteri', 'Konjungtivitis alergi', 'Keratitis jamur', 'Keratokonjungtivitis', 'Keratitis Viral', '5', 15, 2),
(355, 'Seorang laki-laki 30 tahun datang dengan keluhan penurunan penglihatan. Riwayat trauma terbentur batu. Dari pemeriksaan fisik didapatkan hifema, perdarahan subkonjungtiva (lupa yg lain). Pemeriksaan tambahan apa yang tepat dilakukan untuk membantu diagnosa..', 'Refraktometri', 'Kampimetri ', 'Keratometri', 'Tonometri', 'Slit lamp', '5', 15, 3),
(356, 'Seorang pria berusia 45 tahun datang ke rumah sakit dengan keluhan memasukkan kawat timah melalui uretra sampai vesica urinaria. Saat kawat ditarik keluar, timbul rasa sakit, dan berdarah. Penderita sudah sering melakukan hal ini karena menimbulkan rasa nikmat. Menurut istrinya, sejak satu tahun ini kadang-kadang ia mengikat penisnya dengan tali atau menusukkan penisnya dengan kawat sampai berdarah. Gangguan apa yang dialami pria ini:', 'Disfungsi orgasme', 'Pedofilia', 'Ekshibionisme', 'Masokisme', 'Fetihisme', '4', 15, 4),
(357, 'Seorang pasien datang kedokter dengan memaksa ingin melakukan ct-scan atau EEG karena pasien merasa ada penyakit dikepalanya. Sedangkan dokter menjelaskan bahwa tidak ada gangguan pemeriksaan fisik dan lainnya.Apa diagnosa pasien diatas?', 'Gangguan Somatic', 'Ganngguan konversi', 'Gangguan somatoform', 'Gangguan keperibadian', 'Hipokondriasis', '5', 15, 5),
(358, 'Laki-laki 35 tahun datang ke IGD RS, diantar oleh keluarganya karena pasien sering bicara kacau, mengamuk dan merusak toko tetangganya. 6 bulan yang lalu pasien mengalami kerugian, pasien kecewa dan merasa semua ini adalah konspirasi antar pedagang yang tidak sehat, pasien merasa diguna-guna tetangganya, kemudian pergi kedukun untuk meminta pertolongan menggunakan jimat-jimat. 2 minggu terakhir pasien merasa ada yang ingin membunuhnya karena ada bisikan-bisikan yang selalu mengancamnya. Sejak saat itu pasien selalu waspada, tidak mau keluar rumah dan tidak mau ke tempat umum, rumah dan tokonya pun digembok dan dirantai, pasien adalah seorang pedagang dan belum menikah. Apakah diagnosa pasien tesebut?', 'Episodik manik dengan gejala psikotik', 'Gejala afktif bipolar', 'Skizofrenia hebefrenik', 'Skizofrenia paranoid', 'Skizofrenia katatonik', '4', 15, 6),
(359, 'Pasien Perempuan 73 tahun mengeluh suka lupa ketika menaruh barang. Pasien juga sering marah-marah kepada suaminya. Diagnosis', 'Demensia', 'Skizofrenia', 'Ggg anxietas', 'Ggg cemas menyeluruh', 'Ggg psikotik', '3', 15, 7),
(360, 'Seorang wanita usia 24 tahun datang dengan keluhan lupa minum pil KB pada hari ke 17, 18. Sebagai dokter apa yang anda sarankan?', 'Minum 1 pil hari ini, 2 pil esok harinya', 'Minum 2 pil hari ini, 2 pil esok harinya', 'Tetap lanjut', 'Langsung minum 3 pil', 'Stop pikirkan kontrasepsi lainnya', '2', 15, 8),
(361, 'Seorang perempuan, 35 tahun datang ke RS dengan perdarahan dari jalan lahir sedikit-sedikit sejak 1 minggu yang lalu. Pasien sat ini sedang hamil 2 bulan. Pasien telah menikah 6 tahun dan belum mempunyai anak. Pemeriksaan Fisik pasien tampak anemis. Pemeriksaan Dalam Vagina uterus sebesar UK 8 minggu, nyeri goyang portio (+), parametrium kiri dan kanan tidak teraba massa, cavum douglasi menonjol. Diagnosis yang tepat adalah :', 'KET', 'Mola Hidatidosa', 'Abortus Inkomplit', 'Abortus imminens', 'Abortus Komplit', '1', 15, 9),
(362, 'Seorang wanita, 26 tahun, G2P1A0 dengan usia kehamilan 8 bulan datang ke puskesmas dengan keluhan demam sejak 3 hari yang lalu, pasien sudah minum obat demam namun demamnya tidak turun. TD : 110/80 N:80x/m RR:20x/m S:37,80C. Didapatkan pembesaran tonsil T2-T2. Terapi yang sesuai adalah :', 'Eritomisin', 'Tetrasiklin', 'Kloramfenikol', 'Tiamfenikol', 'Ciprofloxacin', '1', 15, 10),
(363, 'Seorang perempuan, 30 tahun dengan G2P1A0 usia kehamilan 41 minggu datang dengan keluar darah dari jalan lahir. Darah berwarna merah segar, tidak ada nyeri perut, perdarahan ini yang kedua kali dialami. Tanda vital dalam batas normal. Dari hasil USG 1 minggu yang lalu didapatkan plasenta pada segmen bawah rahim dan menutupi OUI. Apa tindakan yang di lakukan :', 'Partus pervaginam', 'Observasi', 'Drips Oksitosin', 'Persiapkan SC segera', 'PDV di meja operasi', '4', 15, 11),
(364, 'Pasien G3P2A0 38 minggu datang dengan keluhan nyeri pada perut dan perdarahan pada vagina, darah berwarna gelap. sebelumnya pasien berobat di bidan dan dilakukan versi luar karena letak lintang. Ada riwayat HT sejak UK 32 minggu. Pada pemeriksaan fisik didapatkan TD: 100/60 mmHg, nadi: 60 kali/menit, respirasi: 14 kali/menit,konjungtiva Anemis (+). DJJ(-). Apa Diagnosa yang tepat?', 'Ruptur uteri', 'Abortus inkomplit', 'Plasentia previa', 'Solusio plasenta', 'KET', '1', 15, 12),
(365, 'Pria 24 tahun datang ke puskesmas dengan nyeri kepala sebelah terasa berdenyut. Keluhan diawali dengan mual, muntah, dan jika terkena sinar atau dengan suara bising. TD: 100/60 mmHg, nadi: 60 kali/menit, respirasi: 14 kali/menit, dan tidak ada kelainan pada pemeriksaan lain. Kemungkinan besar pasien ini menderita?', 'Migren dengan aura', 'Migren tanpa aura', 'Tension headache', 'Cluster headache', 'Neuralgia trigeminal', '1', 15, 13),
(366, 'Pria usia 30 tahun datang ke poliklinik dengan keluhan mulut mencon kanan. Keluhan disertai mata kanan tidak bisa menutup, tidak ada keluhan bicara pelo ataupun kelemahan anggota gerak. Pada pemeriksaan fisik diperoleh kesadaran composmentis, TD: 120/80 mmHg, nadi : 80 kali/menit, respirasi : 18 kali/menit. Pada pemeriksaan neurologi didaptkan parese N.VII kanan perifer. Apa diagnosis yang paling tepat?', 'Periodic paralisis', 'Miastenia gravis', 'Bell’s palsy', 'TIA', 'Stroke ', '3', 15, 14),
(367, 'Pria usia 55 tahun datang ke IGD dengan keluhan lemas separuh badan kiri. Pasien diketahui memiliki riwayat hipertensi sejak 12 tahun yang lalu dan meroko 2 bungkus/hari selama 28 tahun. Hasil pemeriksaan fisik didapatkan TD: 170/100 mmHg, nadi 90 kali/menit, respirasi : 18 kali/menit, suhu : 36,90C. reflex patologis -/+. Pemeriksaan penunjang yang tepat untuk membantu menegakan diagnosis adalah?', 'MRI', 'EEG', 'EKG', 'CT SCAN', 'Angiografi ', '4', 15, 15),
(368, 'Pria usia 45 tahun datang dengan keluhan nyeri kepala sebelah sejak 1 minggu yang lalu. Nyeri bersifat hilang dan timbul, dirasakan terutama disekitar bola mata dan pelipis,disertai mata merah dan berair. Pada pemeriksaan fisik tidak mengalami kelainan. Wanita ini menderita?', 'Migren tanpa aura', 'Trigeminal neuralgia', 'Tension headache', 'Cluster headache', 'Migren dengan aura ', '4', 15, 16),
(369, 'Seorang anak umur 3 tahun dibawah ke RS dng keluhan sesak napas yang disertai dengan suara serak dan nyeri menelan. Riwayat demam tinggi. Dari pemeriksaan fisis ditemukan mulut berbau, pembesaran tonsil T2-T2 dengan pseuodomembran. Diagnosis yang tepat adalah?', 'Tonsilitis Difteri', 'Tonsilolaringitis ', 'Tonsilofaringitis', 'Tonsilofaringeolaringitis eutika', 'Tonsilofaringolaringitis difteri', '1', 15, 17),
(370, 'Anak usia 2 tahun datang ke puskesmas diantar ibunya dengan keluhan sakit pada telinga kiri, disertai demam dan gangguan pendengaran selama 1 minggu terakhir. Ada riwayat batuk pilek sebelumnya. Dari pemeriksaan fisik didapatkan suhu: 39,50C, pada otoskopi ditemukan membrane timpani intak, hiperemi, dengan supurasi telinga tengah. Diagnosis yang tepat adalah?', 'Otitis media akut', 'Otitis media supuratif kronik', 'Mastoiditis ', 'Otitis eksterna sirkumsripta', 'Otitis eksterna difusa', '1', 15, 18),
(371, 'Wanita usia 25 tahun, datang ke klinik dengan keluhan rasa tersumbat pada hidungnya. Tidak disertai bersin bersin dan tidak disertai flu dan demam. Pada pemeriksaan rinoskopi anterior didapatkan ada benjolan yang putih pucat dan berisi air. Apa diagnosisnya?', 'Polip nasi', 'Sinusitis', 'Rhinitis', 'Benda asing', 'Rhinitis atrofi', '1', 15, 19),
(372, 'Seorang laki-laki datang dengan keluhan  sakit kepala yang diikuti keluar cairan dari hidung yang berbau busuk. Pada pemeriksaan didapatkan nyeri tekan pada daerah pipi. Diagnosis yang tepat adalah?', 'Rhinitis vasomotor', 'Rhinitis alergi', 'Sinusitis', 'Rhinitis atrofi', 'Polip nasi ', '3', 15, 20),
(373, 'Seorang laki-laki datang dengan keluhan  sakit kepala yang diikuti keluar cairan dari hidung yang berbau busuk. Pada pemeriksaan didapatkan nyeri tekan pada daerah pipi. Sinus apa yang terinfeksi pada kasus tersebut?', 'Sinus maxillaris', 'Sinus frontalis', 'Sinus ethmoidalis', 'Sinus sfenoidalis', 'Sinus anterior', '1', 16, 1),
(374, 'Seorang bayi usia 8 hari dibawa ke rumah sakit oleh orangtuanya dengan keluhan berupa benjolan pada bagian punggung bawah. Pada pemeriksaan didapatkan defek pada penutupan neural tube di daerah lumbosakral. Apakah penyebab kelainan ini?', 'Kekurangan pemberian Fe waktu hamil', 'Kekurangan pemberian asam folat waktu hamil', 'Kelebihan konsumsi alcohol waktu hamil', 'Infeksi toxoplasma waktu kehamilan', 'Genetik', '2', 16, 2),
(375, 'Bayi umur 10 hari masuk rumah sakit diantar orangtuanya dengan keluhan sianosis yang dialami sejak lahir dan memberat ketika menangis. Lahir di bidan, cukup bulan, segera menangis, sianosis. Dari pemeriksaan thorax Murmur ejeksi sistolik pd pinggir sternum kiri Dari pemeriksaan radiologi didapatkan gambaran berikut', 'TOF', 'VSD', 'PDA', 'ASD', 'PDA', '1', 16, 3),
(376, 'Laki-laki usia 60 tahun masuk dengan nyeri perut, sudah 4 hari tidak kentut dan tidak BAB, disertai kembung, mual, muntah,demam sejak 1 hari yang lalu. Sebelumnya perut pernah dipijat oleh tukang pijat, setelah dipijat terasa tidak nyaman . Pada pemeriksaan fisis didapatkan kesadaran composmentis TD: 100/50 mmHg, nadi : 54 kali/menit, respirasi 12 kali/menit, suhu: 37,800C, distensi abdomen, peristaltic meningkat,metallic sound, terdapat darm contour  , darm steifung, hasil dari gambaran radiologi foto polos abdomen herring bone sign. Apa diagnosisnya?', 'Ileus paralitik', 'Ileus obstruktif', 'Tumor colon', 'Tumor pancreas', 'Tumor hati ', '2', 16, 4),
(377, 'Seorang anak umur 2 tahun diantar ibunya dengan keluhan berat 6 kg. Riwayat menyusu ASI selama 3 bulan. Anak bermuka tua, baggy pants, rambut merah gampang dicabut. Diagnosa:', 'Marasmus', 'Marasmus kwarshiorkor', 'Kwarshiorkor', 'Defisiensi vitamin', 'Kurang gizi', '1', 16, 5),
(378, 'Anak umur 5 tahun dengan riwayat vaksin tidak lengkap. Saat ini datang dengan keluhan bintik merah pada belakang telinga, leher, dan tubuh. Vaksin yang mungkin belum diberikan:', 'BCG', 'DPT', 'Hep B', 'Campak', 'MMR', '5', 16, 6),
(379, 'Anak 5 th dibawa ke tempat praktek dengan Keluhan gigi berwarna kecoklatan sejak umur 3 tahun sering diberikan obat antibiotic dari PKM. apa penyebab gigi kecoklatan tersebut?', 'Amoksilin', 'Tetrasiklin', 'Gentamisin', 'Pensilin', 'Sefalosporin', '2', 16, 7),
(380, 'Perempuan, 16 thn, diantar ibunya karena Berat badan menurun drastic dari 65 kg menjadi 41 kg dalan 6 bln terakhir. Pasien merasa dirinya gemuk dan masih perlu menurnkan BBnya. Pasien menyangkal adanya kebiasaan makan berlebihan dan memuntahkannya. Diagnosis pasien ini?', 'Depresi', 'Bulimia nervosa', 'Anorexia nervosa', 'Gang obsesif kompulsif', 'Penyalahgunaan zat psikoaktif', '3', 16, 8),
(381, 'Seorang perempuan diantar keluarganya ke UGD RS dengan keluhan sering keluar rumah tanpa tujuan dan berbicara terus-menerus. Pada status mental didapatkan penampilan sangat mencolok, memakai lipstick yang berwarna merah terang dengan bedak yang tebal. Kurang lebih 3 bulan yang lalu, pasien pernah ingin bunuh diri, tidak mau makan, tidak mau berbicara dan tidak mau keluar rumah.Diagnosis yang paling mungkin?', 'Gangguan skizoafektif tipe mania', 'Mania dengan gejala psikotik', 'Depresi dengan gejala psikotik', 'Gangguan bipolar episode kini depresi', 'Gangguan bipolar episode kini mania', '5', 16, 9),
(382, 'Seorang pria masuk dengan keluhan nyeri akibat ereksi terus-menerus selama 4 jam, ereksi terlihat pada penis, namun tidak pada glans penisnya. Tidak ada gairah seksual, diangnosis pada pasien ini?', 'Priapismus', 'Penyakit peyroni', 'Fimosis', 'Parafimosis', '-', '1', 16, 10),
(383, 'Pasien datang pada anda dengan keluhan nyeri ulu hati. Pasien merasa penyakit ini diakibatkan oleh karena dokter sebelumnya salah memberikan obat. Pasien sebelumnya berobat dengan keluahan nyeri sendi dan diberikan obat (lupa obatnya apa).  Dari hasil pemeriksaan laboratorium, didapatkan hasil normal dan anda hanya mendiagnosis sebagai dyspepsia. Tindakan anda pada pasien?', 'Menyalahkan diagnosis dokter sebelumnya', 'Memberitahu pasien bahwa berdasarkan pemeriksaan saat ini pasien menderita dyspepsia. ', 'Memberikan obat pasien tanpa sepengetahuan pasien', 'Memberitahu pasien bahwa nyeri ulu hati dapat merupakan efek samping dari obat nyeri sendi dan saat ini pasien menderita dyspepsia', '-', '4', 16, 11),
(384, 'Seorang anak laki-laki 8 tahun, mengeluh muncul bintil-bintil (papul) pada lipat siku dan lipat lutut, setelah pasien bermain di atas karpet. Pasien pernah mengalami hal serupa pada saat usia lima tahun. Kakak pasien juga sering mengalami bersin-bersin. Tes yang dapat dilakukan yaitu:', 'Intradermal', 'Subkutis', 'Subdermal', 'Tes tusuk ', 'Tes temple ', '4', 16, 12),
(385, 'Anak berusia 4 tahun datang ke puskesmas bersama ibunya  mengeluh gatal-gatal di sela jari tangan dan kaki, terutama saat malam hari. Dari pemeriksaan fisik didapatkan “kunikulus” dengan papula-pustula. Empat saudara yang lain mengalami hal yang serupa. Terapi yang sesuai:', 'Krim hidrokortison', 'Krim deksametason', 'Krim asam fusidat', 'Krim asam fusidat', 'Krim gameksan', '4', 16, 13),
(386, 'Seorang wanita 28 tahun datang dengan keluhan luka-luka pada kemaluan sejak 1 minggu. Pada pemeriksaan didapatkan luka dengan dasar bersih, tepi tidak menggaung, di sekitar luka tidak didapatkan adanya tanda-tanda inflamasi. Penyebab luka tersebut kemungkinan berasal dari :', 'treponema pallidum ', 'Neisseria Gonorrhoea', 'Trichomonas Vaginalis', 'Chlamydia Trachomatis ', 'Gardnerella Vaginalis', '1', 16, 14),
(387, 'Anak laki-laki datang ke puskesmas dengan keluhan demam 3 hari. Kemudian muncul ruam makulo papula superfisial konfluen mulai dari wajah kemudian ke badan. Sebelumnya belum pernah imunisasi. Hasil laboratorium : DL, Hb dbn, leukosit, trombosit, hematokrit dbn. Hitung jenis Eos/Bas/Stab/Seg/Lim/Mono = 2/0/4/40/50/2. Apakah diagnosisnya..', 'Morbili', 'Varicella', 'Roseola infantum', 'Staphylococcus ', 'Streptococcus', '1', 16, 15),
(388, 'Seorang wanita 35 tahun datang ke rumah sakit dengan keluhan berdebar-debar sejak 2 bulan yang lalu, disertai dengan gemetar dan berkeringat. Pemeriksaan apa yg sesuai dengan gejala tersebut?', 'FT4, TSH', ' FT3, FT4', 'FT3, FT4 dan TSH', 'FT4 dan sidik tiroid', 'FT4 dan USG tiroid', '3', 16, 16),
(389, 'Seorang anak laki-laki usia 5 tahun dibawa orang tuanya ke UGD karena mengalami patah tulang lengan kiri atas. Menurut orang tua pasien, anaknya terjatuh dari sepeda, sedangkan pasien tidak memberitahukan tentang penyebab cedera dan hanya menangis, dari pemeriksaan fisik ditemukan tanda kekerasan. Apa kaidah dasara moral yang diutamakan dalam menangani kasus ini?', 'Honesty', 'Autonomy', 'Justice', 'Beneficence', 'Non maleficence', '3', 16, 17),
(390, 'Beberapa jam setelah berlangsunya perpisahan SMP yang dihadiri 150 orang, 125 orang berobat ke puskemas karena diare, muntah, dari anamnesis didapatkan 100 orang makan pecal, 25 orang tidak makan. Hasil laboratorium menunjukan adanya E. coli, penelitian yang cocok untuk menilai hubungan antara pajanan dan penyakit tersebut adalah?', 'Cross sectional', 'Cohort', 'Deskriptif', 'Case report', 'Case control ', '5', 16, 18),
(391, 'Seorang ibu datang membawa anaknya korban pemerkosaan meminta untuk di lakukan visum et repertum. Tanpa ada pengantar dari polisi. Apa yang seharusnya dilakukan oleh dokter?', 'Meminta keluarga ke kantor polisi terlebih dahulu', 'Melakukan pemeriksaan, dan kemudian menelpon hasilnya pada polisi', 'Melakukan pemeriksaan, mamberikan salinan rekam medis', 'Membuat informed consent kemudian periksa', 'Melakukan pemeriksaan dan tidak memberitahu hasilnya kepada pasien', '1', 16, 19),
(392, 'Pria usia 17 tahun datang untuk memeriksaan mata ke puskesmas dengan keluhan kedua mata merah sejak 3 hari yang lalu. Saat bangun pagi pasien sulit membuka matanya karena banyak kotoran mata. Mata tidak nyeri, tidak kabur, namun terasa silau. Tidak ada riwayat trauma. Disekolah banyak temannya yang menderita sakit yang sama. Diagnosis yang mungkin adalah?', 'Iridosiklitis', 'Konjungtivitis', 'Uveitis', 'Keratitis', 'Iritis', '2', 16, 20),
(393, 'Wanita usia 26 tahun dengan G2P1A0 usia kehamilan 8 bulan,  datang untuk melakukan pemeriksaan ulang, sebelumnya sudah melakukan pemeriksaan sebanyak 2 kali dan dinyatakan dalam keadaan normal. Dari hasil pemeriksaan menunjukan TD 130/90 mmHg, TFU 28 cm, DJJ 150 kali/menit, Leopold letak melintang, protein urine (+) dan terdapat edema ringan pada tungkai bawah. Apakah diagnosis untuk pasien ini?', 'Ekalmpsia', 'Pre eklampsia ringan', 'Pre eklampsia berat', 'Hipertensi gestasional', 'Super imposed eklampsia', '2', 17, 1),
(394, 'Wanita usia 25 tahun datang dengan keluhan keluar darah dari kemaluan dengan warna merah segar, tidak ada nyeri, HPHT 6 minggu,  pemeriksaan VT didapatkan bercak darah di OUE, tidak ada jaringan, uterus menutup. Diagnosis yang mungkin adalah?', 'Abortus iminens', 'Abortus insipient', 'Abortus inkomplit', 'Kehamilan ektopik', 'Missed abortion', '1', 17, 2),
(395, 'wanita usia 25 tahun datang ke klinik dengan keluhan lemas, mual di pagi hari dan mata berkunang-kunang. Dari anamnesis diketahui bahwa 2 bulan sudah tidak mengalami haid, hasil tes kehamilan (+). Pada pemeriksaan fisik tampak konjungtiva anemis, TD : 90/60 mmHg, nadi 58 kali/menit, respirasi 14 kali/menit, setelah dilakukan pemeriksaan laboratorium diperoleh Hb 8,5 gr/dL dan apusan darah tepi hipokrom mikrositer. Terapi apa yang paling tepat?', 'Tiamin', 'Piridoksin', 'Asam folat', 'Tablet Fe', 'Cyanokobalamin', '4', 17, 3),
(396, 'Wanita usia 24 tahun datang ke puskesmas dengan keluhan keluar darah dari kemaluan. Dari anamnesa didapatkan haid terakhir 3 bulan yang alalu dan haid sebelumnya teratur. Pada pemeriksaan fisik didapatkan TD : 120/80 mmHg, nadi 85 kali/menit, respirasi 18 kali/menit, dan statu obstetric didaptkan TFU ½ pusat simfisis, balotement (-), DJJ (-) dan pada pemeriksaan VT teraba jaringan. Apa diagnosis pada psien ini?', 'Mola hidatidosa', 'Abortus inkomplit', 'Abortus iminens', 'Abortus insipiens', 'KET', '1', 17, 4),
(397, 'Wanita usia 28 tahun dengan G4P3A0 usia kehamilan 32 minggu datang ke UGD karena merasa ingin melahirkan. Dari hasil pemeriksaan didapatkan TD: 140/90 mmHg, denyut nadi 120 kali/menit. Diputuskan untuk segera melahirkan janin dari pasien. Tindakan apa yang dapat dilakukan untuk proses pematangan paru janin?', 'Steroid', 'Salbutamol', 'Misoprostol', 'Prednisone', 'Deksametason iv', '5', 17, 5),
(398, 'Wanita usia 27 tahun dengan P3A0 datang ke IGD karena mengalami perdarahan setelah melahirkan di puskesmas 1 hari yang lalu. Berat bayi diketahui 4100 gr, pada pemeriksaan vital sign didapatkan TD 90/70 mmHg, nadi 70 kali/menit. Respirasi 28 kali/menit. Penanganan awal yang tepat untuk pasien ini?', 'Kompresi bimanual', 'Transfuse darah', 'Resusitasi cairan', 'MgSO4', 'Cek darah rutin', '3', 17, 6),
(399, 'Wanita usia 35 tahun datang bersama suaminya ke IGD dengan keluhan sesak napas. Keluhan ini dirasakan setelah mengalami kecelakaan sebelumnya. Dari pemeriksaan fisik didapatkann TD 90/70 mmHg, nadi 65 kali/menit, akral dingin, tampak jejas di daerah sternum, vena jugularis distensi, suara napas vesikuler kedua paru, kemudian diberi cairan 2 liter tetapi tidak ada respon bermakna terhadap tekanan darah. Apa diagnosis pasien tersebut?', 'Penumotoraks', 'Hematothorax', 'Rupture aorta', 'Cardiac tamponade', 'Fraktur sternum', '4', 17, 7),
(400, 'Pria usia 30 tahun dibawa oleh keluarganya ke IGD karena mengalami kecelakaan. Pasien mengeluh nyeri dada, batuk, sulit bernapas. Dari pemeriksaan fisik ditemukan hematom pada dinding dada sebelah kiri, hasil foto rontgen diperoleh gambaran lusen di lateral tanpa corakan paru, hemitoraks dan disertai pendesakan mediastinum kontralateral. Diagnosis pada pasien ini adalah?', 'Hidropneumotoraks', 'Hematotoraks', 'Pneumotoraks', 'Pneumomediastinum ', 'Hernia diafragmatika', '3', 17, 8),
(401, 'Wanita usia 50 tahun datang ke puskesmas dengan keluhan nyeri pada bagian ujung ibu jari dan telunjuk tangan kanan terutama pada pagi hari, disertai kaku dan pembengkakan pada jari-jari tangan kanan I,II,III yang dapat hilang sendiri apabila sudah digerak-gerakan kurang lebih 10 menit. Selama 20 tahun pasien memiliki riwayat diabetes, pasien juga mengeluh nyeri tenggorokan. Hasil pemeriksaan fisik didapatkan TD: 120/80 mmHg, nadi: 80 kali/menit, bengkak, kemerahan dan nyeri pada jari telunjuk dan ibu jari tangan kanan. Pada laboratorium Hb: 12 g/dL LED: 20 mm/jam HMT: 40% asam urat: 5,0 mg/dL factor rheumatoid serum (+), GDS: 230 mg/dL. Diagnosis yang paling mungkin terhadap pasien ini adalah', 'Arthritis pirai', 'Arthritis reumathoid', 'Osteoarthritis', 'Miositis', 'Osteomalasia', '2', 17, 9),
(402, 'Seorang anak berusia 4 tahun datang ke puskemas dengan keluhan mengalami bengkak sejak 5 hari yang lalu. Bengkak terjadi di wajah dan mata, mulai pagi hari dan menghilang di sore hari. Hasil pemeriksaan menunjukan preteinuria (+4), ureum 20, kreatinin 0,6. Kemungkinan diagnosisnya adalah..', 'Sindrom nefrotik', 'Infeksi saluran kemih', 'Gagal ginjal kronik', 'Glomerulonefritis akut', 'Gagal ginjal akut', '1', 17, 10),
(403, 'Pasien 18 tahun datang dengan keluhan lemah seluruh badan sejak 2 minggu yang lalu. Keluhan disertai demam yang tidak terlalu tinggi, tampak pucat, mata tampak kuning, mual, kadang-kadang muntah berisi cairan kekuningan sisa makanan. Pada pemeriksaan fisik didapatkan TD 90/60mmHg, nadi 82x/menit, RR 28x/menit, suhu 37,8oC, konjungtiva palpebra anemis, sklera ikterik, splenomegali. Pada pemeriksaan penunjang didapatkan Hb 6 g/dl, leukosit 8.400/mm3, trombosit 300.000/mm3, anisositosis polikromasi. Apakah diagnosis dari pasien ini?', 'Anemia hemolitik', 'Anemia aplastik', 'Talasemia ', 'Anemia defisiensi besi stadium awal', 'Anemia pasca perdarahan massif', '1', 17, 11),
(404, 'Seorang perempuan berusia 60 tahun datang ke puskesmas dengan keluhan badan lemas, nafas pendek dan bengkak pada kedua pergelangan kaki. Pada pemeriksaan fisik diperoleh tekanan darah 100/60, denyut nadi 90 x/menit, frekuensi nafas 28 x/menit. Pada pemeriksaan laboratorium didapatkan Hb 4,0 g/dL, dan didapatkan sediaan darah makrositik. Apakah diagnosis yang paling mungkin?', 'Anemia hemolitik autoimun', 'Anemia defisiensi besi', 'Hipotiroiditis', 'ITP', 'Anemia pernisiosa', '5', 17, 12),
(405, 'Seorang laki-laki berumur 42 tahun datang ke praktek dokter untuk memeriksakan rutin tekanan darahnya. Pemeriksaan tekanan darah 150/90 pada dua kali pengukuran. Pasien sudah menderita  diabetes mellitus (DM) selama 2 tahun namun tidak minum obat teratur. Pasien memiliki riwayat merokok 1 bungkus per hari. Obat anti hipertensi apa yang diberikan pada pasien ini?', 'Captopril', 'Furosemid', 'Metyldopa', 'Nifedipin', 'Propanolol', '1', 17, 13),
(406, 'Seorang wanita 32 tahun, datang dengan keluhan sering merasa lemas dan kram otot. Ada riwayat operasi tiroidektomi karsinoma papiler 2 minggu yang lalu dan diberikan sulih terapi untuk mencegah hipotiroid. Pada pemeriksaan fisik didapatkan “facial switch” atau kerutan dahi dan pada EKG terdapat elevasi segmen T. Kelainannya adalah?', 'hiperkalemia', 'hiperkalsemia', 'hipermagnesemia', 'hipokalemia', 'hipokalsemia', '1', 17, 14),
(407, 'Seorang pasien anak laki-laki usia 8 tahun datang bersama ibunya ke puskesmas dengan keluhan demam selama 4 hari, kemudian mengeluarkan darah dari hidung, pada pemeriksaan fisik didapatkan: Tensi: 60 mmHg (palpasi), Nadi: 150x/mnt, akral dingin, Trombosit: 25.000/mm3 Penyakit yang diderita pasien ini termasuk derajat:', 'Demam Dengue', 'I', 'II', 'III', 'IV', '4', 17, 15),
(408, 'Seorang pria usia 40 tahun, datang ke UGD dalam keadaan tidak sadar. Setelah pemeriksaan, pasien harus mendapat tindakan operasi segera. Dokter langsung mengoperasikan tanpa meminta persetujuan keluarga. Tindakan bioetik dokter:', 'Benefience', ' Non-benefience	', 'Non-malefience', 'Autonomy', 'Justify', '3', 17, 16),
(409, 'Pasien laki-laki 24 tahun datang ke UGD RS karena bercak dan ruam merah pada seluruh tubuh. Bercak disertai mata merah dan bibir lecet. Tiga hari yang lalu pasien demam, dan 1 minggu sebelumnya pasien batuk dan membeli obat tablet dan kaplet putih sendiri yang dijual bebas. Pada pemeriksaan didapatkan Tax: 38,5⁰C, TTV dbN, konjungtiva merah dan secret (+), macula dan papula eritema serta purpura di seluruh tubuh. Pada bibir didapatkan erosi dan krusta sanguilenta. Diagnosis pasien ini:', 'Eritema multiforme ', 'TEN', 'Steven Johnson syndrome ', 'Angioedema ', 'Urtikaria ', '4', 17, 17),
(410, 'Seorang laki-laki berusia 16 tahun, datang ke puskesmas dengan keluhan demam tinggi sejak 4 hari yang lalu. Keluhan disertai dengan sakit kepala, pegal-pegal, dan muntah. Pada pemeriksaan laboratorium darah ditemukan Hb 17 g/dl, Ht 52%, leukosit 2.400/mm3. Pada pemeriksaan laboratorium urin ditemukan protein albumin A (+) dan sedimen leukosit 3-4/LPB.\nApakah diagnosa yang tepat dari kasus di atas?', 'Demam dengue', 'Demam tyfoid', 'Malaria', 'Morbili', 'Infeksi saluran kemih', '5', 17, 18),
(411, 'Seorang laki-laki 50 tahun secara tiba-tiba saat tersenyum bibir mencong ke kiri, kerutan dahi sebelah kanan tidak ada, kelopak mata kanan tidak dapat menutup sempurna (lagoftalmus) deskripsi kelainan tersebut yaitu :', 'Paresis n trigeminus dextra perifer', 'Paresis n. trigeminus sinistra perifer', 'Paresisi n Fascialis dextra perifer', 'Paresis n. Fascialis sinistra perifer', 'Paresis n. optikus ', '3', 17, 19),
(412, 'Pria usia 38 tahun datang bersama keluarganya ke klinik dikeluhakn oleh keluarganya tangan bergetar sejak 5 hari yang lalu, keluarga bercerita pasien memiliki gangguan jiwa dan mengkonsumsi obat untk jangka panjang. Terapi untuk menurunkan gejala tersebut adalah?', 'Trihexyphenidile', 'Amfetamin', 'Haloperidol', 'Propanolol', 'Diazepam', '1', 17, 20),
(413, 'Pria usia 25 tahun masuk ke IGD diantar oleh keluarganya dengan alas an suka mengamuk tanpa sebab dan suka mengurung diri. Dari allo anamnesis diketahui pasien sulit tidur sejak 2 bulan yang lalu, selalu merasa ada yang mengejarnya dan mendengar bisikan suara yang hendak membunuhnya. Diagonosa dari pasien ini adalah?', 'Skizoafektif', 'Psikotik akut', 'Depresi ', 'Skizofrenia', 'Gangguan waham', '4', 18, 1),
(414, 'wanita usia 30 tahun datang ke puskesmas dengan keluhan benjolan pada kelopak mata sejak 4 hari yang lalu disertai nyeri. Dari hasil pemeriksaan fisik, tampak benjolan sebesar biji jagung. Warna kemerahan mengkilat dan ada nyeri tekan. Diagnosisnya adalah?', 'Abses palpebra', 'Hordeolum', 'Kalazion', 'Moluskum kontagiosum', 'Dakroadenitis ', '2', 18, 2),
(415, 'Pria 23 tahun datang ke klinik dengan keluhan penglihatan kabur. Ia mengaku sering mengerjakan laporan hingga larut malam dan mengeluh tegang dibagian leher. Selama ini tidak ada riwayat hipertensi, tidak sering kencing, tidak sering minum. Hasil pemeriksaan visusnya 6/10. Diagnose untuk pasien ini adalah?', 'Astigmatisme', 'Astenopia', 'Hipermetropia', 'Myopia', 'Neuropati optic ', '2', 18, 3),
(416, 'Pria usia 23 tahun datang ke IGD dengan keluhan lemah pada kedua kaki dan lengan yang dimulai dari kedua kaki kemudian berlanjut ke kedua lengan. Dari pemeriksaan fisik tanda – tanda vital dalam batas normal dan pemeriksan neurologis ditemukan hasil bahwa kekuatan otot 22/00, reflex fisiologis menurun, sensoris hipestesia. Apa komplikasi yang terjadi?', 'Vaskulitis', 'Ascending paralysis', 'Descending paralysis', 'Entrapment', 'Herniasi cerebri', '2', 18, 4),
(417, 'Wanita usia 54 tahun datang dengan keluhan penglihatan ganda. Dari anamnesa didapatkan riwayat Diabetes mellitus dan hipertensi sejak 5 tahun terakhir. Dari pemeriksaan visus kedua mata didapatkan 5/5. Kedudukan bola mata esotropia. Pergerakan bola mata kanan kesegala arah, mata kiri tidak dapat bergerak kearah temporal. Hasil pemeriksaan lain dalam batas normal. Lesi pada bagian apa yang terjadi?', 'N. III', 'N. IV', 'N. VI', 'N. VII', 'N.V   ', '3', 18, 5),
(418, 'Seorang wanita usia 24 tahun G2P1A0 diantar suaminya ke RS karena mulas – mulas, keluar cairan dari jalan lahir pasien mengaku umur kehamilan 34 minggu. Ini merupakan kehamilan kedua pasien. Anak pertama lahir spontan. Pada pemeriksaan VT didapatkan Pembukaan 9 cm, presentasi kepala. Apa kesimpulan keadaan pasien diatas', 'G2P1A0  + 34 minggu kala 1 fase laten + LK', 'G2P1A0  + 34 minggu kala 1 fase aktif + LK', 'G2P1A0 + 34 minggu kala II fase aktif + LK', 'G2P1A0 + 34 minggu kala III fase aktif + LK', 'G2P1A0 + 34 minggu kala uri + LK', '3', 18, 6),
(419, 'Seorang laki-laki berusia 55 tahun datang dengan keluhan nyeri pada sendi khususnya pada pangkal ibu jari kaki kanan. Keluhan sudah dirasakan selama 5 hari, Pemeriksaan fisik TD 140/90 mmHg, nadi : 80 kali/menit didapatkan pangkal ibu jari kaki nyeri bila digerakan, merah, bengkak. Pemeriksaan lab asam urat 7,6 mg/dl factor rheumatoid serum (-). Apa diagnose pada pasien tersebut?', 'Arthritis rheumatoid', 'Osteoarthritis', 'Arthritis gout', 'Atritis infeksi', 'Lupus eritematosus sistemik', '3', 18, 7),
(420, 'Pasien laki-laki 40 tahun berbadan gemuk, datang ke praktek dengan keluhan nyeri dada saat mendorong mobil 1 jam sebelumnya. Nyeri dada dirasa selama 30 menit. Pasien memiliki riwayat DM sejak usia 32 tahun, namun tidak rutin minum obat. Pada pemeriksaan fisik didapatkan kesadaran compos mentis, TD 170/90, Nadi 96 x/menit respirasi 30 kali/menit. GDS 360 gr/dL. Apakah diagnosis yang paling mungkin pada pasien tersebut?', 'Miokarditis', 'Pleuritis', 'Infark miokard akut', 'Keganasan paru kiri', 'Pneumotoraks', '3', 18, 8),
(421, 'Seorang pria 75 tahun datang ke IGD RS dengan keluhan tungkai kiri bengkak sejak 3 hari yang lalu. Sehari-hari pasien sering menghabiskan waktunya dengan berbaring, makan sedikit-sedikit, atrofi otot tungkai (+). Riwayat Hipertensi (+). Hepar teraba 3 jari bawah arcus costae. JVP meningkat. Diagnosis yang paling mungkin pada kasus tersebut adalah?', 'Gagal ginjal', 'Gagal hati', 'Gagal jantung', 'Imobilisasi umum', 'Malnutrisi ', '3', 18, 9),
(422, 'Pria 55 tahun datang ke rumah sakit mengeluh sering mengalami sesak nafas. Sesak nafas dirasa bertambah saat menaiki tangga. Riwayat hipertensi sejak 10 tahun lalu. TD 150/100, Nadi 80 x/menit, RR 24 x/menit, Suhu afebris. Pemeriksaan fisik didapatkan rhonki di basal kedua paru.', 'Gagal jantung kanan ', 'Gagal jantung kiri', 'Hepatitis', 'Efusi pleura', 'Pneumotoraks ', '2', 18, 10),
(423, 'Seorang laki-laki berusia 34 tahun, datang ke poliklinik rumah sakit dengan keluhan badan lemah dan lemas sejak 1 minggu yang lalu. Keluhan disertai dengan buang air kecil sedikit hanya 2 gelas per hari. Pada pemeriksaan fisik didapatkan berat badan 60 kg, TD 135/80 mmHg, RR 18x/menit, HR 80x/menit. Pada pemeriksaan laboratorium darah didapatkan Hb 12,4 g/dl, ureum 51,8 mg/dl, creatinin 2,6 g/dl. Pemeriksaan laboratorium urin ditemukan protein urin (++), eritrosit 50-100/LP. Apakah diagnosa yang paling tepat?', 'Sindrom nefrotik', 'Sindrom nefritik akut', 'Rapidly Progressive Glomerulonephritis', 'Chronic renal failure', 'Stadium failure of acute kidney injury', '5', 18, 11),
(424, 'Seorang laki-laki 22 tahun datang dengan keluhan sesak nafas tiba-tiba. Pasien telah menderita batuk yang lama dan dalam pengobatan TB. Pada pemeriksaan paru  didapatkan. Inspeksi: asimetris, dada kanan cembung. Palpasi: dada kanan tertinggal. Perkusi: hipersonor di paru kanan. Auskultasi: suara vesikuler paru kanan menghilang. Apakah komplikasi yang terdapat pada kasus ini?', 'Efusi pleura', 'Pneumonia', 'Pneumotoraks', 'Empiema', 'SOPT', '3', 18, 12),
(425, 'Pasien perempuan usia 65 tahun datang ke UGD RS dengan keluhan nyeri dada kiri yang menjalar ke punggung yang dirasakan sejak 5 jam yang lalu disertai mual, nyeri tidak menghilang dengan istirahat, pada pemeriksaan didapatkan CK-MB:50, Troponin I : 3,1. Pada EKG didapatkan ST Depresi pada lead II, III, AVF. Apakah diagnose yang paling mungkin ?', 'STEMI Anteroseptal', 'STEMI Inferior', 'NSTEMI Inferior', 'STEMI Anterior', 'NSTEMI Anterior', '3', 18, 13),
(426, 'Seorang perempuan usia 17 tahun datang ke poli umum dengan keluhan demam. Ia merasa jantungnya sering berdebar-debar. Sebulan sebelumnya ia terkena infeksi tenggorokan. Pemeriksaan fisik tanda-tanda vital tensi 120/80 mmHg, nadi 100 x/menit, pernapasan 16 x/menit, suhu 38 C. Pemeriksaan fisik jantung 3 jari midclavicula dextra, Aukultasi terdengar suara Gallop. Apa Bakteri yang paling memungkinkan untuk kasus tersebut?', 'Streptokokus Hemoliticus', 'Streptokokus Viridans', 'Staphylokokus Aureus', 'Pseudomonas Aeruginosa', 'Haemophilus Influenza', '1', 18, 14),
(427, 'Wanita usia 25 tahun P3A0 datang dengan perdarahan sehabis melahirkan anak ke-7 di dukun. Dari anamnesa didapatkan Berat anak 4000 gr,  Plasenta  lahir spontan. Pada pemeriksaan fisik didapatkan TD 100/70 mmHg, nadi: 70 kali/ menit, respirasi 16 kali/menit. Uterus teraba 2 jari dibawah pusat. Kontraksi uterus baik. Inspekulo didapatkan darah mengalir dari vagina. Penyebab perdarahan adalah  : ', 'Rest plasenta', 'Atonia uteri ', 'Rupture uteri', 'Robekan pada vagina', 'Rest sisa plasenta', '3', 18, 15),
(428, 'Wanita, usia 23 tahun datang kerumah sakit untuk melakukan general check up karena ingin melanjutkan pendidikan keluar negri. Rencana dilakukan pemeriksaan foto thorax dengan posisi sinar dari arah belakang dan kaset/film berada didepan dada pasien. Bagaimana posisi foto thorax diatas ? ', 'AP (antero posterior) ', 'PA (postero anterior)', 'Lateral', 'Top Lordotic ', 'Lateral dekubitus ', '2', 18, 16),
(429, 'Laki-laki 50 tahun datang ke UGD dengan keluhan kepala terasa pusing dan penglihatan buram 1 jam yang lalu. Keluhan disertai dengan jantung berdebar-debar dan terasa nyeri. Pada pemeriksaan didapatkan nadi : 120x/menit, respirasi : 18x/menit, TD : 100/60mmHg. Setelah pasien di EKG didapatkan gambaran \n\nInterpretasi EKG tersebut adalah ;', 'Atrial fibrilasi', 'Atrial fluter', 'Ventrikel ekstrasistol', 'Supraventrikular takikardi', 'Bundle Branch Block', '4', 18, 17),
(430, 'Seorang perempuan, 50 tahun, datang dengan keluhan nyeri dada sejak 1 jam yang lalu. Nyeri dirasakan di dada kiri dan menjalar hingga rahang dan lengan kirinya. Nyeri tidak berkurang dengan istirahat. Pasien adalah penderita hipertensi sejak 7 tahun yang lalu, tetapi tidak rutin kontrol. Pemeriksaan fisik didapatkan TD 170/100 mmHg, nadi 100x/menit, respirasi 20 x/menit, suhu 37°C. Pemeriksaan penunjang apakah yang spesifik untuk menegakkan diagnosis?', 'HDL', 'SGOT', 'Kreatinin kinase', 'Troponin', 'LDL kolesterol', '4', 18, 18),
(431, ' Seorang laki-laki berusia 50 tahun datang ke RS dengan keluhan batuk sejak 3 bulan lalu.keluhan disertai  dahak kental berwarna kekuningan. Panas badan yang tidak terlalu tinggi, keringat dimalam hari dan di ikuti penurunan berat badan. Dari hasil anamnesis pasien mengakui 3 tahun yang lalu pernah mendapat pengobatan TB  dan dinyatakan sembuh. Hasil auskultasi terdengar basal bronchial dan rhonki basah dikedua paru. Satu tahun terakhir pasien mendapat pengobatan OAT kategori II namun diakhir pengobatan BTA (+). Apakah pengobatan yang akan diberikan ?', 'Kanamisisn', 'Eritromisisn', 'Kleptomisin', 'Ciprofloksasin', 'Streptomisin', '1', 18, 19),
(432, 'Wanita 17 tahun datang ke dokter dengan keluhan gatal dibokong +/- 1 tahun. Keluhan gatal berulang tiap bulan terutama setelah menstruasi. Pasien sudah berobat ke puskesmas & sudah membaik kemudian timbul lagi. Pasien gemar memakai celana pendek. Pada pemeriksaan dermatologis didapatkan plakat dengan makula hiperpigmentasi, tepi papul-papul eritema, hiperpigmentasi, erosi, ekskoriasi dan skuama kasar. Pemeriksaan penunjang yang dilakukan?', 'Pemeriksaan KOH 20%', 'Pemeriksaan gram', 'Prick test', 'Pemeriksaan histopatologis', 'Pemeriksaan lampu wood', '1', 18, 20),
(433, 'Seorang laki-laki berusia 36 tahun datang ke puskesmas dengan keluhan mata kanan merah dengan penurunan ketajaman penglihatan sejak 8 hari yang lalu. Awalnya pasien merasa matanya seperti tertusuk daun kemudian mata dicuci dengan air sirih, tetapi keluhan menjadi lebih buruk. Dari pemeriksaan oftalmologis, didapatkan tajam penglihatan mata kanan 3/60. Bilik mata depan terlihat massa berwarna putih kekuningan, dengan ukuran 2 mm dengan permukaan tidak rata. Apakah istilah yang paling tepat untuk keadaan pada bilik mata depan?', 'Hifema', 'Eksudat', 'Hipopion\\Koagulum', 'Keratik presipitat', 'Glukoma', '3', 27, 4),
(434, 'Ditemukan jenazah dengan keadaan terlentang, Pada pemeriksaan didapatkan hal-hal berikut : lebam mayat pada wajah, dada dan perut. Sebagian tidak hilang dengan penekanan serta punggung yang hilang bila ditekan. Kaku mayat pada lengan mudah dilawan dan lengkap. Kaku mayat pada tungkai sukar dilawan dan lengkap. Tidak tampak tanda pembusukan. Kapankah saat kematian yang paling mungkin?', '1-4 jam', '4-12 jam', '12-24 jam', '24-36 jam', '> 36 jam', '2', 27, 8),
(435, 'Wanita hamil 34 minggu datang dengan keluhan mules seperti akan melahirkan. Ini adalah kehamilan anak kedua, keluar air-air, his 4 kali 40 detik dalam 10 menit. Pembukaan 9 cm, serviks mendatar dan bayi letak kepala. Diagnosis ?', 'G2P1A0 hamil 34 minggu kala I laten presentasi kepala', 'G2P1A0 hamil 34 minggu kala I aktif presentasi kepala', 'G2P1A0 hamil 34 minggu kala II presentasi kepala', 'G2P1A0 hamil 34 minggu kala III presentasi kepala', 'G2P1A0 hamil 34 minggu', '2', 8, 1),
(436, 'Laki-laki 25 tahun datang dengan keluhan demam  sejak 1 minggu SMRS. Sekitar 2 bulan  yang  lalu pasien sempat didiagnosis menderita demam  typhoid. Saat ini dari hasil pemeriksaan Tes Widal didapatkan hasil titer O negative, titer H negative, dan titer Vi 1/160. Kesimpulan hasil pemeriksaan tersebut ialah? ', 'Pasien telah mendapatkan kekebalan ', 'Pasien dalam kondisi sehat ', 'Pasien sebagai karier ', 'Pasien sedang menderita demam typhoid ', 'Pasien terinfeksi ulang salmonella', '5', 31, 1),
(437, 'Bayi berusia 3 bulan datang ke puskesmas dengan tujuan ingin imunisasi BCG. Berat badan bayi sekarang adalah 4 kg. Pada pemeriksaan fisik tidak ditemukan kelainan.\nTindakan yang anda sarankan kepada orang tua adalah?\n', 'Berikan BCG', 'Tidak diberikan karena sudah terlewat masa imunisasi BCG', 'Dilakukan pemeriksaan tuberculin terlebih dahulu', 'Rontgen dahulu', 'Berikan BCG dengan dosis lebih', '3', 31, 2),
(438, 'Laki-laki 26 tahun didiagnosis menderita DBD, sebelum rawat inap pasien mengeluh badan  lemah, demam, dan mual muntah. Tensi 100/70 mmHg, nadi 100 kali/menit, RR 24 kali/menit, dan suhu 39,1ºC. Hasil laboratorium darah didapatkan leukosit 2300, Hb 18, Hct 51, dan trombosit 90000. Setelah dirawat selama 3 hari, pasien sudah tidak ada keluhan dengan hasil lab terbaru adalah leukosit 2300, Hb 13, Hct 39, dan trombosit 85000. Penatalaksanaan pasien selanjutnya yaitu …. ', 'Pemberian trombosit konsentrat hingga kadarnya normal ', 'Perawatan suportif hingga hasil lab mencapai batas normal ', 'Dipulangkan setelah pemberian 9 flas trombosit konsentrat ', 'Dipulangkan dengan edukasi makan dan minum yang cukup ', 'Pemberian tronbosit konsentrat dan makan minum yang cukup', '4', 31, 3),
(439, 'Pria 45 tahun datang ke polikinik dengan keluhan sakit ibu jari kaki kanan sejak 2 hari yang lalu. Pemeriksaan fisik menemukan MTP 1 merah,, bengkak, dan nyeri tekan. Dari pemeriksaan laboratorium nilai asam urat adalah 11.\nTerapi yang tepat adalah...\n', 'Allopurinol', 'Na diklofenak', 'Allopurinol dan Na diklofenak', 'Kortikosteroid', 'Kolsikin dan Na diklofenak', '5', 31, 4),
(440, 'Seorang perempuan 70 tahun datang dengan keluhan setelah jatuh dengan posisi menumpu tubuh. Saat ini pasien mengeluhkan nyeri panggul dan sulit digerakkan. Dari hasil radiologi, dokter mengatakan bahwa pasien mengalami penyakit yang disebabkan hormon yang menyebabkan mudah fraktur. Apa diagnosis pada pasien ini? ', 'Osteomalasia ', 'Osteoartritis', 'Osteoporosis ', 'Atritis gout ', 'Rheumatoid arthritis', '3', 31, 5),
(441, 'Pria 42 tahun datang ke poliklinik dengan keluhan lemas badan, mudah lapar, sering kencing, mudah haus, dan penurunan berat badan 10 kg sejak 6 bulan yang lalu. Dari pemeriksaan fisik ditemukan  berat badan 55kg, tinggi badan 170cm, dan diketahui aktivitas ringan untuk kegiatan sehari-hari. Kebutuhan kalori yang dibutuhkan pasien adalah...', '1800 kalori/hari', '1900 kalori/hari', '2000 kalori/hari', '2100 kalori/hari', '2200 kalori/hari', '5', 31, 6),
(442, 'Seorang pasien datang dengan keluhan mengalami penurunan berat badan 10 kg dalam 3 \nBulan. Pasien juga mengatakan sering haus dan kencing. Hasil pemeriksaan apa yang \nmenunjang diagnosis kasus tersebut? \n', 'Gula darah puasa ≥ 126 ', 'Gula darah sewaktu ≥ 140 ', 'Gula darah 2 jam post prandial ≥ 126 ', 'Gula darah sewaktu ≥ 126 ', 'Tes toleransi glukosa oral >126', '1', 31, 7),
(443, 'Anak berusia  8 tahun datang ke IGD dengan demam 3 hari yang tidak turun. Pada pemeriksaan tekanan darah 90/70 mmHg, nadi sulit teraba, pernafasan  30 kali/menit,  suhu 38,5ᴼC, dan ptechie positif. Pemeriksaan penunjang yang harus dilakukan untuk menunjang diagnosis adalah?', 'Hb leuko trombo ht', 'Rumple ledee', 'Widal', 'Tubex', 'Ns1', '1', 31, 8),
(444, 'Seorang pasien berusia 20 tahun dating ke IGD dengan keluhan mata kuning dan kulit ikterik disertai nyeri di perut kanan atas dan demam. Didapatkan hasil pemeriksaan laboratorium HBsAg positif, IgM anti HAV positif, IgM anti HBc negatif, dan IgG anti HBc negatif. Apakah kesimpulan dari hasil pemeriksaan laboratorium tersebut? ', 'Hep A akut, Hep B akut ', 'Hep A kronik, Hep B kronik', 'Hep A kronik, Hep B akut ', 'Hep C akut, Hep B pembawa', 'Hep A akut, Hep C kronik', '5', 31, 9),
(445, 'Pasien datang ke klinik dengan keluhan terdapat benjolan pada leher. Benjolan tidak dirasakan sakit, serta tidak ada keluhan penyerta lainnya. Bagaimana pemeriksaan pertama yang harus dilakukan pada benjolan tersebut?', 'Palpasi dan inspeksi sambil tidur', 'Palpasi dan inspeksi sambil miringkan kepala', 'Palpasi dan inspeksi sambil menelan dari arah depan', 'Inspeksi dan palpasi dari belakang kepala sambil meminta pasien menelan ludah', 'Lakukan needle biopsi', '3', 31, 10),
(446, 'Seorang perempuan 23 tahun mengeluhkan nyeri kepala sejak 1 bulan yang lalu. Semakin lama semakin memberat. Tidak hilang dengan obat penghilang nyeri. Tidak terdapat kelainan neurologi. Pada CT-scan didapatkan lesi hiperdens di regio temporal. Diagnosis apakah yang paling tepat untuk pasien tersebut? ', 'Tension headache ', 'Cluster headache', 'Intracranial tumor ', 'Vertigo ', 'Migrain ', '3', 32, 1),
(447, 'Wanita 21 tahun datang dengan keluhan lemas sejak 1 minggu yang lalu. Keluhan disertai dengan mual, pusing, dan kadang-kadang gemetar. Beberapa hari buang air kecil berwarna merah segar. Dari pemeriksaan fisik konjungtiva anemis (+/+), sklera ikterik (+/+), dan lien sebesar S1. Pemeriksaan laboratorium menunjukkan Hb 8 gr/dl. Kemungkinan penyebab anemia adalah ', 'Anemia hemolitik ', 'Anemia aplastik ', 'Anemia defisiensi besi ', 'Anemia karena penyakit kronis ', 'Anemia defisiensi asam folat', '1', 31, 11),
(448, 'Pasien datang dengan keluhan gatal-gatal pada tangan. Pasien bekerja sebagai pengawas pembuatan jalan dan sering menggunakan sabun TCC. Pemeriksaan didapatkan  papul makula eritema pada telapak tangan dan ekstensor lengan bawah\nDiagnosis kasus tersebut adalah...\n', 'Dermatitis kontak alergi', 'Dermatitis kontak iritan', 'Liken planus', 'Ptiriasis rosea', 'Psoriasis vulgari', '2', 31, 12),
(449, 'Seorang wanita 65 tahun datang dengan penurunan kesadaran. Pasien rutin mengkonsumsi obat DM. Keadaan pasien mengantuk, badan gemetar, dan banyak keluar keringat dingin. Tanda-tanda vital dalam batas normal dengan tekanan darah 130/90 mmHg. Penanganan pertama yang dilakukan adalah? ', 'Pemberian oksigen ', 'Infus NaCl 3% ', 'Injeksi Diazepam iv ', 'Injeksi glukosa iv ', 'Pemberian vitamin B complex per oral', '4', 31, 13);
INSERT INTO `bf_soal` (`id`, `question_name`, `answer1`, `answer2`, `answer3`, `answer4`, `answer5`, `answer`, `ujian_id`, `urutan`) VALUES
(450, 'Pasien dengan keluhan penglihatan ganda ketika melihat ke kiri. Pada pemeriksaan didapatkan gerakan mata kiri tidak bisa lihat ke arah kiri. Saraf kranialis mana yang mengalami gangguan?', 'N abdusen', 'N oculomotor', 'N troclearis', 'N opthalmikus', 'N trigeminal', '1', 31, 14),
(451, 'Pasien wanita 28 tahun P1A0 baru melahirkan 1 bulan yang lalu mau konsultasi keluarga berencana. Pasien ingin menjarakkan kehamilan dengan ber-KB dan tidak ingin menggangu pemberian asi eksklusif terhadap anaknya. Pasien memiliki riwayat kehamilan ektopik 1 tahun yang lalu. KB yang cocok diberikan kepada pasien adalah...', 'IUD', 'MOW', 'Pil kombinasi', 'Pil progestin', 'Kondom', '4', 31, 15),
(452, 'Seorang perempuan 40 tahun datang ke dokter dengan keluhan mengenai sakit kepalanya. Dia mengeluhkan nyeri di kepala yang hilang timbul, dan sudah berpindah-pindah ke dokter. Dokter terakhir mendiagnosis migrain dan sudah diberi obat penghilang sakit kepala. Pasien mengeluhkan bahwa sakit di kepalanya mengganggu pekerjaannya sebagai pengajar apalagi dalam mempersiapkan mengajar saat sakitnya kambuh. Aspek fungsional dalam formulasi diagnostik pada kasus di atas adalah...', 'Skor 1 : tidak ada gangguan dalam melakukan aktivitas sehari-hari ', 'Skor 2 : ada sedikit gangguan dalam melakukan aktivitas sehari-hari ', 'Skor 3 : ada beberapa gangguan dalam melakukan aktivitas sehari-hari ', 'Skor 4 : ada banyak gangguan dalam melakukan aktivitas sehari-hari ', 'Skor 5 : pasien tidak bisa melakukan aktivitas sehari-hari, pasien dying ', '2', 32, 2),
(453, 'Pasien 60 tahun datang untuk control ke puskesmas. Pasien menderita DM selama 15 tahun dan diberikan obat DM berupa glibenklamid, namun tidak pernah minum secara teratur. Hasil pemeriksaan GDP 178 mg/dL, G2PP 266 mg/dL, Kreatinin serum 2,2, dan Protein urin +3. Terapi yang paling tepat diberikan adalah? ', 'Sulfonilurea ', 'Biguanid ', 'Insulin ', 'Insulin dikombinasikan dengan obat anti diabetic ', 'Non mediakmentosa (diet dan latihan fisik)', '4', 31, 16),
(454, 'Pasien anak 12 tahun datang dengan penurunan pendengaran.. Riwayat sering keluar cairan dari telinga sejak 2 tahun yang lalu terutama bila batuk pilek.. Sejak 2 minggu yang lalu tidak mendengar bila dipanggil.. Pemeriksaan otoskopi didapatkan membran tympani perforasi dan sekret positif. Pemeriksaan penunjang yang dilakukan adalah...', 'Timpanometri', 'Tes bisik', 'Audiometri impedans', 'Audiometri nada murni', 'Audiometri tutur', '4', 31, 17),
(455, 'Seorang laki-laki 30 tahun datang dengan keluhan kaku seluruh tubuh  sejak 2 hari yang lalu. 2 minggu yang lalu kaki pasien tertusuk cangkul , kemudian pasien menjadi sulit membuka mulut dan leher kaku. Pemeriksaan fisik tekanan darah 120/80 mmHg, nadi 88 kali/menit, pernafasan 24 kali/menit, suhu 37,7 derajat celcius. Apa diagnosis pasien diatas?', 'tetanus ', 'kaku kuduk ', 'trismus ', 'meningitis bakteri ', 'meningitis virus ', '1', 32, 3),
(456, 'Pasien datang dengan penurunan kesadaran 3 jam yang lalu. Riwayat DM selama 10 tahun. Rutin mengkonsumsi obat DM yaitu Sulfonilurea dan Metformin. Pemeriksaan penunjang yang pertama dilakukan adalah? ', 'Darah lengkap ', 'Analisa gas darah ', 'Keton darah ', 'Test fungsi ginjal ', 'Glukosa darah sewaktu', '5', 31, 18),
(457, 'Seorang laki-laki 65 tahun diantar anaknya dengan penurunan kesadaran sejak 2 hari yang lalu. Dari pemeriksaan fisik didapatkan ekstremitas bagian kanan tidak dapat digerakan dan tekanan darah 220/110 mmHg. CT-scan didapatkan hasil hipodens. apa diagnosis pasien diatas? ', 'stroke infark ', 'stroke hemoragic ', 'TIA ', 'perdarahan subaracnoid ', 'perdarahan intracerebral ', '1', 32, 4),
(458, 'Pasien wanita seorang guru mengeluh sulit tidur sejak 1 minggu yang lalu. Pasien sedang menyiapkan lomba menggambar dan mewarnai seprovinsi. Kepala sekolah sudah mengingatkan untuk beristirahat namun pasien menyangkal karena merasa dia masih memiliki tanggung jawab untuk kegiatan ini.. Pasien sering membagi-bagikan alat melukis dan mewarnai pada siswa yang ditemuinya dijalan yang dibeli menggunakan uang pribadinya, Dia mengatakan bahwa itu merupakan hasil karyanya yang paling canggih. 2 tahun yang lalu pasien mengalami fase sedih ketika ditinggalkan suami bekerja di luar kota.. Diagnosisnya adalah ', 'Gangguan skizoafektif', 'Gangguan bipolar fase kini manik tanpa ciri psikotik', 'Gangguan bipolar fase kini manik dengan ciri psikotik', 'Gangguan depresi berat dengan ciri psikotik', 'Gangguan depresi berat tanpa ciri psikotik', '2', 31, 19),
(459, 'Pasien datang dengan keluhan mual sejak 2 minggu. Riwayat DM positif sejak 10 tahun. \nRutin mengkonsumsi obat DM Sulfonilurea, Metformin dan multivitamin. Hasil pemeriksaan GDS 277 mg/dL. Yang menyebabkan timbulnya keluhan pada pasien tersebut adalah? \n', 'Riwayat DM ', 'Kadar glukosa darah sewaktu ', 'Sulfonilurea ', 'Metformin ', 'Multivitamin', '4', 31, 20),
(460, 'Laki- laki 55 tahun diantar ke IGD dengan dengan penurun setelah KKL. Pemeriksaan neurologi membuka mata dengan rangsangan nyeri, menjawab pertnyaan dengan meraung, dan motorik kedua tangan di fleksikan. berapa GCS pasien tersebut? ', 'E2V2M3 ', 'E2V2M2 ', 'E2V2M3 ', 'E3V2M2 ', 'E3V3M3 ', '1', 32, 5),
(462, 'Seorang wanita berusia 29 tahun, merasa ada dewi ular pada dirinya. Sudah satu bulan ini ia merasa dimasuki oleh dewi ular ini. Suami pasien bercerita keluhan ini sudah 1 tahun lamanya, pasien juga sering sedih menangis, jalan-jalan, linglung, dan sering menyendiri. Riwayat penyakit dahulu, pasien sering ngamuk-ngamuk keliling kampong. Pasien merupakan lulusan SD, tidak bekerja dan miskin. Apa diagnosis ibu tersebut?', 'Depresi berat dengan psikotik ', 'Gangguan wahan ', 'Skizofrenia ', 'Retardasi mental ', 'Psikosis', '5', 32, 6),
(463, 'Pasien laki- laki berusia54 tahun sulit dibangunkan ketika tidur. Pasien memiliki riwayat DM 10 tahun yang lalu. Pemeriksaan menunjukkan tekanan darah 90/50 mmHg, nadi 120 kali/menit, pernafasan 20 kali/menit, akral dingin, dan keringat dingin. Pemeriksaan glukosa darah sewaktu 35 mg/dl. Penanganan yang harus dilakukan adalah...', 'Infus D40%', 'Injeksi D40% bolus+ infus Nacl 0,9%', 'Injeksi D40% bolus+ infus D10%', 'D40% bolus', 'Infus D 10%', '3', 33, 1),
(464, 'Wanita usia 60 tahun datang dengan keluhan 4 hari tidak bisa BAB dan flatus. 2 hari terakhir keluhan disertai muntah berwarna coklat kehijauan. Sejak 6 bulan pasien mengaku  BAB mulai tidak lancar. Pemeriksaan fisik menunjukkan abdomen distensi, darm countur positif, dan darm steifung positif. Pemeriksaan radiologis yang tepat adalah...', 'Usg abdomen', 'Colon in loop', 'Foto polos abdomen 3 posisi', 'Barium meal', 'Apendikgram', '3', 33, 2),
(465, 'Laki-laki berusia 55 tahun datang dengan keluhan nyeri kepala dan nyeri tengkuk sejak 2 hari yang lalu. Pasien tidak diketahui memiliki riwayat hipertensi dan DM. Pemeriksaan fisik tekanan darah 170/90 mmHg dan kesan cardiomegali, Pemeriksaan laboratorium menunjukkan urin protein +2, reduksi +3, dan GDS 245. Apakah obat yang tepat?', 'ACE inhibitor', 'Beta bloker', 'Ca chanel bloker', 'Furosemid', 'HCT', '1', 33, 3),
(466, 'Seorang perempuan berusia 39 tahun mengeluhkan kelebihan berat badan sejak kelahiran anak keduanya. Ia merasa stress dan melampiaskan stress dalam pekerjaan rumah dan mengemil. Konseling apa yang tepat untuk diberikan kepada ibu ini? ', 'Konseling CEA individu ', 'Konseling modifikasi gaya hidup ', 'Konseling CEA keluarga ', 'Konseling “catharsis education action” individu ', 'Konsling psikoterapi ', '3', 32, 7),
(467, 'Anak usia 8 tahun datang ke poliklinik dengan keluhan bengkak pada pergelangan kaki kanan bawah. 1 bulan sebelumnya ada keluhan serupa tetapi di siku. Pemeriksaan fisik tampak bengkak, hiperemis, dan tidak mudah digerakan pada pergelangan kaki kanan bawah. Diagnosis yang paling tepat?', 'Reactive rheumatoid', 'Demam rematik akut', 'Penyakit jantung rematik', 'Juvenille rhematoid arthritis', 'Osteoarthritis', '4', 33, 4),
