(469, 'Seorang laki-laki berusia 47 tahund atang dengankeluhan merasakan lemah dan selalu merasa sedih. Keluhan tersebut disertai rasa sulit tidur dan jika sudah terbangun tengah malam sulit untuk kembali tidur. Nafsu amkan berkurang, dan sudah dirasakan sejak selama 1 bulan terakhir. Apakah diagnosis pasien ini? ', 'Siklotimik ', 'Distimik ', 'Gangguan depresi ', 'Skizoafektif tipe depresif ', 'Gangguan cemas menyeluruh', '3', 32, 8),
(470, 'Anak kecil berusia 7 tahun datang ke klinik dengan keluhan bengkak pada kelopak mata dan kaki. Orang tua pasien juga mengeluhkan kencing pasien menjadi lebih keruh. Setelah dilakukan pemeriksaan di air kencing nya terdapat protein. Apalagi kemungkinan yang dapat ditemukan di pemeriksaan laboratorium?', 'Hipoalbuminemia', 'Hipoglikemi', 'Hipokolesterolemia', 'Anemia', 'Hiperlabuminemia', '1', 33, 6),
