(474, 'Seorang wanita usia 57 tahun datang dengan keluhan mata buram. Selain itu keluhan disertai dengan silau ketika ada cahaya. Dari pemeriksaan visus didapatkan OD 1/60, OS 6/60,  TIO ODS 17,3 dan Shadow test positif. Dari kasus tersebut diagnosa paling tepat adalah?', 'ODS matur', 'ODS imatur', 'ODS hipermatur', 'OD matur, OS imatur', 'OD matur, OS hipermatur', '2', 33, 8),
