(479, 'Seorang wanita 27 tahun datang ke puskesmas dengan keluhan sering buang air kecil. Keluhan dirasakan nyeri dan panas di sekitar kemaluan saat kencing. Pasien mengaku jarang minum air putih dan punya kebiasaan sering menahan kencing. Dari pemeriksaan fisik didapatkan nyeri tekan suprapubik. Laboratorium menunjukkan epitel transisional (+3), leukosit (+2), dan nitrit (+3). Diagnosis klinis yang paling tepat adalah...', 'Cystitis', 'Batu saluran kemih ', 'Pyelonefritis ', 'Uretritis ', 'Glomerulonefritis ', '1', 33, 12),
