(483, 'Di sebuah daerah sedang terjadi wabah DBD. Para anggota pramuka ingin melakukan pemberantasan jentik nyamuk dari rumah ke rumah. Namun para anggota pramuka belum pernah melakukannya dan mereka meminta dokter Puskesmas untuk memberikan pengobatan. Cara yang paling tepat dilakukan adalah : ', 'Bilik kerja ', 'Brainstorming ', 'Leaflet ', 'Guidance and counseling ', 'Flip Chart ', '4', 32, 11),
