(485, 'Bayi usia 5 hari datang ke UGD RS dengan keluhan muntah tidak menyembur tapi berwarna kehijauan. Berat badan lahir 2450 gram. Pada pemeriksaan fisik perut lembek datar tidak cembung, Bising usis jarang. Pada pemeriksaan foto abdomen di dapatkan double bubble. Diagnosa untuk kasus tersebut adalah?', 'Obstruksi pintu keluar lambung', 'Obstruksi yeyenum', 'Obstruksi ileum', 'Obstruksi duodenum', 'Destruktif meckel', '4', 33, 17),
