(495, 'Pria 54 tahun sering sekali mengalami nyeri dada selama 15 menit saat beraktifitas. Bapak itu selalu pake suatu obat dari dokter untuk menghilangkan nyerinya. Karena terlalu sering dipakai, obat itu menjadi tidak bisa menghilangkan nyeri dadanya lagi. Dokter beralasan karena ada toleransi terhadap obat. Obat apa yang biasa dipake oleh pasien?', 'Nitrogliserin', 'Morfin', 'Aspirin', 'Furosemid', 'Oksigen', '1', 34, 3),
