(497, 'Laki-laki 22 tahun datang dengan keluhan tidak bisa BAK. Pasien memilikiiwayat makan jengkol dan sambal. Apa terapi yang tepat?', 'Furosemid', 'Spironolakton', 'Cairan natrium bikarbonat', 'Fluoxetin', 'Ciprofloxacin', '3', 34, 4),
