(500, 'Wanita 28 tahun mengeluh adanya benjolan di payudara kanan. Benjolan dahulu sebesar biji kedalai namun sekarang sebesar telur ayam. Pada pemeriksaan fisik ditemukan benjolan dengan diameter 5 cm, berbatas tegas, mobile, tidak ditemukan nyeri, tanda radang maupun tanda keganasan. Apa tindakan yang harus dilakukan? ', 'Eksisi ', 'Insisi ', 'Deboulking ', 'Ekstirpasi ', 'Mastitis radikal ', '1', 34, 6),
