(504, 'Seorang laki-laki 18 tahun datang ke RS dengan keluhan kedua tungkai sulit digerakkan setelah ditabrak motor dari samping. Dari pemeriksaan fisik didapatkan tekanan darah 110/70 mmHg, nadi 88 kali/menit, frekuensi nafas 20kali/menit, GCS 12, luka tidak ada, anestesi terasa di setinggi umbilicus ke bawah, kedua tungkai sulit digerakkan. Pemeriksaan penunjang yang tepat adalah?', 'Pemeriksaan elektrolit lengkap ', 'EMG ekstremitas inferior ', 'Rontgen vertebra lumbosakral AP lateral ', 'Aspirasi sumsum tulang ', 'MRI vertebra lumbosakral', '5', 34, 8),
