(507, 'Seorang laki-laki 25 tahun dibawa ke UGD setelah mengalami kecelakaan lalu lintas. Pasien mengalami penurunan kesadaran (sopor). Pada pemeriksaan fisik tekanan darah  90/60 mmHg, nadi 120 kali/menit, frekuensi nafas 24 kali/menit, dan akral dingin. Pada paha kiri tampak darah merembes keluar terus dan susah berhenti. Perkiraan jumlah volume perdarahan yang terjadi adalah…', '500cc ', '750cc ', '1000cc ', '1500cc ', '2500cc ', '4', 34, 10),
