(514, 'Seorang anak usia 11 bulan dibawa orangtuanya dengan anggota tubuh bagian kanan tidak bisa bergerak bebas, ketika diberi mainan tangan kanan menggenggam dan tidak berusaha meraih mainan. Riwayat saat kelahiran, ibu diinduksi karena ketuban pecah dini. Anak baru menangis 1 jam setelah lahir, disertai kejang 1 menit. Anak lalu dimasukkan incubator selama 10 hari, berat badan lahir 3000 panjang badan lahir 49 cm. Faktor risiko apa yang menyebabkan kelainan tersebut?', 'ketuban pecah dini ', 'induksi persalinan ', 'kejang 1 menit ', 'infeksi intrakranial ', 'asfiksia neonatorum ', '1', 34, 16),
