(567, 'Anak 6 tahun datang dengan keluhan pitak di kepala sejak 2 minggu. Kadang gatal dan mengganggu tidur. Hasil pemeriksaan alopesia diameter 3 cm dengan titik hitam di tengahnya. Dari pemeriksaan lab didapatkan hifa sejati pada batang rambut. Penanganan yang tepat adalah...', 'Krimmikonazol ', 'Sampobifonazol ', 'Tablet ketokonazol ', 'Tablet griseofulvin ', 'Tablet amfoterisin B ', '4', 37, 8),
(568, 'Laki laki 24 tahun datang dengan keluhan gatal pada lipatan paha sejak 2 minggu yang lalu. Gatal bertambah saat berkeringat. Lesinya makula dengan tepi polisiklik, vesikel dan papula, dengan central healing di lipatan paha, perineum, dan perianal. Diagnosanya adalah... ', 'Herpes simpleks ', 'Tinea kruris ', 'Tinea korporis ', 'Eritrasma ', 'Kandidiasis intertriginosa ', '2', 37, 9),
(569, 'Anak usia 3 tahun  mengalami nyeri perut. Sejak 2 hari yang lalu diare berair. Pasien dibawa ke puskesmas dan diberi antibiotik kemudian sembuh. Hari ini keluar lendir darah. Anak merintih kesakitan. Pemeriksaan fisik menunjukkan defans muskular positif dan teraba masa di perut kiri atas, sedangkan erut kanan bawah kosong. Pada colok dubur teraba portio like sign. Diagnostik yang sekaligus terapinya adalah:', 'Barium enema', 'laparoskopi', 'Laparotomi', 'Minum air', 'medikamentosa', '1', 38, 3),
(570, 'Anak laki-laki usia 10 tahun dibawa ibunya berobat dengan keluhan gatal-gatal di tangan badan dan genital. Gatal dirasakan sejak 1 minggu terutama saat malam hari. Abang pasien yang tidur bersama dengan pasien jugas udahmerasakan keluhan yang sama. Dari hasil pemeriksaan fisik didapatkan vesikel di sela jari tangan dan di sekitar pubis. Penatalaksanan dari segi kedokteran komunitas? ', 'Tidak perlu di terapi karena self limiting disease ', 'Hanya pasien yg diterapi sampa sembuh ', 'Pasien dan abangnya yg tidurbersama ', 'Seluruh keluarga ', 'Anak dan kelompok umur yg rentan ', '4', 37, 10),
(571, 'Seorang laki-laki usia 58 tahun datang ke UGD dengan keluhan nyeri perut bawah. Keluhan disertai nyeri saat berkemih. Dari pemeriksaan fiisk, ditemukan nyeri tekan suprapubis. Pada pemeriksaan urin, leukosit 3+. Apakah diagnosa pada pasien ini?', 'Nefrolithiasis', 'Pielonefritis', 'Urolithiasis', 'Ureterolithiasis', 'cystitis', '5', 38, 4);
INSERT INTO `bf_soal` (`id`, `question_name`, `answer1`, `answer2`, `answer3`, `answer4`, `answer5`, `answer`, `ujian_id`, `urutan`) VALUES
(572, 'Pasien anak-anak perempuan 7 tahun datang diantar ibunya dengan keluhan panas tinggi sejak 3 hari yang disertai batuk dan pilek. Pada pemeriksaan didapatkan faring hiperemis, tonsil hiperemis T2-T2, kripte melebar, dan terdapat sedikit bercak putih di permukaannya. Apa diagnosisnya?', 'Faringitis ', 'Tonsilitis', 'Tonsilofaringitis ', 'Laringitis ', 'Difteri ', '3', 37, 11),
(573, 'Seorang wanita 52 tahun mengeluhkan sesak sejak 3 bulan yang lalu dan memeberat dalam 3 hari ini. Pasien juga mengeluhkan batuk berdahak disertai dahak berwarna merah muda. Saat ini pasien dalam kondisi lemah dengan tekanan darah 190/100 mmHg, nadi 92 kali/menit, dan pernafasan 36 kali/menit. Dokter memutuskan untuk melakukan hemodialisa. Alasan dokter melakukan hemodialisa adalah, kecuali..', 'Edema paru akut', 'Hipokalemia', 'Perikarditis', 'Asidodis metabolic', 'Alkalosis respiratorik', '2', 38, 5),
(574, 'Seorang pasien pria 30 tahun datang dengan keluhan nyeri tenggorokan sejak 2 minggu yang lalu. Keluhan disertai demam dan  nyeri saat menelan. Pada pemeriksaan didapatkan pembesaran unilateral, fluktuasi fossa supratonsiler negatif, uvula terdesak ke arah kontralateral dan terdapat pembesaran kelenjar leher ipsilateral. Pada pemeriksaan cairan ruang peritonsiler didapatkan cairan darah, tetapi pus negatif. Diagnosisnya? ', 'Abses tonsil ', 'Abses parafaring ', 'Abses peritonsiler ', 'Abses faring ', 'Paratonsilar infiltrate ', '5', 37, 12),
(575, '146.	Pasien berusia 6 tahun, mengeluh mata bengkak sejak 5 hari yang lalu. 2 hari yang lalu mengeluh demam dan nyeri pinggang. Kencingnya berbentuk gumpalan berwarna kecoklatan. Apa yang perlu diperiksakan?', 'Ureum', 'Kreatinin', 'Albumin urin', 'Glukosa urin', 'Keton urin', '3', 38, 6),
(576, 'Pasien laki-laki usia 8 tahun datang dengan keluhan keluar darah berwarna merah segar dari hidung sejak 10 menit yang lalu. Sebelumnya pasien mengeluh pilek dan bersin-bersin agak keras. Pertolongan pertama yang dilakukan adalah...', 'Pasien tidur dan disuruh menengadahkan kepala dan memencet di antara kedua mata ', 'Pasien tidur miring dan memencet di antara kedua mata ', 'Pasien duduk dan menengadahkan kepala dan memencet di antara kedua mata ', 'Pasien duduk dan memiringkan kepala ke kiri dan memencet di antara kedua mata ', 'Pasien duduk dan memencet kedua cuping hidung ke arah sekat hidung ', '5', 37, 13),
(577, '147.	Wanita berusia 54 tahun datang ke UGD dengan keluhan tidak bisa encing sejak 2 hari ini. Saat dipasang kateter, hanya keluar air kencing sebanyak 10 cc. Pasien mengeluhkan kedua kaki bengkak, mual muntah, dan lemas. Hasil pemeriksan  tekanan darah 180/90 mmHg, nadi 80 kali/menit, pernafasan 28 kali/menit, asam urat 10 mg/dL, Ur/Cr 210/8, dan GDS 225 mg/dL. Penanganan awal yang harus dilakukan pada pasien tersebut adalah', 'Dialysis', 'Furosemid', 'Allopurinol', 'Diet rendah garam', 'insulin', '4', 38, 7),
(578, 'Anak 5 tahun datang dengan keluhan nyeri telinga, demam, lesu, dan tidak nafsu makan. Pada pemeriksaan telinga didapatkan membrane timpani merah menonjol dan tidak didapatkan perforasi. Diagnosis kasus adalah...', 'Otitis media serosa akut ', 'Otitis media kronis ', 'Folikulitits ', 'Miringitis ', 'Otitis eksterna ', '1', 37, 14),
(579, 'Wanita 18 tahun, datang dengan keluhan bengkak pada tungkai dan wajah sembab sejak 1 minggu. Sesak nafas tidak ada dan dari urinalisis ditemukan  protein (+++). Penyebab keluhan tersebut:', 'Permeabilitas kapiler meningkat', 'Tekanan hidrostatis kapiler meningkat', 'Tekanan koloid osmotik intersisil meningkat', 'Tekanan koloid osmotik plasma meningkat', 'Tekanan koloid osmotik plasma menurun', '5', 38, 8),
(580, 'Seorang wanita 30 tahun dengan keluhan bersin-bersin dan keluar cairan encer dari hidung sejak 3 hari yang lalu. Dalam beberapa hari ini cairan yang keluar dari hidung menjadi kental. Pemeriksaan hidung didapatkan konka hiperemis, oedem, terdapat cairan kental. Diagnosis kasus diatas adalah...', 'Rhinitis alergi ', 'Rhinitis vasomotor', 'Sinusitis maksilaris ', 'Rhinitis akuata ', 'Sinusitis frontalis ', '4', 37, 15),
(581, 'Seorang wanita 32 tahun datang dengan keluhan hidung gatal dan sering bersin-bersin sejak 1 tahun yang lalu. Dari hidung keluar cairan encer yang dirasakan terus menerus sampai mengganggu konsentrasi saat bekerja. Pemeriksaan hidung didapatkan kavum nasi sempit, konka oedem, dan tidak terdapat cairan serosa. Diagnosisnya adalah... ', 'Rhinitis alergi intemiten sedang ', 'Rhinitis alergi intermiten sedang-berat ', 'Rhinitis alergi persisten ringan ', 'Rhinitis alergi persisten sedang ', 'Rhinitis alergi persisten berat ', '5', 37, 16),
(582, 'Wanita 23 tahun datang ke poli RS dengan keluhan berat badan berlebih dalam 2 bulan ini. Satu bulan ini, pasien sudah mengalami kenaikan berat badan sebanyak 4 Kg walaupun sudah diet seimbang. Pasien juga mengeluhkan nyeri epigastrium dan adanya garis kebiruan di kulit perut. Tekanan darah 150/90 mmHg, nadi 80 kali/menit, pernafasan 23 kali/menit, dan GDS 210 mg/dL. Apa penyebab terjadinya keluhan pada pasien?', 'Glikolisis meningkat', 'Glikogenesis meningkat', 'Defisiensi insulin relative', 'Defisiensi insulin absolute', 'Peningkatan glukokortikoid', '5', 38, 9),
(583, 'Seorang ibu membawa anak laki-laki berumur 3 tahun yang sejak semalam mengeluh sakit ditelinga kirinya. Sejak 3 hari yang lalu anak tersebut demam, tetapi batuk pilek disangkal. Nyeri tekan tragus positif, MAE tidak ditemukan kelainan, membrana timpani mencembung dan hiperemis, tetapi tidak ditemukan sekret. Diagnosis apa yang tepat? ', 'Otitis Media Efusi ', 'Otitis Media Kronis ', 'Otitis Media Akut ', 'Otitis Eksterna Difusa ', 'Otitis Eksterna Sirkumkripta ', '3', 37, 17),
(584, 'laki-laki 47 tahun datang ke UGD dengan keluhan demam dan kaki kanan bernanah akibat terkena paku 2 minggu yang lalu. Luka meluas sampai punggung kaki dan berbau busuk tapi psien tidak merasakannya. Hasil pemeriksaan didapatkan GDS 450 mg/dL. Pasien memiliki riwayat DM sejam 10 tahun yang lalu, namun tidak terkontrol. Obat yang tepat untuk pasien adalah..', 'sulfonylurea', 'biguanid', 'acarbose', 'insulin', 'glinid', '4', 38, 10),
(585, 'Seorang wanita usia 29 tahun datang ke praktek anda mengeluhkan kedua telinga berkurang pendengarannya. Penurunan pendengaran sudah dirasa sejak 2 bulan yang lalu, namun semakin lama semakin menjadi. Pasien merasakan pendengaran sebelumnya normal, pasien berbicara dengan suara pelan meski ditempat yang ramai. Pasien juga sering merasa telinganya berdenging menganggu dan sering merasakan pusing. Diagnosis apa yang tepat?', 'Otosklerosis ', 'Timpanoskerosis ', 'Kolesteatom ', 'Serumen prop ', 'Mastoiditis ', '1', 37, 18),
(586, 'wanita 34 tahun datang ke UGD dengan keluhan nyeri dada sejak 2 bulan yang lalu. Pasien tidak menstruasi selama 5 bulan ini. Pasien mengeluh sulit tidur, sering berkeringat, dan BB turun. Pada pemerksaan fisik didapatkan keadaan umum tampak kurus, suhu 37,8˚C, tekanan darah 160/70mmHg, nadi cepat, irama tidak teratur, volume berubah-ubah, aritmia, dan tampak edema pretibial. Pada pemeriksaan penunjang tes kehamilan negatif dan GDS=140 mg/dL. Komplikasi yang terjadi pada pasien ini adalah...', 'CAD', 'Ca hepar', 'Hipoglikemia', 'Krisis tiroid', 'Gagal jantung', '1', 38, 11),
(587, 'Seorang laki-laki 70 tahun mengeluhkan tungkai dan lengan kiri tidak bisa digerakkan sejak kemarin secara mendadak. Selain itu juga mengeleuh bicara pelo dan mulut mencong. Tanda vital menunjukkan tekanan darah 200/100 mmHg. Dari pemeriksaan didapatkan hemiplegi sinistra. Pemeriksaan penunjang apakah yang paling tepat untuk mendiagnosis kasus tersebut? ', 'CT-Scan', 'Elektrokardiografi ', 'Echocardiografi ', 'Elektromiografi ', 'Foto rontgen kepala ', '1', 37, 19),
(588, 'Seorang wanita berusia 15 tahun dibawa ke UGD oleh keluraganya karena penurunan kesadaran. Sebelumnya pasien sering mengeuh kencing di malam hari. Pasien mengalami penurunan berat badan 7 Kg dalam 3 bulan. Tekanan darah 80/60 mmHg, nadi 140 kali/menit, pernafasan 34kali/menit, nafas cepat dan dalam, serta GDS 356 mg/dL. Apakah penyebab kematian tersering pada pasien seperti ini?', 'Dehidrasi', 'Edema cerebri', 'Sepsis', 'Gagal jantung', 'Gagal nafas', '2', 38, 12),
(589, 'Seorang laki-laki 65 tahun mengaku gemetar pada jari-jari tangan sejak 3 bulan yang lalu. Dari pemeriksaan didapatkan tremor jari-jari tangan, postur berjalan condong ke depan dan Cogwheel phenomen. Neurotransmitter apa yang paling menurun di otak pada pasien di atas? ', 'Asetil kolin ', 'Epinefrin ', 'Norepenefrin ', 'Dopamin', 'Serotonin ', '4', 37, 20),
(590, 'Laki-laki, umur 49 tahun, datang dengan keluhan sering pipis, dan badannya semakin kurus. Riwayat ibu dari pasien menderita diabetes mellitus. BB : 80 kg, TB : 170 cm. Pemeriksaan penunjang : Gula darah puasa : 90 mg/dl , gula darah 2 jam setelah makan : 160 mg/dl. Apa penatalaksanaan yang tepat bagi pasien ini?', 'Per Oral Sulfonylurea', 'Per Oral thiazolidinedione', 'Olahraga ringan 5x/minggu', 'Olahraga berat 2x/minggu', 'Insulin gargline sekali sehari', '1', 38, 13),
(591, 'Wanita, 22 tahun, mengeluh sering gemetaran dan jantung berdebar-debar setiap saat. Akhir-akhir ini juga mengeluhkan berat badan yang semakin menurun dan gampang berkeringat. Pemeriksaan penunjang apakah yang tepat untuk dilakukan?', 'TSH', 'FT4', 'T3', 'T4', 'T3 re-uptake', '2', 38, 14),
(592, 'Seorang laki-laki 30 tahun datang ke UGD dengan keluhan urin keruh, keluhan dirasakan seringkali setelah makan makanan berlemak. Tida ada nyeri saat berkemih. Pasien tinggal di daerah endemis filarial. Edema ekstremitas inferior negatif/positif. Tanda vital tekanan darah 120/90 mmHg,  nadi 84 kali/menit, pernafasan 20 kali/menit. Kemungkinan penyebab urin keruh pada kasus diatas adalah:', 'Protein', 'Nitrit', 'Urobilin', 'Kelenjar limfe', 'pus', '2', 38, 15),
(593, 'seorang pria bekerja yang bekerja sebagai penyadap karet dibawa oleh istrinya karena bengkak-bengkak pada tungkai sejak 1 tahun yang lalu  dan semakin memberat sampai sulit berjalan. Terdapat edema skrotum dan kiluria. Kapan seharusnya pemeriksaan lab dilakukan?', '1 jam', '2 jam', '3 jam', '4 jam', '5 jam', '3', 38, 16),
(594, 'Anak berusia 9 tahun dibawa ibunya ke dokter karena lemas terus, pucat, dan prestasi belajar menurun. Dari pemeriksaan fisik didapatkan pucat dan anemis. Laboratorium menunjukkan Hb 7,8 mg/dL, eosinofilia meningkat, dan pada fecal smear ditemukan telur berdinding tipis. Apakah pengobatan yang tepat pada pasien ini?', 'Tinidazol', 'Tiabendazol', 'Albendazole', 'Metronidazole', 'Ketoconazole', '3', 38, 17),
(595, 'Seorang Ibu membawa anakanya yang berusia 6 tahun dengan keluhan gatal dan kemerahan di daerah dubur. Keluhan dirasakan sejak 3 ari yang lalu. Pasien tinggal dengan keluarganya yang berjumlah 6 orang. Rumah pasien padat penduduk dan banyak yang mengalami keluhan yang sama. Apakah yang ditemukan pada pemeriksaan?', 'Telur pada pemeriksaan feses', 'Filariform pada pemereiksaan feses', 'Proglotid gravid pada pemeriksaan feses', 'Telur pada peneriksaan swab', 'Rhabditiform pada pemeriksaan feses', '4', 38, 18),
(596, '159.	Pasien 30 tahun datang dengan keluhan demam yang dirasakan sejak 3 hari yang lalu. Demam dirasakan pada sore hari, meningkat pada malam hari. Pasien mengalami mual, nyeri ulu hati, dan diare dengan frekuensi 3x/hari. Pada pemeriksaan fisik didapatkan tekanan darah 110/70 mmHg, nadi 98 kali/menit, pernafasan 20 kali/menit, suhu 37˚C, dan tampak lidah kotor dengan tepi kemerahan. Spesimen yang perlu diperiksa untuk keperluan diagnosis adalah….', 'Urin', 'Darah', 'Feses', 'Swab tenggorok', 'Cairan pleura', '2', 38, 19),
(597, 'Laki-laki, 18 tahun, datang dengan keluhan utama demam yang disertai mual dan muntah. Pada pemeriksaan fisik didapatkan konjungtiva ikterik dan BAK berwarna seperti teh. Pada pemeriksaan penunjang didapatan SGOT & SGPT meningkat 2 kali dari normal, bilirubin 2 mg/dL, anti HAV negatif, HBsAg negatif, IgM anti HBc positif, Ig G anti HBc negatif, dan HCV RNA negatif. Apakah diagnosis pada pasien ini? ', 'Hepatitis A', 'Hepatitis B akut', 'Hepatitis B kronis', 'Hepatitis C akut', 'Hepatitis C kronis', '2', 38, 20),
(598, 'Laki-laki berusia 40 tahun, mengeluh diare yang hilang timbul sejak 2 bulan ini. Selain itu, pasien juga mengeluhkan sakit pada ulu hati. Pada pemeriksaan fisik didapatkan nyeri tekan epigastrium positif dan pada pemeriksaan feses didapatkan gambaran trofozoit bilateral simetris berbentuk jambu monyet. Apakah terapi yan g tepat pada pasien ini?', 'Albendazole', 'Mebendazole', 'Thiabendazole', 'Pyrantel pamoat', 'Metronidazole', '5', 39, 1),
(599, 'Wanita, hamil 18 minggu melakukan pemeriksaan screening toxoplasma. Dari pemeriksaan tersebut didapatkan hasil IgM anti toxoplasma 1:100. Berselang 4 minggu setelah pemeriksaan tersebut, didapatkan hasil igM antitoxoplasma menjadi 1:400. Terapi apakah yang tepat untuk prevensi penyakit tersebut?', 'Spiramycin', 'Sulfadiazine', 'Klindamisin', 'Acyclovir', 'Penisilin ', '1', 39, 2),
(600, 'Laki-laki berusia 29 tahun mengeluh demam, lemah badan. Pada pemeriksaan darah didapatkan adanya eritrosit membesar dan terdapat bintik-bintik scuffner. Apakah penyebab penyakit ini?', 'Plasmodium vivax', 'Plasmodium ovale', 'Plasmodium falsiparum', 'Plasmodium malariae', 'Plasmodium knowlesi', '1', 39, 3),
(601, 'Laki-laki berusia 29 tahun dibawa keluarganya karena kejang selama 5 menit, terdapat penurunan kesadaran sejak 2 hari. Terdapat 2 minggu ini demam dan 2 tahun ini pasien menggunakan narkoba dan suka bertukar suntik dengan temannya. Pasien suka makan makanan setengah matang. Apakah diagnosa pasien ini?', 'Ensefalitis Toxoplasma', 'Meningitis Bakterial', 'Ensefalitis Bakterial', 'Status epileptikus', 'Malaria serebral', '1', 39, 4),
(602, 'Seorang laki-laki 68 tahun dibawa ke UGD dengan keluhan sesak sejak 3 hari yang lalu. Sejak 2 minggu yang lalu mengalami batuk berdahak. Pasien merupakan perokok kronis sejak SMA sebanyak kurang lebih 1 pak per hari. Dari hasil pemeriksaan fisik tekanan darah 120/90 mmHg, nadi 84 kali/menit, pernafasan 28 kali/menit, dan suhu 37,8˚C. Pemeriksaan kepala leher nafas cuping hidung, retraksi otot strenokleidomastoideus. Pemeriksaan thorax tampak barrel chest dan retraksi interkostal, palpasi hiperinflasi, perkusi hipersonor, dan auskultasi bronkovesikuler menjauh. Apakah terapi awal pada pasien tersebut?', 'Oksigenasi dan antibiotic intravena', 'Oksigenasi dan beta agonis inhalasi', 'Oksigenasi dan kortikosteroid inhalasi', 'Oksigenasi dan methylxantine oral', 'Oksigenasi dan antileukotrien oral', '2', 39, 5),
(603, 'Pasien usia 70 tahun, datang dengan keluhan sesak yang dirasakan sejak 6 bulan yang lalu, namun memberat 2 hari yang lalu. Pasien merupakan perokok aktif 20 batang/hari. Pemeriksaan fisik tekanan darah 140/90 mmHg, pernafasan 34 kali/menit, wheezing positif saat ekspirasi, rhonki di basal paru positif di kiri dan kanan, dan diafragma rendah. Apakah diagnosis pada pasien ini?', 'Bronchitis', 'Bronkiektasis', 'PPOK eksaserbasi akut', 'Asma bronkiale', 'atelektasis', '3', 39, 6),
(604, 'Pasien diabawa ke UGD dengan keluhan pandangan kabur mendadak, lemas dan pucat. Dari anamnesa pasien baru saja tertidur di mobil ber AC dan tertutup. Di UGD pasien mengalami penurunan kesadaran dan kejang. Pasien kemungkinan didiagnosa dengan?', 'Monoksida', 'Sianida', 'CO2', 'CO', 'karbonsulfat', '4', 39, 7),
(605, 'Seorang wanita keluhan sesak nafas. Pernah didiagnosa sebagai rhinitis alergica. Skin patch test positif. Hasil lab yang mendukung adalah?', 'Eosinofil naik', 'Basofil naik', 'Monosit naik', 'Eosinofil turun', 'Basofil turun', '1', 39, 8),
(606, 'Seorang wanita datang dengan keluhan sesak. Sesak sejak 1 bulan ini makin lama makin memberat, dan mengganggu aktivitasnya, muncul setiap hari. Pemeriksaan fisik didapatkan wheezing seluruh lapangan paru. Apa diagnosa?', 'Asma terkontrol', 'Asma terkontrol sebagian', 'Asma tidak terkontrol', 'Asma persisten', 'Asma serangan akut berat', '5', 39, 9),
(607, '170.	Seorang wanita usia 50 tahun, datang mengeluh keluar cairan putih dari kemaluan sejak 3 hari yang lalu. Hasil papsmear menunjukkan keganasan pada mulut rahim. Tindakan yang dilakukan dokter adalah :', 'Menyarankan konsul psikiatri', 'Memandang sinis', 'Menyarankan banyak beribadah', 'Menyarankan banyak beraktivitas', 'Melakukan konseling individu', '5', 39, 10),
(608, 'Seorang wanita usia 20 tahun, G1P0A0 38 minggu mengeluh nyeri kepala dan nyeri epigastrium. Tekanan darah 180/110 mmHg, denyut nadi 96 kali/menit, frekuensi nafas 28 kali/menit, DJJ bayi 132 kali/menit, dengan taksiran berat janin 2800 gram. Diagnosis yang tepat adalah :', 'Preeklampsia ringan', 'Preeklampsia sedang', 'Preeklampsia berat', 'Eklampsia', 'Eklampsia puerpuralis', '4', 39, 11),
(609, 'Pasien wanita 45 tahun G1P0A0 usia kehamilan 36 minggu, datang kontrol. Pada pemeriksaan Leopold 1 : fundus setinggi processus xyphoideus, leopold 2 : meraba punggung di kiri, dan leopold 3 teraba lunak. Presentasi bayi tersebut :', 'Letak kepala', 'Letak oblique', 'Letak kaki', 'Letak lintang', 'Letak sungsang', '5', 39, 12),
(610, 'Pasien wanita usia 40 tahun G4P3Ab000 datang mengeluh hipertensi sejak kehamilan ketiganya sampai sekarang. Saat ini tekanan darah 170/110 mmHg dan protein +2. Diagnosis yang tepat :', 'Gestasional hipertensi', 'Preeklampsia ringan', 'Preeklampsia sedang', 'Hipertensi kronis', 'Hipertensi kronis dengan superimpose preeklampsia', '5', 39, 13),
(611, 'Wanita 23 tahun menggunakan KB hormonal untuk pertama kali 1 bulan lalu. saat ini pasien mengeluh timbul bercak-bercak darah di jalan lahir sejak 1 minggu dan konsultasi pada anda. Apa yang anda sarankan :', 'Meningkatkan dosis estrogen', 'Meningkatkan dosis progesteron', 'Meneruskan KB dan dievaluasi selama 2 bulan', 'Mengganti kontrasepsi lain', 'Mengganti dengan KB bifasik', '1', 39, 14),
(612, 'Perempuan 16 tahun tinggal di pedalaman indonesia timur tidak pernah ANC. Komplikasi kelahiran yang tidak didampingi tenaga kesehatan adalah :', 'BBLR', 'Prematur', 'Gemeli', 'Defisiensi Fe', 'Kelemahan perinatal', '5', 39, 15),
(613, 'Wanita 30 tahun, datang dengan keluhan tidak haid. Pasien menggunakan KB suntik 3 bulan, berhenti sudah 7 bulan, tapi masih tidak haid. Pasien mengeluhkan mual dan muntah. hCG (+). Pemeriksaan fisik teraba di ½ pusat-simfisis, DJJ 160x/menit. Kapan pasien harus kontrol lagi?', '1 minggu', '2 minggu', '3 minggu', '4 minggu', '6 minggu', '4', 39, 16),
(614, 'Pasien wanita 28 tahun G1P0A0 32 minggu, datang dengan keluhan perdarahan pervaginam disertai nyeri. Pemeriksaan fisik didapatkan tinggi fundus ½ umbilikus. Bagian bawah bayi tidak teraba. Diagnosa yang tepat:', 'Inpartu', 'Abortus', 'Plasenta praevia', 'Solusio plasenta', 'Ruptur uterus', '4', 39, 17),
(615, 'Wanita 21 tahun, G2P1A0 dengan keluhan perdarahan jalan lahir sejak 1 hari yang lalu. Nyeri abdomen bawah disangkal. Diagnosis yang tepat :', 'Abortus insipien', 'Abortus iminen', 'Abortus inkomplit', 'Abortus komplit', 'Abortus septik', '2', 39, 18),
(616, 'Anak usia 2 tahun tidak sengaja meminum racun serangga, kemudian memuntahkannya. Pasien dibawa ke UGD RS. Apa yang harus dilakukan?', 'Atropin', 'Dopamin', 'Adrenalin', 'Trans', 'Metoklopramid', '1', 39, 19),
(617, 'Anak 2 tahun datang dengan panas tinggi dan kejang. Saat kejang , kaki & tangan pasien kaku, matanya melirik ke atas. Setelah fase kejang selesai, dia menangis. Apa yang harus dilakukan? ', 'antikejang per rectal', 'antipiretik per rectal', 'antipiretik iv', 'antipiretik iv & antikejang im', 'baju dibuka, dikompres dingin', '1', 39, 20),
(618, 'Anak laki-laki 5 tahun datang dengan keluhan tidak bisa berjalan sejak 3 hari. 1 minggu sebelumnya sempat demam, pilek, dan nyeri kepala. Pemeriksaan fisik kekuatan otot kaki kanan 5, kaki kiri , dan sensibilitas normal. Refleks fisiologis kanan normal, kiri menurun. Diagnosisnya….', 'GBS', 'Myastenia gravis', 'Polineuritis', 'Polimyelitis', 'Spondilitis TB', '1', 40, 1),
(619, 'Anak usia 9 tahun datang dengan keluhan BAK merah seperti air rendaman daging. Keluhan juga disertai bengkak pada mata. Tanda vital menunjukkan tekanan darah 140/80 mmHg, nadi 80 kali/menit, dan suhu 37,80C. Pemeriksaan fisik didapatkan edema orbita. Pemeriksaan lab kadar ASTO meningkat. Terapi untuk pasien ini?', 'Eritromisin', 'Penisilin', 'Kloramfenicol', 'Kotrimoksazol', 'Vancomisin', '2', 40, 2),
(620, 'Anak usia 2 tahun batuk pilek sejak 4 bulan yang lalu. Riwayat sering batuk dan pilek, tidak didapatkan riwayat atopi pada keluarga. Wheezing pada lapangan paru. Diagnosis?', 'Asma bronkiale', 'Bronkitis akut', 'Pneumonia', 'Bronkiolitis', 'TB Paru', '4', 40, 3),
(621, 'Anak diare 3 hari yang lalu, takikardi, takipneu, lemah, mata cowong, produksi urin sedikit. Komplikasi pada pasien ini adalah', 'Gagal ginjal prerenal', 'Gagal ginjal intrarenal', 'Gagal ginjal post renal', 'Gagal ginjal kronis', 'Gaga ginjal kronis on acute', '1', 40, 4),
(622, 'Anak-anak berusia 7 tahun datang dengan keluhan demam yang tidak tinggi, juga terdapat batuk lama. Pada anak ini akan diperiksa matoux tes, dengan apakah pemeriksaan ini dilakukan?', 'Tuberculin 0,1 mg IM', 'Tuberculin 0,1 mg SC', 'Tuberculin 0.1 mg IntraKutan', 'BCG 0,1 mg IM', 'BCG 0,1 mg SC', '3', 40, 5),
(623, 'Seorang anak berusia 10 tahun datang dengan keluhan diare selama 3 hari ini. Feses berlendir dan berdarah, selain itu disertai nyeri perut dan mual . Terdapat gambaran mikro seperti berikut.\n<p><image src="http://www.medinatryout.com/produk/development/tokonline/assets/uploads/images/ukdi(1).bmp" style="width=200px"></p>\n Apa mikroorganisme pada \ngambar tersebut?', 'Balantidium coli', 'Entamoeba histolytica', 'Cacingan', 'Cryptosporodium', 'Gardenella', '2', 40, 6),
(624, 'Anak diare sejak usia 7 bulan, tiap 3 hari sekali. Riwayat susu formula positif. BB tidak seperti anak sebayanya. Riwayat lahir normal. Apakah diagnosis pada pasien ini?', 'Gizi ringan', 'Gizi sedang', 'Gizi buruk ', 'Gangguan pertumbuhan', 'Gangguan absorbsi', '5', 40, 7),
(625, 'Seorang laki-laki 20 tahun dibawa ke UGD dengan kaki kanan berlumuran darah setelah kecelakaan lalu lintas. Tanda-tanda vital tekanan darah 70/50mmHg, nadi 60kali/menit, teraba lemah, pernafasan 23 kali/menit, suhu 37,6˚C dengan akral dingin, pucat, dan terdapat open fraktur complete femoris dextra. Apakah diagnose pasien tersebut?', 'Shock anafilaktik', 'Shock hipovolemik', 'Shock kardiogenik', 'Shock neurogenik', 'Shock obstruktif', '2', 40, 8),
(626, 'Seorang laki-laki 29 tahun, seorang tukang bangunan mengeluh muntah-muntah dan perut kembung. Sejak 3 tahun yang lalu pasien mendapati benjolan di lipat paha kanan yang bisa keluar masuk. Namun pagi ini benjolan keluar dan tidak dapat masuk lagi. Pemeriksaan fisik peristaltic usus meningkat, pembengkakan skrotum kanan yang tidak bisa masuk ke abdomen, kemerahan, dan nyeri tekan. Transluminasi negative. Tanda vital tekanan darah 130/80 mmHg, nadi 80 kali/menit, pernafasan 20 kali/menit, dan suhu 37,8˚C. Apakah diagnose awal saat pasien masuk UGD?', 'Hernia inguinal inkarserata', 'Hernia inguinalis reponibilis', 'Hernia femoralis', 'Hidrocele', 'Hernia inguinal strangulata', '5', 40, 9),
(627, 'Seorang laki-laki 20 tahun dibawa ke UGD dengan cedera kepala berat akibat kecelakaan lalu lintas. Setelah operasi pasien dipindahkan ke ruang perawatan intensif. Dokter merencanakan pemberian nutrisi. Bagaimana cara pemberian nutrisi yang tepat untuk pasien tersebut?', 'Nutrisi parenteral sentral', 'Nutrisi parenteral perifer', 'Nutrisi enteral via NGT', 'Nutrisi peroral', 'Nutrisi enteral via jejunostomi karena lambung tidak bisa digunakan', '2', 40, 10),
(628, 'Seorang pria 35 tahun akan melakukan eksisi lipoma dengan anestesi lokal. Lidokain 2% 10 mg dan adrenalin 2 mg. Tiba-tiba pasien tidak sadar dan kejang. Tanda vital tekanan darah 70/40 mmHg , nadi 120 kali/menit, pernafasan 20 kali/menit, dan perfusi cukup. Apakah penanganan awal pada pasien ini?', 'Rujuk', 'defibrillator', 'Infus RL cepat', 'Nafas buatan', 'Pijat jantung', '3', 40, 11),
(629, 'Pasien berusia 38 tahun, mengeluh keluar benjolan di anus sejak 1 minggu yang lalu. Pasien juga mengeluhkan susah BAB dan berdarah setiap kali BAB sejak 2 bulan. Setelah diinspeksi terdapat massa coklat kemerehan di anus. Setelah dioperasi, didapatkan massa dengan epitel berlpis gepeng dan epitel kolumnar. Apakah diagnosisnya', 'Hemoroid', 'Hemangioma', 'Fistula ani', 'Polip ani', 'Karsinoma ani', '1', 40, 12),
(630, 'Pria, berusia 70 tahun, datang ke UGD dengan keluhan luka berbau di telapak kaki sejak 3 hari yang lalu. Riwayat terkena beling di telapak kaki, diobati sendiri namun tidak sembuh. Pada pemeriksaan fisik didapatkan luka bernanah, tepi kehitaman, berbau. Apakah mikroorganisme penyebabnya?', 'Pseudomonas aeruginosa', 'Clostridium perfringens', 'C.tetani', 'Staphylococcus aureus', 'Eschericia coli', '1', 40, 13),
(631, 'Korban gempa, selama 5 hari masih bertahan dari manakah ATP didapatkan?', 'Asam urat untuk otot', 'Keton untuk otak', 'Keton untuk eritrosit', 'Glukosa untuk otak', 'Glukosa untuk eritrosit', '2', 40, 14),
(632, 'Laki-laki usia 30 tahun pergi ke UGD setelah jatuh memperbaiki lampu, jatuh dengan tangan kanan menopang tubuh. Dari gambaran radiologi didapatkan retak pada medial maleolus humeri dextra. Otot apa yang mungkin terpengaruh?', 'Flexor carpi radialis', 'Flexor carpi ulnaris', 'Extensor carpi ulnaris', 'Pronator teres', 'Brachialis', '4', 40, 15),
(633, 'Pasien kecelakaan tidak sadarkan diri, dirangsang nyeri membuka mata sedikit, tangan dua-duanya kea rah samping kepala, kaki goyang-goyang sedikit, suara merintih kesakitan. Berapa GCS pasien ini?', 'E3 M5 V2', 'E2 M5 V3', 'E2 M5 V2 ', 'E2 M4 V3', 'E2 M4 V2', '3', 40, 16),
(634, 'Wanita dengan pembesaran tiroid. Pemeriksaan fisik nodul tiroid. Pemeriksaan awal yang dilakukan…', 'radioaktif iodine', 'MRI colli', 'ct-scan colli', 'FNAB', 'USG colli', '1', 40, 17),
(635, 'Seorang pria usia 40 tahun datang ke IGD RS dengan keluhan nyeri pada perut sebelah kanan atas dan menjalar ke punggung. Pasien sebelumnya diketahui makan bakso dan jeroan sapi tanpa sayuran. Pasien memiliki riwayat kolestrol tinggi, suka makan  berlemak, serta jarang makan sayur maupun olahraga. Tanda vital dalam batas normal. Organ apakah yang terlibat dalam kasus di atas?', 'Gaster', 'Hepar', 'Pancreas', 'Usus 12 jari', 'Kandung empedu', '5', 40, 18),
(636, 'Seorang wanita post KLL tampak mengantuk namun saat diminta membuka mata bisa membuka spontan. Saat ditanya siapa dan dimana bingung dan disorientasi. Saat dicubit menarik tangan dan seolah akan menghindar. GCS?', '5', '8', '10', '11', '15', '3', 40, 19),
(637, 'Laki-laki 21 tahun mengeluh nyeri perut kiri atas menembus ke bahu kiri sejak 1 jam yang lalu. Riwayat terjatuh dari motor 1 hari yang lalu. Pada pemeriksaan ditemukan distensi abdomen dan perkusi pada perut kiri atas pekak. Tekanan darah 90/50 mmHg, nadi 110 kali/menit, dan pernafasan 20 kali/menit. Kemungkinan yang terjadi?', 'Trauma lien', 'Trauma hepar', 'Trauma colon desenden', 'Trauma ginjal sinistra', 'Trauma gaster', '1', 40, 20);
